ed to improve the stability of plugin and theme updates. Please make sure the server has write permissions to this directory.'=>'%s каталогу бар, бирок жазуу үчүн жеткиликтүү эмес. Бул плагиндин жана теманын жаңыртууларынын туруктуулугун жогорулатуу үчүн колдонулат. Сураныч, сервердин бул каталогго жазууга уруксаты бар экенин текшериңиз.','The temporary backup directory exists but is not writable'=>'Убактылуу камдык каталогу бар, бирок жазуу үчүн жеткиликтүү эмес','The %s directory exists but is not writable. This directory is used to improve the stability of theme updates. Please make sure the server has write permissions to this directory.'=>'%s каталогу бар, бирок жазуу үчүн жеткиликтүү эмес. Бул теманын жаңыртууларынын туруктуулугун жогорулатуу үчүн колдонулат. Сураныч, сервердин бул каталогго жазууга уруксаты бар экенин текшериңиз.','Theme temporary backup directory exists but is not writable'=>'Теманын убактылуу камдык көчүрмөлөрүнүн каталогу бар, бирок жазуу үчүн жеткиликтүү эмес','The %s directory exists but is not writable. This directory is used to improve the stability of plugin updates. Please make sure the server has write permissions to this directory.'=>'%s каталогу бар, бирок жазуу үчүн жеткиликтүү эмес. Бул плагиндин жаңыртууларынын туруктуулугун жогорулатуу үчүн колдонулат. Сураныч, сервердин бул каталогго жазууга уруксаты бар экенин текшериңиз.','Plugin temporary backup directory exists but is not writable'=>'Плагиндин убактылуу камдык көчүрмөлөрүнүн каталогу бар, бирок жазуу үчүн жеткиликтүү эмес','The %1$s and %2$s directories exist but are not writable. These directories are used to improve the stability of plugin updates. Please make sure the server has write permissions to these directories.'=>'%1$s жана %2$s каталогдору бар, бирок жазуу үчүн жеткиликтүү эмес. Алар плагин жаңыртууларынын туруктуулугун жогорулатуу үчүн колдонулат. Сураныч, сервердин бул каталогдорго жазууга уруксаты бар экенин текшериңиз.','Plugin and theme temporary backup directories exist but are not writable'=>'Плагиндердин жана темалардын убактылуу камдык көчүрмөлөрүнүн каталогдору бар, бирок жазуу үчүн жеткиликтүү эмес','The %s directory cannot be located.'=>'%s каталогу табылган жок.','The %s directory used to improve the stability of plugin and theme updates is writable.'=>'Плагин жана тема жаңыртууларынын туруктуулугун жогорулатуу үчүн колдонулган %s каталогу жазуу үчүн жеткиликтүү.','Plugin and theme temporary backup directory is writable'=>'Плагиндер жана темалар үчүн убактылуу камдык каталог жазууга болот','Could not determine available disk space for updates.'=>'Жаңыртуулар үчүн жеткиликтүү диск мейкиндигин аныктоо мүмкүн болбой жатат.','Available disk space is critically low, less than 20 MB available. Proceed with caution, updates may fail.'=>'Диск мейкиндиги өтө аз, жеткиликтүү 20 МБ кем. Этияттык менен улантыңыз, жаңыртуулар ишке ашпай калышы мүмкүн.','Available disk space is low, less than 100 MB available.'=>'Дискте жеткиликтүү орун аз, 100 МБ кем.','%s available disk space was detected, update routines can be performed safely.'=>'Жеткиликтүү диск мейкиндигинин %s табылды, жаңыртуулар коопсуз аткарууга болот.','Disk space available to safely perform updates'=>'Коопсуз жаңыртуу үчүн жеткиликтүү диск мейкиндиги','Table ordered by Hierarchical Menu Order and Title.'=>'Таблица иерархиялык меню тартиби жана аталышы боюнча иреттелген.','Table ordered by Title.'=>'Таблица аталышы боюнча иреттелген.','Table ordered by Date.'=>'Таблица датасы боюнча иреттелген.','Table ordered by Comments.'=>'Таблица комментарийлер боюнча иреттелген.','Table ordered by Uploaded To.'=>'Таблица жүктөө максаты боюнча иреттелген.','Table ordered by Author.'=>'Таблица автор боюнча иреттелген.','Table ordered by File Name.'=>'Таблица файлдын аты боюнча иреттелген.','Descending.'=>'Кемүү.','Ascending.'=>'Өсүү.','Sort descending.'=>'Кемүү боюнча иреттөө.','Sort ascending.'=>'Өсүү боюнча иреттөө.','Table ordered by Rating.'=>'Таблица рейтинг боюнча иреттелген.','Table ordered by Visibility.'=>'Таблица көрүнүшү боюнча иреттелген.','Table ordered by URL.'=>'Таблица URL боюнча иреттелген.','Table ordered by Name.'=>'Таблица аты боюнча иреттелген.','Current Server time'=>'Учурдагы сервер убактысы','Current UTC time'=>'Учурдагы UTC убактысы','Current time'=>'Учурдагы убакыт','Ordered by Comment Date, descending.'=>'Комментарий күнү боюнча иреттелген, кемүү.','Table ordered by Post Replied To.'=>'Таблица комментарий жазылган жазуу боюнча иреттелген.','Table ordered by Comment Author.'=>'Таблица комментарийлердин авторлору боюнча иреттелген.','Attempting to restore the previous version.'=>'Мурунку нускасына кайтууга аракет кылуу.','More details.'=>'Кененирээк.','Find your team &rarr;'=>'Өзүңүздүн командаңызды табыңыз &rarr;','Finding the area that aligns with your skills and interests is the first step toward meaningful contribution. With more than 20 Make WordPress teams working on different parts of the open source WordPress project, there&#8217;s a place for everyone, no matter what your skill set is.'=>'Сиздин жөндөмүңүзгө жана кызыкчылыктарыңызга дал келген тармакты табуу маанилүү салым кошуунун биринчи кадамы болуп саналат. Ачык булактуу WordPress долбоорунун ар кайсы бөлүктөрүндө иштеген 20дан ашык Make WordPress командалары менен, сиздин жөндөмүңүзгө карабастан, бардыгы үчүн орун бар.','Shape the future of the web with WordPress'=>'WordPress менен Интернеттин келечегин түзүңүз','WordPress app: Kotlin, Java, Swift, Objective-C, Vue, Python, and TypeScript.'=>'WordPress колдонмосу: Kotlin, Java, Swift, Objective-C, Vue, Python жана TypeScript.','WordPress Core and Block Editor: HTML, CSS, PHP, SQL, JavaScript, and React.'=>'Өзөк жана Блок редактору: HTML, CSS, PHP, SQL, JavaScript жана React.','WordPress embraces new technologies, while being committed to backward compatibility. The WordPress project uses the following languages and libraries:'=>'WordPress артка шайкештикти сактоо менен бирге жаңы технологияларды колдонот. WordPress долбоору төмөнкү тилдерди жана китепканаларды колдонот:','<strong>Contribute</strong> to the code, improve the UX, and test the WordPress app.'=>'<strong>Салым кошуңуз</strong> кодго, UX\'ти жакшыртууга жана WordPress колдонмосун сыноого.','<strong>Write</strong> and submit patches to fix bugs or help build new features.'=>'<strong>Жазыңыз</strong> каталарды оңдоп же жаңы функцияларды түзүп жана оңдоолорду жөнөтүп.','<strong>Test</strong> new releases and proposed features for the Block Editor.'=>'<strong>Сынап көрүңүз</strong> жаңы чыгарылыштарды жана блок редакторунун сунушталган функцияларын.','<strong>Find</strong> and report bugs in the WordPress core software.'=>'<strong>Табыңыз</strong> негизги WordPress программасынан каталарды, алар жөнүндө кабарлаңыз.','If you do code, or want to learn how, you can contribute technically in numerous ways:'=>'Эгер сиз код жазсаңыз же үйрөнүүнү кааласаңыз, техникалык жактан салым кошуунун көптөгөн ыкмалары бар:','Code-based contribution'=>'Кодду жазуу аркылуу катышуу','<strong>Explore</strong> ways to reduce the environmental impact of websites.'=>'<strong>Изилдеңиз</strong> миллиондогон веб-сайттардын айлана-чөйрөгө тийгизген таасирин азайтуу жолдорун.','<strong>Edit</strong> videos and add captions to WordPress.tv.'=>'<strong>Түзөтүңүз</strong> WordPress.tv сайтында видеону, субтитрлерди кошуп.','<strong>Lend</strong> your creative imagination to the WordPress UI design.'=>'<strong>Көрсөтүңүз</strong> өзүңүздүн чыгармачылык фантазияңызды WordPress колдонуучу интерфейсинин дизайнына.','<strong>Organize</strong> or participate in local Meetups and WordCamps.'=>'<strong>Уюштуруңуз</strong> же катышыңыз, жергиликтүү WordPress жолугушууларына жана WordCamp\'терге.','<strong>Curate</strong> submissions or take photos for the Photo Directory.'=>'<strong>Кураторлоо</strong> жарыяланган материалдарды же WordPress сүрөт каталогуңуз үчүн сүрөткө тартыңыз.','<strong>Promote</strong> the WordPress project to your community.'=>'<strong>Жайылтыңыз</strong> коомчулукта WordPress долбоорун.','<strong>Create</strong> and improve WordPress educational materials.'=>'<strong>Түзүңүз</strong> жана өркүндөтүңүз WordPress окуу материалдарын.','<strong>Translate</strong> WordPress into your local language.'=>'<strong>Которуңуз</strong> WordPress\'ти өз тилиңизге.','<strong>Write</strong> or improve documentation for WordPress.'=>'<strong>Жазыңыз</strong>  же жакшыртыңыз WordPress үчүн документтерди.','<strong>Share</strong> your knowledge in the WordPress support forums.'=>'<strong>Бөлүшүңүз</strong> өз билимиңиз менен WordPress колдоо форумдарында.','WordPress may thrive on technical contributions, but you don&#8217;t have to code to contribute. Here are some of the ways you can make an impact without writing a single line of code:'=>'WordPress техникалык салымдардын негизинде өнүгө алат, бирок салым кошуу үчүн код жазуунун кереги жок. Бул жерде сиз коддун бир сабын жазбай эле таасир эте турган бир нече жолдор бар:','No-code contribution'=>'Программалоосуз катышуу','Grow your network and make friends.'=>'Тармагыңызды өркүндөтүңүз жана досторду табыңыз.','Apply your skills or learn new ones.'=>'Өз жөндөмүңүздү колдонуңуз же жаңысын үйрөнүңүз.','Be part of a global open source community.'=>'Ачык булак долбоорлорунун жалпы жамаатынын бир бөлүгү болуңуз.','Join the diverse WordPress contributor community and connect with other people who are passionate about maintaining a free and open web.'=>'WordPress салым кошуучуларынын коомчулугуна кошулуңуз жана эркин жана ачык интернетти сактоону каалаган башка адамдар менен байланышыңыз.','Do you use WordPress for work, for personal projects, or even just for fun? You can help shape the long-term success of the open source project that powers millions of websites around the world.'=>'Сиз WordPress\'ти жумушка, жеке долбоорлорго же жөн гана көңүл ачуу үчүн колдоносузбу? Сиз дүйнө жүзү боюнча миллиондогон веб-сайттарды иштеткен ачык булактуу долбоордун узак мөөнөттүү ийгилигин камсыз кылууга жардам бере аласыз.','Be the future of WordPress'=>'WordPress\'тин келечеги болуңуз','<a href="%1$s">Learn WordPress</a> is a free resource for new and experienced WordPress users. Learn is stocked with how-to videos on using various features in WordPress, <a href="%2$s">interactive workshops</a> for exploring topics in-depth, and lesson plans for diving deep into specific areas of WordPress.'=>'<a href="%1$s">Learn WordPress</a> бул WordPress\'тин жаңы жана тажрыйбалуу колдонуучулары үчүн бекер булак. Learn ар кандай WordPress функциялары үчүн видеолорду, темаларды терең изилдөө үчүн <a href="%2$s">интерактивдүү иш-аракеттерди</a> жана белгилүү бир WordPress аймактарын терең изилдөө үчүн сабак пландарын камтыйт.','<a href="https://wordpress.org/support/forums/">Support forums</a>'=>'<a href="https://ru.wordpress.org/support/forums/">Колдоо форумдары</a>','<a href="https://wordpress.org/documentation/article/appearance-widgets-screen-classic-editor/">Documentation on Widgets</a>'=>'<a href="https://wordpress.org/documentation/article/appearance-widgets-screen-classic-editor/">Виджеттер боюнча документтер</a>','<strong>View</strong> takes you to a public author archive which lists all the posts published by the user.'=>'<strong>Көрүү</strong> сизди колдонуучу тарабынан жайгаштырылган бардык жазуулардын коомдук архивине алып барат.','<strong>Download file</strong> downloads the original media file to your device.'=>'<strong>Файлды жүктөө</strong> сизден түпнуска медиа файлды колдонмоңузга жүктөп алууну сунуштайт.','site editor title tagEditor'=>'Редактор','<a href="https://wordpress.org/documentation/article/plugins-themes-auto-updates/">Documentation on Auto-updates</a>'=>'<a href="https://wordpress.org/documentation/article/plugins-themes-auto-updates/">Автоматтык жаңыртуулар боюнча документтер</a>','<a href="https://wordpress.org/documentation/article/customize-date-and-time-format/">Documentation on date and time formatting</a>.'=>'<a href="https://wordpress.org/documentation/article/customize-date-and-time-format/">Дата жана убакыт форматтоо боюнча документтер</a>.','You can set the language, and WordPress will automatically download and install the translation files (available if your filesystem is writable).'=>'Сиз тилди тандай аласыз жана котормо файлдары автоматтык түрдө жүктөлүп алынат жана орнотулат (эгерде файл системасы жазууга жарамдуу болсо).','If you want site visitors to be able to register themselves, check the membership box. If you want the site administrator to register every new user, leave the box unchecked. In either case, you can set a default user role for all new users.'=>'Эгер сиз сайттын конокторун каттоодон өтүшүн кааласаңыз, кутучаны белгилеңиз. Эгерде сиз сайттын администратору ар бир жаңы колдонуучуну катташын кааласаңыз, кутучаны белгилөөсүз калтырыңыз. Кандай болгон күндө да, сиз бардык жаңы колдонуучулар үчүн демейки колдонуучу ролун орното аласыз.','Both WordPress URL and site URL can start with either %1$s or %2$s. A URL starting with %2$s requires an SSL certificate, so be sure that you have one before changing to %2$s. With %2$s, a padlock will appear next to the address in the browser address bar. Both %2$s and the padlock signal that your site meets some basic security requirements, which can build trust with your visitors and with search engines.'=>'WordPress URL жана сайттын URL дареги тең %1$s же %2$s менен башталышы мүмкүн. %2$s менен башталган URL SSL сертификатын талап кылат, андыктан %2$s дарегине өтүүдөн мурун сизде сертификат бар экенин текшериңиз. %2$s колдонулуп жатканда, браузердин дарек тилкесинде даректин жанында кулпу сөлөкөтү пайда болот. %2$s да, кулпу сөлөкөтү да сиздин сайтка келгендердин жана издөө системаларынын ишенимине ээ боло турган кээ бир негизги коопсуздук талаптарына жооп берерин билдирет.','Though the terms refer to two different concepts, in practice, they can be the same address or different. For example, you can have the core WordPress installation files in the root directory (<code>https://example.com</code>), in which case the two URLs would be the same. Or the <a href="%s">WordPress files can be in a subdirectory</a> (<code>https://example.com/wordpress</code>). In that case, the WordPress URL and the site URL would be different.'=>'Бул терминдер эки башка түшүнүктү билдирсе да, иш жүзүндө алар бир эле же ар башка даректер болушу мүмкүн. Мисалы, сизде түпкү каталогдо негизги WordPress орнотуу файлдары болушу мүмкүн (<code>https://example.com</code>), мындай учурда эки URL бирдей болот. Же <a href="%s">WordPress файлдары ички каталогдо болушу мүмкүн</a> (<code>https://example.com/wordpress</code>). Бул учурда, WordPress URL дареги жана веб-сайттын URL дареги ар башка болот.','Two terms you will want to know are the WordPress URL and the site URL. The WordPress URL is where the core WordPress installation files are, and the site URL is the address a visitor uses in the browser to go to your site.'=>'Сиз билишиңиз керек болгон эки термин бар: WordPress URL жана Сайттын URL. WordPress URL негизги WordPress орнотуу файлдары жайгашкан жерде, ал эми Сайттын URL дареги – конок сиздин сайтка өтүү үчүн браузерде колдонгон дарек.','RoboHash (Generated)'=>'RoboHash (Түзүлгөн)','site editor menu itemEditor'=>'Редактор','Allow <a href="%s">trackbacks and pingbacks</a>'=>'Уруксат берүү <a href="%s">кайра шилтемелер жана эскертмелер</a>','https://wordpress.org/documentation/article/assign-custom-fields/'=>'https://wordpress.org/documentation/article/assign-custom-fields/','https://wordpress.org/documentation/article/what-is-an-excerpt-classic-editor/'=>'https://wordpress.org/documentation/article/what-is-an-excerpt-classic-editor/','%s expects a non-empty string.'=>'%s бош эмес сапты күтүп жатат.','The destination directory already exists and could not be removed.'=>'Дайындоо папкасы эчак эле бар жана аны жок кылуу мүмкүн эмес.','The destination folder already exists.'=>'Дайындоо папкасы эчак эле бар.','The source and destination are the same.'=>'Баштапкы жана дайындалган бирдей.','https://wordpress.org/documentation/article/changing-file-permissions/'=>'https://wordpress.org/documentation/article/changing-file-permissions/','Expand or collapse the elements by clicking on their headings, and arrange them by dragging their headings or by clicking on the up and down arrows.'=>'Элементтер башты чыкылдатуу, башты сүйрөө менен иретке келтирүү же өйдө/төмөн жебелерди чыкылдатуу менен кеңейтилип жана жыйыштырылышы мүмкүн.','Download &#8220;%s&#8221;'=>'Жүктөп алуу &#8220;%s&#8221;','The "%s" argument must be a non-empty string.'=>'"%s" аргументи бош эмес сап болууга тийиш.','<a href="https://wordpress.org/documentation/article/write-posts-classic-editor/">Documentation on Writing and Editing Posts</a>'=>'<a href="https://wordpress.org/documentation/article/write-posts-classic-editor/">Жазмаларды түзүү жана түзөтүү боюнча документтер</a>','<a href="https://wordpress.org/documentation/article/keyboard-shortcuts-classic-editor/#keyboard-shortcuts-for-comments">Documentation on Keyboard Shortcuts</a>'=>'<a href="https://wordpress.org/documentation/article/keyboard-shortcuts-classic-editor/#keyboard-shortcuts-for-comments">Ыкчам баскычтар боюнча документтер</a>','<a href="https://wordpress.org/documentation/article/understand-comment-spam/">Documentation on Comment Spam</a>'=>'<a href="https://wordpress.org/documentation/article/understand-comment-spam/">Комментарий спамы боюнча документтер</a>','<a href="https://wordpress.org/documentation/article/customizer/">Documentation on Customizer</a>'=>'<a href="https://wordpress.org/documentation/article/customizer/">Теманы ыңгайлоо боюнча интерфейсинин документтери</a>','https://wordpress.org/download/'=>'https://kir.wordpress.org/download/','This is the final release of WordPress %s'=>'Бул %s WordPress\'тин эң соңку нускасы','Site Editor'=>'Сайттын редактору','<strong>Send password reset</strong> sends the user an email with a link to set a new password.'=>'<strong>Сырсөздү калыбына келтирүү шилтемесин жөнөтүү</strong> - Колдонуучуга жаңы сырсөз коюу үчүн шилтеме менен email кат жөнөтөт.','https://developer.wordpress.org/apis/wp-config-php/#wp-environment-type'=>'https://developer.wordpress.org/apis/wp-config-php/#wp-environment-type','<strong>Copy URL</strong> copies the URL for the media file to your clipboard.'=>'<strong>URL\'ди алмашуу буферине көчүрүү</strong> медиа файлдын URL дарегин алмашуу буферине көчүрөт.','<strong>View</strong> will take you to a public display page for that file.'=>'<strong>Көрүү</strong> бул файлдын жалпыга ачык барагын ачат.','<strong>Delete Permanently</strong> will delete the file from the media library (as well as from any posts to which it is currently attached).'=>'<strong>Биротоло өчүрүү</strong> файлды медиаканадан (ошондой эле ал учурда тиркелген бардык жазуулардан) өчүрөт.','<strong>Edit</strong> takes you to a simple screen to edit that individual file&#8217;s metadata. You can also reach that screen by clicking on the media file name or thumbnail.'=>'<strong>Түзөтүү</strong> бир файлдын метадайындарын түзөтүү үчүн жөнөкөй экранды ачат. Бул экранга медианын атын же эскизди басуу менен да кире аласыз.','Hovering over a row reveals action links that allow you to manage media items. You can perform the following actions:'=>'Тизмени саптын үстүнө жылдырганда, элементти башкарууга мүмкүндүк берген аракет шилтемелери тизмеде көрсөтүлөт. Сиз төмөнкү кадамдарды аткарсаңыз болот:','themesBlock Themes'=>'Блоктун негизиндеги темалар','<a href="https://wordpress.org/documentation/article/block-themes/">Documentation on Block Themes</a>'=>'<a href="https://wordpress.org/documentation/article/block-themes/">Блоктун негизиндеги тема боюнча документтер</a>','Block themes'=>'Блок темалар','With a block theme, you can place and edit blocks without affecting your content by customizing or creating new templates.'=>'Блокко негизделген тема менен сиз жаңы шаблондорду жайгаштыруу же түзүү аркылуу мазмунга таасирин тийгизбестен блокторду жайгаштырып, түзөтө аласыз.','A block theme is a theme that uses blocks for all parts of a site including navigation menus, header, content, and site footer. These themes are built for the features that allow you to edit and customize all parts of your site.'=>'Блокко негизделген Тема — бул сайттын бардык бөлүктөрү, анын ичинде багыттоо менюсу, аталышы, мазмуну жана сайттын төмөнкү бөлүгү үчүн блокторду колдонуучу тема. Бул темалар сайттын бардык бөлүктөрүн түзөтүүгө жана жөндөөгө мүмкүндүк берген функцияларды колдонуу үчүн курулган.','Recommended items are considered beneficial to your site, although not as important to prioritize as a critical issue, they may include improvements to things such as; Performance, user experience, and more.'=>'Сунушталган элементтер сиздин сайтка пайдалуу деп эсептелет, бирок алар орчундуу маселелердей маанилүү болбосо дагы, иштин өркүндөтүлүшү, колдонуучунун тажрыйбасы жана башкалар сыяктуу нерселерди камтышы мүмкүн.','Critical issues are items that may have a high impact on your sites performance or security, and resolving these issues should be prioritized.'=>'Орчундуу маселелер - бул элементтер бул веб-сайттын иштешине же коопсуздугуна чоң таасирин тийгизиши мүмкүн жана бул маселелерди чечүү артыкчылыктуу болушу керек.','The theme you are currently using is not compatible with the Site Editor.'=>'Сайт тарабынан колдонулган тема Сайттын редактору менен шайкеш келбейт.','Configuration rules for %s:'=>'%s үчүн конфигурация эрежелери:','Customize permalink structure by selecting available tags'=>'Жеткиликтүү тегдерден тандап, туруктуу шилтеме түзүмүн жөндөңүз','Select the permalink structure for your website. Including the %s tag makes links easy to understand, and can help your posts rank higher in search engines.'=>'Сайтыңыз үчүн туруктуу шилтеме түзүмүн тандаңыз. %s тегин кошуу шилтемелерди окууга ыңгайлуу кылат жана издөө системаларындагы жазууларыңыздын рейтингин жогорулата алат.','%s removed from permalink structure'=>'%s туруктуу шилтеме түзүмүнөн өчүрүлдү','Site Health %s'=>'Сайттын саламаттыгы %s','Theme Styles & Block Settings'=>'Тема стилдери & Блок жөндөөлөрү','The minimum recommended version of PHP is %s.'=>'Минималдуу сунушталган PHP нускасы %s.','PHP is one of the programming languages used to build WordPress. Newer versions of PHP receive regular security updates and may increase your site&#8217;s performance.'=>'PHP - WordPressти куруу үчүн колдонулган программалоо тилдеринин бири. PHP жаңы нускалары үзгүлтүксүз коопсуздук жаңыртууларын алышат жана сайттын иштешин жакшыртат.','Your site is running on an outdated version of PHP (%s), which soon will not be supported by WordPress. Ensure that PHP is updated on your server as soon as possible. Otherwise you will not be able to upgrade WordPress.'=>'Сайтыңыз PHPдин (%s) эскирген нускасында иштеп жатат, ал жакында WordPress тарабынан колдоого алынбай калат. PHP сервериңизде мүмкүн болушунча тезирээк жаңыртылганын текшериңиз. Болбосо, сиз WordPressти жаңырта албай каласыз.','Your site is running on an outdated version of PHP (%s), which does not receive security updates and soon will not be supported by WordPress. Ensure that PHP is updated on your server as soon as possible. Otherwise you will not be able to upgrade WordPress.'=>'Сиздин сайтыңыз PHP (%s) эскирген нускасында иштеп жатат, ал коопсуздук жаңыртууларын албай жатат жана мындан ары WordPress тарабынан колдоого алынбайт. PHP сервериңизде мүмкүн болушунча тезирээк жаңыртылганын текшериңиз. Болбосо, WordPressти жаңылай албай каласыз.','Persistent object cache'=>'Объекттердин туруктуу кэши','Page cache'=>'Барактын кэши','You should use a persistent object cache'=>'Сиз объекттердин туруктуу кэшин колдонушуңуз керек','Your host appears to support the following object caching services: %s.'=>'Сиздин хостинг төмөнкү объект кэштөө кызматтарын колдойт: %s.','Your hosting provider can tell you if a persistent object cache can be enabled on your site.'=>'Туруктуу объекттин кэшин иштетүү мүмкүнчүлүгү тууралуу хостингиңиздин техникалык колдоосунан биле аласыз.','A persistent object cache is not required'=>'Объекттин туруктуу кэши талап кылынбайт','Learn more about persistent object caching.'=>'Объектти туруктуу кэштөө жөнүндө көбүрөөк билүү.','A persistent object cache makes your site&#8217;s database more efficient, resulting in faster load times because WordPress can retrieve your site&#8217;s content and settings much more quickly.'=>'Объекттердин туруктуу кэши сайттын маалымат базасынын натыйжалуу иштешин камсыздайт, бул жүктөө убактысынын жакшырышына алып келет, анткени WordPress сиздин сайтыңыздын мазмунун жана жөндөөлөрүн тезирээк ала алат.','A persistent object cache is being used'=>'Объекттин туруктуу кеши колдонулат','https://wordpress.org/documentation/article/optimization/#persistent-object-cache'=>'https://wordpress.org/documentation/article/optimization/#persistent-object-cache','A page cache plugin was not detected.'=>'Барактарды кэштөө плагини табылган жок.','A page cache plugin was detected.'=>'Барактарды кэштөө плагин табылды.','There was %d client caching response header detected:'=>'%d кардар тарабынан кештөө аталышы аныкталды:','No client caching response headers were detected.'=>'Жооптун аталыштарында кардар тарабынан кештөө аталыштары табылган жок.','Median server response time was %1$s milliseconds. It should be less than the recommended %2$s milliseconds threshold.'=>'Сервердин орточо жооп берүү убактысы %1$s мс. Ал сунушталган %2$s мс чегинен азыраак болушу керек.','Median server response time was %1$s milliseconds. This is less than the recommended %2$s milliseconds threshold.'=>'Сервердин орточо жооп берүү убактысы %1$s мс. Бул сунушталган %2$s мс чегинен азыраак.','Server response time could not be determined. Verify that loopback requests are working.'=>'Сервердин жооп берүү убактысы аныкталган жок. Артка кайтаруу сурамдары иштегенин текшериңиз.','Page cache is detected but the server response time is still slow'=>'Барактарды кэштөө аныкталды, бирок сервердин жооп берүү убактысы дагы эле жай','Page cache is not detected and the server response time is slow'=>'Барактарды кэштөө аныкталган жок жана сервердин жооп берүү убактысы жай','Page cache is detected and the server response time is good'=>'Барактын кэштөөсү сервердин жооп берүү убактысы менен аныкталды','Page cache is not detected but the server response time is OK'=>'Барактын кэши табылган жок, бирок сервердин жооп берүү убактысы жакшы','Unable to detect page cache due to possible loopback request problem. Please verify that the loopback request test is passing. Error: %1$s (Code: %2$s)'=>'Артка кайтаруу сурамындагы мүмкүн болгон көйгөйдөн улам барактын кэши табылбай калды. Артка сурам сынагы өтүп жаткандыгын текшериңиз. Ката: %1$s (Код: %2$s)','Unable to detect the presence of page cache'=>'Баракты кэштөө бар экендиги аныкталган жок','Learn more about page cache'=>'Барактарды кэштөө жөнүндө көбүрөөк билүү','https://wordpress.org/documentation/article/optimization/#Caching'=>'https://wordpress.org/documentation/article/optimization/#Caching','Page cache is detected by looking for an active page cache plugin as well as making three requests to the homepage and looking for one or more of the following HTTP client caching response headers:'=>'Баракты кэштөө активдүү баракчанын кэш плагинин издөө, ошондой эле негизги баракка үч суроо берүү жана HTTP кардары үчүн төмөнкү кэш аталыштарынын бирин же бир нечесин издөө аркылуу аныкталат:','Page cache enhances the speed and performance of your site by saving and serving static pages instead of calling for a page every time a user visits.'=>'Кэш барактары сайттын ылдамдыгын жана иштешин жогорулатат, ал ар бир кирген сайын барак түзүүнүн ордуна статикалык баракчаларды сактап жана кайтарып берет.','If you are still seeing this warning after having tried the actions below, you may need to contact your hosting provider for further assistance.'=>'Төмөнкү кадамдарды жасагандан кийин дагы бул эскертүүнү көрүп жатсаңыз, кошумча жардам алуу үчүн хостинг колдооңузга кайрылышыңыз керек болушу мүмкүн.','The Authorization header is used by third-party applications you have approved for this site. Without this header, those apps cannot connect to your site.'=>'Авторизациянын аталышы үчүнчү жактын уруксат берилген тиркемелери менен камсыз кылынат. Бул аталышы болбосо, мындай тиркемелер сиздин сайтка туташа албайт.','When testing the REST API, an unexpected result was returned:'=>'REST API сынап жатканда күтүлбөгөн жыйынтык кайтарылды:','REST API Response: (%1$s) %2$s'=>'REST API жообу: (%1$s) %2$s','REST API Endpoint: %s'=>'REST API\'нин акыркы чекити: %s','When testing the REST API, an error was encountered:'=>'REST API сыноодо ката кетти:','Your site is running on an outdated version of PHP (%s), which does not receive security updates. It should be updated.'=>'Сиздин сайт коопсуздук жаңыртууларын албай турган PHP (%s) эскирген нускасында иштейт. Аны жаңыртып туруу керек.','Your site is running on an outdated version of PHP (%s), which does not receive security updates and soon will not be supported by WordPress.'=>'Сиздин сайт коопсуздук жаңыртууларын албай турган PHP (%s) эскирген нускасында иштейт жана жакында WordPress тарабынан колдоого алынбайт.','Requirements'=>'Талаптар','Your site is running on an outdated version of PHP (%s), which soon will not be supported by WordPress.'=>'Сиздин сайтта PHPдин (%s) эскирген нускасы иштеп жатат, ал жакында WordPress тарабынан колдоого алынбай калат.','PHP is one of the programming languages used to build WordPress. Newer versions of PHP receive regular security updates and may increase your site&#8217;s performance. The minimum recommended version of PHP is %s.'=>'PHP - WordPressти түзүү үчүн колдонулган программалоо тилдеринин бири. PHP жаңы нускалары үзгүлтүксүз коопсуздук жаңыртууларын алып, сайттын иштешин жакшыртат. Сунушталган минималдуу PHP нускасы — %s.','Your site does not have any installed themes.'=>'Сайтыңызда орнотулган темалар жок.','Your site does not have any active plugins.'=>'Сиздин сайтта активдүү плагиндер жок.','Another attempt will be made with the next release.'=>'Кийинки чыгарылышта дагы бир аракет жасалат.','The %1$s constant is defined as %2$s'=>'Туруктуу %1$s %2$s катары аныкталган','The %1$s argument must be a non-empty string for %2$s.'=>'%1$s аргументи %2$s үчүн бош эмес сап болушу керек.','The %s argument must be an array.'=>'%s аргументи массив болушу керек.','- %1$s version %2$s%3$s'=>'- %1$s нускасы %2$s%3$s','- %1$s (from version %2$s to %3$s)%4$s'=>'- %1$s (%2$s нускасынан %3$s чейин)%4$s','Reach out to WordPress Core developers to ensure you\'ll never have this problem again.'=>'Бул көйгөй сизде эч качан кайталанбашы үчүн, WordPress негизги иштеп чыгуучуларына кайрылыңыз.','Important! Your version of WordPress (%1$s) will stop receiving security updates in the near future. To keep your site secure, please <a href="%2$s">update to the latest version of WordPress</a>.'=>'Маанилүү! Сиздин WordPress нускаңыз (%1$s) жакын арада коопсуздук жаңыртууларын алууну токтотот. Сайтыңыздын коопсуздугу үчүн <a href="%2$s">WordPress\'ти эң акыркы нускасына жаңыртыңыз</a>.','Important! Your version of WordPress (%1$s) is no longer supported, you will not receive any security updates for your website. To keep your site secure, please <a href="%2$s">update to the latest version of WordPress</a>.'=>'Маанилүү! Сиздин WordPress нускаңыз (%1$s) мындан ары колдоого алынбайт, сайтыңыз мындан ары коопсуздук жаңыртууларын албай калат. Сайтыңыздын коопсуздугу үчүн <a href="%2$s">WordPress\'ти эң акыркы нускасына жаңыртыңыз</a>.','https://make.wordpress.org/core/wordpress-6-5-field-guide/'=>'https://make.wordpress.org/core/wordpress-6-5-field-guide/','Learn more about WordPress %s'=>'WordPress %s тууралуу көбүрөөк билүү','Please type your comment text.'=>'Сураныч, комментарийиңиздин текстин киргизиңиз.','You cannot remove users.'=>'Сиз колдонуучуларды өчүрө албайсыз.','Application passwords grant access to <a href="%1$s">the %2$s site on the network as you have Super Admin rights</a>.'=>'Колдонмонун сырсөздөрү сизге кирүүгө мүмкүнчүлүк берет <a href="%1$s">%2$s тармактын веб-сайтына, анткени сиз Суперадминистраторлук укуктарга ээсиз</a>.','WordPress has been updated! Next and final step is to update your database to the newest version.'=>'WordPress жаңыртылды! Кийинки (жана акыркы) кадам маалымат базасын акыркы нускага жаңыртуу.','<a href="https://wordpress.org/documentation/article/appearance-themes-screen/">Documentation on Managing Themes</a>'=>'<a href="https://wordpress.org/documentation/article/appearance-themes-screen/">Тема башкаруу боюнча документтери</a>','This information is being used to create a %s file.'=>'Бул маалымат %s файлын түзүү үчүн керек.','Welcome to WordPress. Before getting started, you will need to know the following items.'=>'WordPress\'ке кош келиңиз. Баштоодон мурун, сиз төмөнкүлөрдөн кабардар болушуңуз керек.','Settings save failed.'=>'Жөндөөлөрдү сактоо ишке ашкан жок.','After your Privacy Policy page is set, you should edit it.'=>'Купуялык саясат барагын орноткондон кийин, аны түзөтүү сунушталат.','<strong>Error:</strong> Your %1$s file is not <a href="%2$s">writable</a>, so updating it automatically was not possible. These are the mod_rewrite rules you should have in your %1$s file. Click in the field and press %3$s (or %4$s on Mac) to select all.'=>'<strong>Ката:</strong> Эгер %1$s файлы <a href="%2$s">жазыла турган</a> болсо, анда анын жаңыртуусу автоматтык түрдө ишке ашмак, бирок андай эмес, андыктан mod_rewrite эрежелери сиз үчүн бул жерде %1$s файлында болушу керек. Бардык текстти тандоо үчүн талааны, анан %3$s (же Mac\'те %4$s) басыңыз.','<strong>Error:</strong> Your %1$s file is not <a href="%2$s">writable</a>, so updating it automatically was not possible. This is the URL rewrite rule you should have in your %1$s file. Click in the field and press %3$s (or %4$s on Mac) to select all. Then insert this rule inside of the %5$s element in %1$s file.'=>'<strong>Ката:</strong> Эгер %1$s файлы <a href="%2$s">жазыла турган</a> болсо, анда анын жаңыртуусу автоматтык түрдө ишке ашмак, бирок андай эмес, андыктан URL\'ди кайра жазуу эрежелери бул жерде %1$s файлына жайгаштырышыңыз керек. Бардык текстти тандоо үчүн талааны, анан %3$s (же Mac\'те %4$s) басыңыз. Андан кийин бул эрежелерди %1$s файлындагы %5$s элементинин ичине киргизиңиз.','An avatar is an image that can be associated with a user across multiple websites. In this area, you can choose to display avatars of users who interact with the site.'=>'Аватар - бул ар кандай сайттардагы колдонуучу менен байланыштыра турган сүрөт. Бул аймакта сиз өзүңүздүн сайтыңыздагы колдонуучунун аватарларын көрсөтүүнү ыңгайлаштыра аласыз.','Change Permalink Structure'=>'Туруктуу шилтеме түзүмүн өзгөртүү','Howdy ###USERNAME###,

