###SITEURL###','Where your data is sent'=>'Сиздин маалымат кайда жиберилет','Copy &#8220;%s&#8221; URL to clipboard'=>'Буферге &#8220;%s&#8221; URL-ду көчүрүү','Some data that describes the error your site encountered has been put together.'=>'Сайтыңызга туш болгон катаны сүрөттөгөн кээ бир маалыматтар бириктирилди.','An attempt was made, but your site could not be updated automatically.'=>'Аракет жасалды, бирок сиздин сайтыңызды автоматтык түрдө жаңыртуу мүмкүн эмес.','themeActive'=>'Активдүү','The update cannot be installed because some files could not be copied. This is usually due to inconsistent file permissions.'=>'Жаңыртуу орнотулбай койду, анткени кээ бир файлдарды көчүрүү мүмкүн эмес. Бул, адатта, туура эмес файл уруксаттарына байланыштуу.','<strong>Media</strong> &mdash; A list of URLs for media files the user uploads.'=>'<strong>Медиафайл</strong> &mdash; колдонуучу жүктөгөн медиа файлдарынын URL тизмеси.','<strong>Community Events Location</strong> &mdash; The IP Address of the user, which populates the Upcoming Community Events dashboard widget with relevant information.'=>'<strong>Жергиликтүү коомчулуктун окуялары</strong> &mdash; WordPress консолундагы жергиликтүү коомчулуктун окуяларынын виджети тарабынан колдонулган колдонуучунун IP дареги.','WordPress collects (but <em>never</em> publishes) a limited amount of data from registered users who have logged in to the site. Generally, these users are people who contribute to the site in some way -- content, store management, and so on. With rare exceptions, these users do not include occasional visitors who might have registered to comment on articles or buy products. The data WordPress retains can include:'=>'WordPress сайтка кирген катталган колдонуучулардан чектелген маалыматтарды чогултат (бирок <em> эч качан </em> жарыялабайт). Адатта, бул колдонуучулар кандайдыр бир жол менен сайттын ишине салым кошкон адамдар болуп саналат - мазмуну, дүкөн башкаруу, ж.б. Сейрек учурларды эске албаганда, бул колдонуучулар макалаларга комментарий берүү же өнүмдөрдү сатып алуу үчүн катталган кокусунан келген конокторду камтыбайт. WordPress сактаган маалыматтар төмөнкүлөрдү камтышы мүмкүн:','Note: Since this tool only gathers data from WordPress and participating plugins, you may need to do more to comply with export requests. For example, you should also send the requester some of the data collected from or stored with the 3rd party services your organization uses.'=>'Эскертме: Бул курал WordPress жана ага тиешелүү плагиндерден гана маалыматтарды чогултат, андыктан маалыматтарды экспорттоо сурамдарын камсыз кылуу үчүн дагы көп нерсени жасашыңыз керек болот. Эгер сиз алардын кызматтарын бизнес же сайтыңызда пайдалансаңыз, үчүнчү жак тарабынан чогултулган же сакталган маалыматтарды экспорттоону камсыз кылышыңыз керек.','Privacy Laws around the world require businesses and online services to provide an export of some of the data they collect about an individual, and to deliver that export on request. The rights those laws enshrine are sometimes called the "Right of Data Portability". It allows individuals to obtain and reuse their personal data for their own purposes across different services. It allows them to move, copy or transfer personal data easily from one IT environment to another.'=>'Дүйнө жүзүндөгү купуялык мыйзамдары компаниялардан жана онлайн кызматтардан жеке адам жөнүндө чогулткан айрым маалыматтарды экспорттоону жана сурам боюнча ошол экспортту камсыздоону талап кылат. Бул мыйзамдарда бекитилген укуктар кээде «маалыматтарды көчүрүү укугу» деп да аталат. Бул адамдарга ар кандай кызматтарда өздөрүнүн жеке маалыматтарын өз максаттары үчүн алууга жана кайра колдонууга мүмкүнчүлүк берет. Бул аларга жеке маалыматтарды бир IT чөйрөсүнөн башкасына оңой жылдырууга, көчүрүүгө же өткөрүп берүүгө мүмкүндүк берет.','<strong>Comments</strong> &mdash; WordPress does not delete comments. The software does anonymize (but, again, <em>never</em> publishes) the associated Email Address, IP Address, and User Agent (Browser/OS).'=>'<strong>Комментарийлер</strong> &mdash; WordPress комментарийлерди өчүрбөйт. Программа байланышкан Email дарегин, IP дарегин жана колдонуучунун агентин (браузер/OS) анонимдүү кылат (бирок дагы <em>эч качан</em> жарыялабайт).','WordPress collects (but <em>never</em> publishes) a limited amount of data from logged-in users but then deletes it or anonymizes it. That data can include:'=>'WordPress кирген колдонуучулардан чектелген маалыматтарын чогултат (бирок <em>эч качан</em> жарыялабайт), бирок андан кийин аны өчүрөт же жашыруун кылат. Бул маалыматтар төмөнкүлөрдү камтышы мүмкүн:','Note: As this tool only gathers data from WordPress and participating plugins, you may need to do more to comply with erasure requests. For example, you are also responsible for ensuring that data collected by or stored with the 3rd party services your organization uses gets deleted.'=>'Эскертме: Бул курал WordPress жана ага тиешелүү плагиндерден гана маалыматтарды чогултат, андыктан сиз маалыматтарды өчүрүү сурамдарын канааттандыруу үчүн көбүрөөк нерсени жасашыңыз керек болот. Эгер сиз алардын кызматтарын бизнес же сайтыңызда пайдалансаңыз, үчүнчү тарап тарабынан чогултулган же сакталган маалыматтар өчүрүшүн камсыз кылышыңыз керек.','Privacy Laws around the world require businesses and online services to delete, anonymize, or forget the data they collect about an individual. The rights those laws enshrine are sometimes called the "Right to be Forgotten".'=>'Дүйнө жүзүндөгү купуялык мыйзамдары компаниялардан жана онлайн кызматтардан жеке адам жөнүндө чогулткан маалыматтарды өчүрүүнү, анонимдөөсүн же унутууну талап кылат. Бул мыйзамдарда бекитилген укуктар кээде «Унутулуу укугу» деп аталат.','This screen is where you manage requests to erase personal data.'=>'Бул экранда сиз жеке маалыматтарды өчөрүү боюнча сурамдарды башкара аласыз.','This post is being backed up in your browser, just in case.'=>'Бул жазуу сиздин браузериңизде камдык көчүрмөсү сакталган.','This will grant access to <a href="%1$s">the %2$s site on the network as you have Super Admin rights</a>.'=>'Бул сизге <a href="%1$s">%2$s тармактык сайтына кирүү мүмкүнчүлүгүн берет, анткени сиз Супер администраторсуз</a>.','Learn about block themes'=>'Блок темалары жөнүндө билип алыңыз','There is a new kind of WordPress theme, called a block theme, that lets you build the site you&#8217;ve always wanted &#8212; with blocks and styles.'=>'Блок темалары - бул WordPress үчүн теманын жаңы түрү, алар сизге блоктор жана стилдер менен сиз каалагандай сайт түзүүгө мүмкүндүк берет.','Discover a new way to build your site.'=>'Сайтыңызды түзүүнүн жаңы жолун табыңыз.','Tweak your site, or give it a whole new look! Get creative &#8212; how about a new color palette or font?'=>'Сайтыңызды бир аз өзгөртүңүз же ага толугу менен жаңы көрүнүш бериңиз! Чыгармачыл болуңуз, жаңы түстөр палитрасы же арипи кандай болот?','Switch up your site&#8217;s look & feel with Styles'=>'Стилдер менен сайтыңыздын көрүнүшүн өзгөртүңүз','Open the Customizer'=>'Орнотуу интерфейсине өтүңүз','Configure your site&#8217;s logo, header, menus, and more in the Customizer.'=>'Орнотуу интерфейсинде сайтыңыз үчүн логотипти, аталышты, менюну жана башкаларды жөндөңүз.','Start Customizing'=>'Орнотууга өтүңүз','Open site editor'=>'Сайттын редакторун ачуу','Design everything on your site &#8212; from the header down to the footer, all using blocks and patterns.'=>'Блокторду жана паттерндерди колдонуу менен сайтыңыздагы бардык нерсени, башынан баштап аяк бөлүгүнө чейин стилди түзүңүз.','Customize your entire site with block themes'=>'Блок темалары менен бүт сайтыңызды жөндөңүз','Add a new page'=>'Жаңы баракты кошуу','Block patterns are pre-configured block layouts. Use them to get inspired or create new pages in a flash.'=>'Блок паттерндери - алдын ала орнотулган блок макеттери. Аларды шыктануу үчүн колдонуңуз же заматта жаңы баракчаларды түзүңүз.','Author rich content with blocks and patterns'=>'Блоктор жана паттерндер менен бай мазмунду түзүңүз','Learn more about the %s version.'=>'%s нускасы жөнүндө көбүрөөк билүү.','WordPress is free and open source software'=>'WordPress - акысыз жана ачык булактуу программалык камсыздоо','Plugin File Editor'=>'Плагин редактору','Theme File Editor'=>'Тема редактору','If this is a development website you can <a href="%s" target="_blank">set the environment type accordingly</a> to enable application passwords.'=>'Эгер бул иштеп чыгуу сайты болсо, колдонмо сырсөздөрүн камтышы үчүн <a href="%s" target="_blank">тиешелүү чөйрөнүн түрүн орното аласыз</a>.','The application password feature requires HTTPS, which is not enabled on this site.'=>'Колдонмонун сырсөздөрү бул сайтта колдонулбаган HTTPS протоколун колдонууну талап кылат.','g:i a T'=>'G:i T','<a href="https://wordpress.org/documentation/article/appearance-theme-file-editor-screen/">Documentation on Editing Themes</a>'=>'<a href="https://wordpress.org/documentation/article/appearance-theme-file-editor-screen/">Темаларды түзөтүү боюнча документтер</a>','<a href="https://wordpress.org/documentation/article/site-health-screen/">Documentation on Site Health tool</a>'=>'<a href="https://wordpress.org/documentation/article/site-health-screen/">Сайттын ден-соолук куралдарын колдонуу боюнча документтер</a>','In the Info tab, you will find all the details about the configuration of your WordPress site, server, and database. There is also an export feature that allows you to copy all of the information about your site to the clipboard, to help solve problems on your site when obtaining support.'=>'Маалымат өтмөгүндө сиз WordPress сайтыңыздын, сервериңиздин жана маалымат базасынын бардык жөндөөсүнүн чоо-жайын таба аласыз. Ошондой эле сайт жөнүндө бардык маалыматты алмашуу буферине көчүрүүгө мүмкүндүк берген экспорттук функция бар, ал колдоо кызматына кайрылганда сайттын көйгөйлөрүн чечүүгө жардам берет.','In the Status tab, you can see critical information about your WordPress configuration, along with anything else that requires your attention.'=>'Статус өтмөгүндө сиз WordPress жөндөөсүнүн маанилүү маалыматын, ошондой эле көңүлүңүздү талап кылган нерселерди көрө аласыз.','This screen allows you to obtain a health diagnosis of your site, and displays an overall rating of the status of your installation.'=>'Бул экран сиздин сайтыңызды диагностикалоого мүмкүндүк берет жана орнотууңуздун ден соолугуна жалпы баа берет.','<a href="https://wordpress.org/documentation/article/settings-privacy-screen/">Documentation on Privacy Settings</a>'=>'<a href="https://wordpress.org/documentation/article/settings-privacy-screen/">Купуялык жөндөөлөрү боюнча документтер</a>','This screen includes suggestions to help you write your own privacy policy. However, it is your responsibility to use these resources correctly, to provide the information required by your privacy policy, and to keep this information current and accurate.'=>'Бул экранда өзүңүздүн купуялык саясатыңызды жазууга жардам бере турган сунуштар бар. Бирок, сиз бул ресурстардын туура пайдаланылышына, купуялык саясатыңыз талап кылган маалыматтын камсыздалышына жана анын актуалдуу жана так сакталышы үчүн жооптуусуз.','The Privacy screen lets you either build a new privacy-policy page or choose one you already have to show.'=>'Купуялык экраны жаңы купуялык саясатынын барагын түзүүгө же учурдагысын тандоого мүмкүндүк берет.','Individual posts may override these settings. Changes here will only be applied to new posts.'=>'Жеке жазуулар бул жөндөөлөргө караганда артыкчылыкка ээ болушу мүмкүн. Бул жерде киргизилген өзгөртүүлөр жаңы жазууларга гана колдонулат.','Menu item moved to the top'=>'Менюнун элементи жогоруга жылдырылды','Menu item removed'=>'Меню элементи өчүрүлдү','The Dashboard is the first place you will come to every time you log into your site. It is where you will find all your WordPress tools. If you need help, just click the &#8220;Help&#8221; tab above the screen title.'=>'Консол - бул сиздин сайтка кирген сайын бара турган биринчи барак. Бул жерде сиз бардык WordPress куралдарын таба аласыз. Эгер сизге жардам керек болсо, жөн гана экрандын аталышынын үстүндөгү "Жардам" өтмөгүн басыңыз.','Welcome to your WordPress Dashboard!'=>'WordPress консолуна кош келиңиз!','The application ID must be a UUID.'=>'Колдонмонун ID UUID колдонушу керек.','Select location'=>'Жайгашкан жерди тандоо','Visit plugin site for %s'=>'%s плагин сайтына кириңиз','pluginCannot Activate'=>'Активдештирүү мүмкүн эмес','Max connections number'=>'Туташуулардын максималдуу саны','Max allowed packet size'=>'Максималдуу пакет өлчөмү','Your website appears to use Basic Authentication, which is not currently compatible with application passwords.'=>'Сиздин сайт учурда колдонмо сырсөздөрү менен шайкеш келбеген HTTP негизги аутентификациясын колдонуп жатат окшойт.','%1$s &#8220;%2$s&#8221;'=>'%1$s &#8220;%2$s&#8221;','Template Editing'=>'Шаблонду түзөтүү','WordPress comes with some awesome, worldview-changing rights courtesy of its <a href="%s">license</a>, the GPL.'=>'WordPress өзүнүн GPL <a href="%s">лицензиясынын</a> аркасында дүйнөгө болгон көз карашты өзгөртүүчү укмуштуудай укуктарга ээ.','Want to see your name in lights on this page?'=>'Бул баракчадан өзүңүздүн атыңызды көргүңүз келеби?','Get involved in WordPress.'=>'WordPress\'ти өнүктүрүүгө катышыңыз.','WordPress is created by a <a href="%1$s">worldwide team</a> of passionate individuals.'=>'WordPress энтузиасттардын <a href="%1$s">эл ​​аралык команда</a>нын күчү менен өнүгүп жатат.','%s plugin deactivated during WordPress upgrade.'=>'%s плагини WordPress жаңыртуу учурунда өчүрүлгөн.','%1$s %2$s was deactivated due to incompatibility with WordPress %3$s.'=>'%1$s %2$s плагини WordPress %3$s менен шайкеш келбегендиктен өчүрүлгөн.','%1$s %2$s was deactivated due to incompatibility with WordPress %3$s, please upgrade to %1$s %4$s or later.'=>'%1$s %2$s плагини WordPress %3$s менен шайкеш келбегендиктен өчүрүлгөн. Сураныч, аны %1$s %4$s же андан жаңыраак нускасына жаңыртыңыз.','We take privacy and transparency very seriously'=>'Биз купуялуулукка жана ачыктыкка олуттуу мамиле жасайбыз','The Four Freedoms'=>'Төрт Эркиндик','themeDelete %s'=>'Өчүрүү %s','themeLive Preview %s'=>'Көрүү  %s','themeCustomize %s'=>'Ырастоо %s','themeView Theme Details for %s'=>'Тема жөнүндө маалыматты көрүү %s','Toggle extra menu items'=>'Кошумча меню элементтерин көрсөтүүнү которуштуруу','Site Health - %s'=>'Сайттын ден соолугу - %s','You need to make the file %1$s writable before you can save your changes. See <a href="%2$s">Changing File Permissions</a> for more information.'=>'Өзгөртүүлөрдү сактоо үчүн %1$s файлын жазыла турган кылуу керек. Кошумча маалыматты <a href="%2$s">Файлга укуктарды өзгөртүү боюнча документтерден</a> алууга болот.','Rewrite rules:'=>'Кайра жазуу эрежелери:','List of menu items selected for deletion:'=>'Өчүрүү үчүн тандалган меню элементтеринин тизмеси:','Remove Selected Items'=>'Тандалган элементтерди өчүрүү','Bulk Select'=>'Көптүк тандоо','Deleted menu item: %s.'=>'Меню элементи өчүрүлгөн: %s.','item %s'=>'Элемент %s','Themes %s'=>'Темалар %s','Unable to encode the personal data for export. Error: %s'=>'Экспорттоо үчүн жеке маалыматтарды коддоодо ката кетти: %s','The %s post meta must be an array.'=>'Жазуунун метадайындарынын мааниси %s массив болушу керек.','Your site&#8217;s health is looking good, but there is still one thing you can do to improve its performance and security.'=>'Сайтыңыздын ден соолугу жакшы көрүнөт, бирок сиз натыйжалуулугуну жана коопсуздукту жакшыртуу үчүн жасай турган бир нече нерселер бар.','Your site has a critical issue that should be addressed as soon as possible to improve its performance and security.'=>'Сайттын коопсуздугун жана иштешин жакшыртуу үчүн мүмкүн болушунча тез арада чечилиши керек болгон сайтта олуттуу көйгөй бар.','Learn how to <a href="%s" class="update-browser-link">browse happy</a>'=>'<a href="%s" class="update-browser-link">Browse happy</a> долбоору тууралуу маалымат алыңыз','Internet Explorer does not give you the best WordPress experience. Switch to Microsoft Edge, or another more modern browser to get the most from your site.'=>'Internet Explorer эскирген жана WordPress\'ти толугу менен колдонууга мүмкүнчүлүк бербейт. Microsoft Edge же башка заманбап браузерге өтүүнү карап көрүңүз.','GD supported file formats'=>'GD тарабынан колдоого алынган файл форматтары','Unable to determine'=>'Аныктоо мүмкүн эмес','ImageMagick supported file formats'=>'ImageMagick тарабынан колдоого алынган файл форматтары','Imagick version'=>'Imagick нускасы','themeUploaded'=>'Жүктөлдү','pluginReplace current with uploaded'=>'Учурдагыны жүктөлүп алынган нуска менен алмаштырыңыз','pluginUploaded'=>'Жүктөлдү','pluginCurrent'=>'Учурдагы','Please activate the <a href="%s">Link Manager plugin</a> to use the link manager.'=>'Сураныч, шилтемени башкарууну колдонуу үчүн <a href="%s">Link Manager plugin</a> плагинин жандырыңыз.','Create a new Privacy Policy page'=>'Купуялык саясатынын жаңы барагын түзүңүз','Send personal data export confirmation email.'=>'Жеке маалыматтарды экспорттоону ырастоо үчүн email кат жөнөтүңүз.','This tool helps site owners comply with local laws and regulations by exporting known data for a given user in a .zip file.'=>'Бул аспап сайт ээлерине колдонуучунун белгилүү маалыматтарын .zip архивге экспорттоо менен жергиликтүү мыйзамдарды жана жөнгө салуучу актыларды сактоого жардам берет.','<a href="https://wordpress.org/documentation/article/tools-export-personal-data-screen/">Documentation on Export Personal Data</a>'=>'<a href="https://wordpress.org/documentation/article/tools-export-personal-data-screen/">Жеке маалыматтарды экспорттоо боюнча документтер</a>','Plugin authors can <a href="https://developer.wordpress.org/plugins/privacy/adding-the-personal-data-exporter-to-your-plugin/" target="_blank">learn more about how to add the Personal Data Exporter to a plugin here</a>.'=>'Плагиндин авторлоруна үчүн пайдалуу <a href="https://developer.wordpress.org/plugins/privacy/adding-the-personal-data-exporter-to-your-plugin/" target="_blank">плагинге жеке маалыматтарды экспорттоону кошуу боюнча маалымат</a>.','Many plugins may collect or store personal data either in the WordPress database or remotely. Any Export Personal Data request should include data from plugins as well.'=>'Көптөгөн плагиндер WordPress маалымат базасында же алыстан жеке маалыматтарды чогултат же сактайт. Ар кандай жеке маалыматтарды экспорттоо сурамы да плагин маалыматтарын экспорттоону колдоого алышы керек.','If you are not sure, check the plugin documentation or contact the plugin author to see if the plugin collects data and if it supports the Data Exporter tool. This information may be available in the <a href="%s">Privacy Policy Guide</a>.'=>'Сиз плагиндин документтерин карап чыгыңыз же плагиндин авторунан ал чогулткан маалыматтар жана маалыматтарды экспорттоо куралын колдоо тууралуу сурасаңыз болот. Бул маалыматты <a href="%s">Купуялык саясаты боюнча колдонмодо</a> тапса болот.','<strong>Comments</strong> &mdash; For user comments, Email Address, IP Address, User Agent (Browser/OS), Date/Time, Comment Content, and Content URL.'=>'<strong>Комментарийлер</strong> &mdash; колдонуучунун бардык комментарийлери үчүн, Email дареги, IP, браузер/OS (Колдонуучу агенти), датасы/убактысы, комментарий мазмуну, мазмун шилтемеси.','This screen is where you manage requests for an export of personal data.'=>'Бул экранда сиз жеке маалыматтарыңызды экспорттоо сурамдарын башкара аласыз.','Site URLs could not be switched to HTTPS.'=>'Сайттын URL дарегин HTTPS\'ге которуу мүмкүн эмес.','Site URLs switched to HTTPS.'=>'Сайттын URL дареги HTTPS\'ге которулду.','It looks like HTTPS is not supported for your website at this point.'=>'Учурда HTTPS сайтыңызда колдоого алынбайт окшойт.','Sorry, you are not allowed to update this site to HTTPS.'=>'Кечиресиз, бул сайтты HTTPS\'ге которууга укугуңуз жок.','Password reset links sent to %s user.'=>'Сырсөздү баштапкы абалга келтирүү шилтемелери %s колдонуучуга жөнөтүлдү.','Password reset link sent.'=>'Сырсөзүңүздү баштапкы абалга келтирүү үчүн шилтеме жөнөтүлдү.','Send %s a link to reset their password. This will not change their password, nor will it force a change.'=>'%s колдонуучуга сырсөздү баштапкы абалга келтирүү шилтемесин жөнөтүңүз. Бул колдонуучунун сырсөзүн өзгөртпөйт же колдонуучуну буга мажбурлабайт.','Send Reset Link'=>'Калыбына келтирүү шилтемесин жөнөтүү','Policies'=>'Саясат','The Privacy Settings require JavaScript.'=>'Купуялык жөндөөлөрү JavaScript талап кылат.','Privacy SettingsPolicy Guide'=>'Саясаттын колдонмосу','Privacy SettingsSettings'=>'Жөндөөлөр','Re-install version %s'=>'%s нускасын кайра орнотуңуз','Update to latest %s nightly'=>'Акыркы түнкү %s чыгарылышка чейин жаңыртыңыз','Send personal data erasure confirmation email.'=>'Жеке маалыматтарды өчүрүүнү ырастоо үчүн email кат жөнөтүңүз.','Confirmation email'=>'Ырастоо каты','This tool helps site owners comply with local laws and regulations by deleting or anonymizing known data for a given user.'=>'Бул курал белгилүү бир колдонуучунун дайындарын жок кылуу же анонимдөө аркылуу сайт ээлерине жергиликтүү мыйзамдарды жана эрежелерди сактоого жардам берет.','<a href="https://wordpress.org/documentation/article/tools-erase-personal-data-screen/">Documentation on Erase Personal Data</a>'=>'<a href="https://wordpress.org/documentation/article/tools-erase-personal-data-screen/">Жеке маалыматтарды өчүрүү боюнча документтери</a>','If you are a plugin author, you can <a href="https://developer.wordpress.org/plugins/privacy/adding-the-personal-data-eraser-to-your-plugin/" target="_blank">learn more about how to add support for the Personal Data Eraser to a plugin here</a>.'=>'Плагиндин авторлоруна үчүн пайдалуу <a href="https://developer.wordpress.org/plugins/privacy/adding-the-personal-data-eraser-to-your-plugin/" target="_blank">плагинге жеке маалыматтарды өчүрүүнү колдоо кошуу боюнча маалымат</a>.','Many plugins may collect or store personal data either in the WordPress database or remotely. Any Erase Personal Data request should delete data from plugins as well.'=>'Көптөгөн плагиндер WordPress маалымат базасында же алыстан жеке маалыматтарды чогултат же сактайт. Ар кандай жеке маалыматтарды өчүрүү сурамы да плагин маалыматтарын өчүрүүнү колдоого алышы керек.','Plugin Data'=>'Плагиндер маалыматы','If you are not sure, check the plugin documentation or contact the plugin author to see if the plugin collects data and if it supports the Data Eraser tool. This information may be available in the <a href="%s">Privacy Policy Guide</a>.'=>'Сиз плагиндин документтерин карап чыга аласыз же плагиндин авторунан ал чогулткан маалыматтар жана маалыматтарды жок кылуу куралын колдоо жөнүндө сурасаңыз болот. Бул маалымат <a href="%s">Купуялык саясаты боюнча колдонмодо</a> жеткиликтүү болушу мүмкүн.','<strong>Media</strong> &mdash; A list of URLs for all media file uploads made by the user.'=>'<strong>Медиафайл</strong> &mdash; колдонуучу жүктөгөн медиа файлдарынын URL тизмеси.','<strong>Session Tokens</strong> &mdash; User login information, IP Addresses, Expiration Date, User Agent (Browser/OS), and Last Login.'=>'<strong>Сеанс дайындары</strong> &mdash; колдонуучунун кирүү маалыматтары, IP, сессиянын мөөнөтү, браузердин түрү жана ОС (Колдонуучу агенти), акыркы кирүү убактысы.','<strong>Community Events Location</strong> &mdash; The IP Address of the user which is used for the Upcoming Community Events shown in the dashboard widget.'=>'<strong>Жергиликтүү коомчулуктун окуялары</strong> &mdash; WordPress Башкаруу тактасындагы Жергиликтүү Коомчулук Окуялары виджети тарабынан колдонулган колдонуучунун IP дареги.','<strong>Profile Information</strong> &mdash; user email address, username, display name, nickname, first name, last name, description/bio, and registration date.'=>'<strong>Профил маалыматы</strong> &mdash; Еmail дареги, колдонуучунун аты, колдонуучунун көрсөтүлгөн аты, лакап аты, аты, фамилиясы, сүрөттөмөсү/өмүр баяны жана каттоо күнү.','Default Data'=>'Демейки Маалыматтар','The tool associates data stored in WordPress with a supplied email address, including profile data and comments.'=>'Курал WordPress тарабынан сакталган маалыматтарды берилген email дареги менен, анын ичинде профилдик маалыматтар жана комментарийлер менен байланыштырат.','https://make.wordpress.org/community/organize-event-landing-page/'=>'https://make.wordpress.org/community/organize-event-landing-page/','Want more events? <a href="%s">Help organize the next one</a>!'=>'Көбүрөөк иш-аракеттерди каалайсызбы? <a href="%s">Төмөнкүлөрдү уюштурууга жардам бериңиз</a>!','A password reset link was emailed to %s.'=>'Сырсөздү калыбына келтирүү шилтемеси %s колдонуучуга жөнөтүлдү.','Cannot send password reset, permission denied.'=>'Сырсөздү калыбына келтирүү маалыматын жөнөтүү мүмкүн эмес, кирүүгө тыюу салынган.','The setting for %1$s is currently configured as 0, this could cause some problems when trying to upload files through plugin or theme features that rely on various upload methods. It is recommended to configure this setting to a fixed value, ideally matching the value of %2$s, as some upload methods read the value 0 as either unlimited, or disabled.'=>'%1$s үчүн параметр учурда 0 болуп коюлган, бул ар кандай жүктөө ыкмаларына көз каранды болгон плагин же тема функцияларын колдонуп файлдарды жүктөөгө аракет кылып жатканда кээ бир көйгөйлөрдү жаратышы мүмкүн. Кээ бир жүктөө ыкмалары 0 маанисин өчүрүлгөн же чектөөсүз деп окуй тургандыктан, бул параметрди %2$s үчүн идеалдуу келген туруктуу мааниге коюу сунушталат.','Talk to your web host about supporting HTTPS for your website.'=>'Сайтыңызда HTTPS колдоосун камсыз кылуу үчүн хостингдин техникалык колдоосуна кайрылыңыз.','Update your site to use HTTPS'=>'Сайтыңызды HTTPS колдонуу үчүн которуңуз','However, your WordPress Address is currently controlled by a PHP constant and therefore cannot be updated. You need to edit your %1$s and remove or update the definitions of %2$s and %3$s.'=>'Бул WordPress сайтынын URL дареги PHP туруктуулугуна коюлган жана жаңыртуу мүмкүн эмес окшойт. Сиз %1$s түзөтүп, %2$s жана %3$s үчүн аныктамаларды алып салышыңыз же жаңыртыңыз.','HTTPS is already supported for your website.'=>'Сайтыңыз эчак эле HTTPS туташуусун колдойт.','Your <a href="%1$s">WordPress Address</a> and <a href="%2$s">Site Address</a> are not set up to use HTTPS.'=>'<a href="%1$s">WordPress дареги</a> жана <a href="%2$s">Сайттын дареги</a> HTTPS\'ти колдоого орнотулган эмес.','You are accessing this website using HTTPS, but your <a href="%1$s">WordPress Address</a> and <a href="%2$s">Site Address</a> are not set up to use HTTPS by default.'=>'Сиз HTTPS аркылуу сайтка кирип жатасыз, бирок <a href="%1$s">WordPress дареги</a> жана <a href="%2$s">Сайттын дареги</a> HTTPS колдонууга коюлган эмес демейки боюнча.','Your <a href="%s">Site Address</a> is not set up to use HTTPS.'=>'<a href="%s">a=Сайттын дареги</a> HTTPS\'ти колдоого орнотулган эмес.','Learn more about debugging in WordPress.'=>'WordPress\'те мүчүлүштүктөрдү оңдоо жөнүндө көбүрөөк билиңиз.','Added'=>'Кошулду','Send password reset'=>'Сырсөздү калыбына келтирүү маалыматын жөнөтүү','Contact information'=>'Байланыш маалыматы','Copy suggested policy text to clipboard'=>'Сунушталган саясаттын текстин алмашуу буферине көчүрүңүз','Directory listing failed.'=>'Каталог тизмеси түзүлгөн жок.','Search Results'=>'Издөө жыйынтыктары','Invalid request ID when processing personal data to erase.'=>'Өчүрүү үчүн жеке маалыматтарды иштеп чыгууда сурам ID туура эмес.','Invalid request ID when merging personal data to export.'=>'Экспорттоо үчүн жеке маалыматтарды бириктирүүдө жараксыз сурам ID.','Unable to archive the personal data export file (HTML format).'=>'Жеке маалыматтарды экспорттоо архивин түзүү мүмкүн эмес (HTML формат).','Unable to archive the personal data export file (JSON format).'=>'Жеке маалыматтарды экспорттоо архивин түзүү мүмкүн эмес (JSON формат).','Unable to open personal data export (HTML report) for writing.'=>'Жазуу үчүн жеке маалыматтарды экспорттоо файлын (HTML отчетун) ачуу мүмкүн эмес.','Unable to create personal data export folder.'=>'Жеке маалыматтарды экспорттоо папкасын түзүү мүмкүн эмес.','Request added successfully.'=>'Сурам кошулду.','Invalid personal data action.'=>'Жеке маалыматтар менен туура эмес аракет.','Unable to initiate confirmation for personal data request.'=>'Жеке маалыматтар боюнча сурамын алгачкы ырастоосун түзүү мүмкүн эмес.','https://wordpress.org/documentation/article/update-services/'=>'https://wordpress.org/documentation/article/update-services/','Your site is running on an outdated version of PHP (%s), which should be updated.'=>'Сайтыңыз PHPдин (%s) эскирген нускасын колдонуп жатат жана аны жаңыртуу керек.','PHP Update Recommended'=>'PHP жаңыртуу сунушталат','Your website appears to use Basic Authentication, which is not currently compatible with Application Passwords.'=>'Сиздин сайт учурда колдонмо сырсөздөрү менен шайкеш келбеген HTTP негизги аутентификациясын колдонуп жатат окшойт.','https://developer.wordpress.org/rest-api/frequently-asked-questions/#why-is-authentication-not-working'=>'https://developer.wordpress.org/rest-api/frequently-asked-questions/#why-is-authentication-not-working','This site appears to be under version control. Automatic updates are disabled.'=>'Бул сайт нусканы башкаруу тутумун колдонуп жаткандай көрүнөт. Автоматтык жаңыртуулар өчүрүлгөн.','You are using a development version of WordPress.'=>'Сиз WordPress\'тин иштелип чыгуудагы нускасын колдонуп жатасыз.','You can update to the latest nightly build manually:'=>'Сиз аны акыркы түнкү түзүлүшкө жаңырта аласыз:','Enable automatic updates for all new versions of WordPress.'=>'WordPress\'тин бардык жаңы чыгарылыштары үчүн автоматтык орнотууга которулууңүз.','Switch to automatic updates for maintenance and security releases only.'=>'Техникалык жаңыртууларды жана коопсуздук чыгарылыштарын гана автоматтык түрдө орнотууга которулуңуз.','Current version: %s'=>'Учурдагы нуска: %s','This site will not receive automatic updates for new versions of WordPress.'=>'Бул сайт WordPress\'тин жаңы чыгарылыштары үчүн жаңыртууларды албайт.','This site is automatically kept up to date with maintenance and security releases of WordPress only.'=>'Бул сайт WordPress\'тин техникалык жана коопсуздук чыгарылыштары чыкканда гана автоматтык түрдө жаңыртылып турат.','This site is automatically kept up to date with each new version of WordPress.'=>'Бул сайт WordPress\'тин ар бир жаңы нускасы менен автоматтык түрдө жаңыртылып турат.','WordPress will only receive automatic security and maintenance releases from now on.'=>'Мындан ары WordPress автоматтык түрдө техникалык жана коопсуздук чыгарылыштарына жаңыртылып турат.','Automatic updates for all WordPress versions have been enabled. Thank you!'=>'WordPress\'тин бардык нускалары үчүн автоматтык жаңыртуулар камтылган. Рахмат!','<strong>Site Health Status</strong> &mdash; Informs you of any potential issues that should be addressed to improve the performance or security of your website.'=>'<strong>Сайттын ден соолугунун абалы</strong> &mdash; сайтыңыздын иштешин жана коопсуздугун жогорулатуу үчүн мүмкүн болгон көйгөйлөрдү билдирет.','Your new password for %s is:'=>'Сиздин %s үчүн жаңы сырсөзүңүз:','Add New Application Password'=>'Колдонмонун жаңы сырсөзүн кошуңуз','Required to create an Application Password, but not to update the user.'=>'Колдонмонун сырсөздөрүн түзүү үчүн талап кылынат, бирок колдонуучунун маалыматтарын жаңыртуу үчүн эмес.','Go to Updates'=>'Жаңыртууларга өтүү','&larr; Go to Users'=>'&larr; Колдонуучулар тизмесине кайтуу','&larr; Go to editor'=>'&larr; Редакторго кайтуу','Go to Plugin Installer'=>'Плагинди орнотууга өтүү','Go to Importers'=>'Импорттоого өтүү','Go to Theme Installer'=>'Темаларды орнотууга өтүү','Go to top'=>'Өйдөгө','%s could not be located. Please try another 