ion Password Name'=>'Жаңы колдонмонун сырсөзүнүн аты','Application passwords grant access to <a href="%1$s">the %2$s site in this installation that you have permissions on</a>.'=>'Колдонмонун сырсөздөрү ушул WordPress орнотуусунда сиз кире алган <a href="%1$s">%2$s сайтына</a> кирүүгө уруксат берет.','Application passwords allow authentication via non-interactive systems, such as XML-RPC or the REST API, without providing your actual password. Application passwords can be easily revoked. They cannot be used for traditional logins to your website.'=>'Колдонмонун сырсөздөрү XML-RPC же REST API сыяктуу интерактивдүү эмес системалар үчүн чыныгы сырсөзүңүздү көрсөтпөстөн авторизациялоого мүмкүндүк берет. Колдонмонун сырсөздөрү оңой эле жокко чыгарылат жана аларды кадимкидей эле сайтыңызга кирүү үчүн колдонууга болбойт.','Application Passwords'=>'Колдонмонун сырсөздөрү','Type the new password again.'=>'Жаңы сырсөздү кайра киргизиңиз.','Set New Password'=>'Жаңы сырсөз орнотуу','Type the password again.'=>'Жаңы сырсөздү кайра киргизиңиз.','You can update from WordPress %1$s to <a href="%2$s">WordPress %3$s</a> manually:'=>'Сиз WordPress %1$s ды <a href="%2$s">WordPress %3$s</a>га жаңырта аласыз:','Revoke all application passwords'=>'Бардык колдонмо сырсөздөрүн кайтарып алыңыз','Revoke "%s"'=>'Кайтарып алуу "%s"','Revoke'=>'Кайтарып алуу','Last IP'=>'Акыркы IP дарек','Last Used'=>'Акыркы колдонулган','The Site Health check for %1$s has been replaced with %2$s.'=>'%1$s үчүн сайттын ден соолугун текшерүү %2$s менен алмаштырылды.','Erase personal data'=>'Жеке маалыматтарды өчүрүү','- %1$s (from version %2$s to %3$s)'=>'- %1$s (%2$s нускасынан %3$s чейин)','Current Header Video'=>'Учурдагы аталыштагы видео','Authorization header'=>'Авторизациянын аталышы','Learn how to configure the Authorization header.'=>'Авторизациянын башын кантип ыңгайлаштырууну үйрөнүңүз.','Flush permalinks'=>'Туруктуу шилтемелерди демейки абалга келтирүү','The authorization header is invalid'=>'Жараксыз а