n email verification page will reappear after %s.'=>'Администратордун email дарегин текшерүү %s кийин кайталанат.','Auto-updates'=>'Автоматтык жаңыртуу','Please note: Third-party themes and plugins, or custom code, may override WordPress scheduling.'=>'Көңүл буруңуз: Үчүнчү тараптын плагиндери, темалары жана кошумча коду WordPress графигин өзгөртүүгө мажбурлашы мүмкүн.','Auto-updates can be enabled or disabled for WordPress major versions and for each individual theme or plugin. Themes or plugins with auto-updates enabled will display the estimated date of the next auto-update. Auto-updates depends on the WP-Cron task scheduling system.'=>'Автоматтык жаңыртууларды WordPress\'тин негизги чыгарылыштары жана ар бир плагин же тема үчүн иштетип же өчүрсө болот. Автоматтык жаңыртуу иштетилген плагиндер же темалар кийинки автоматтык жаңыртуунун болжолдуу күнүн көрсөтөт. Автоматтык жаңыртуулар WP-Cron жумуш пландоо системасына жараша болот.','<strong>Important:</strong> Before updating, please <a href="%1$s">back up your database and files</a>. For help with updates, visit the <a href="%2$s">Updating WordPress</a> documentation page.'=>'<strong>Маанилүү:</strong> <a href="%1$s">базаңыздын жана файлдарыңыздын камдык көчүрмөсүн</a> жаңыртуудан мурун. Жаңыртуулар боюнча жардам алуу үчүн <a href="%2$s">WordPress жаңыртуулары</a> үчүн документтер барагына баш багыңыз.','themeCannot Activate'=>'Активдештирүү мүмкүн эмес','You cannot edit this comment because the associated post is in the Trash. Please restore the post first, then try again.'=>'Сиз бул комментарийди түзөтө албайсыз, анткени байланышкан жазма таштандыга салынган. Жазууну калыбына келтирип, кайра аракет кылыңыз.','media itemSuccess'=>'Ийгиликтүү','plugin<strong>Error:</strong> Current WordPress version (%1$s) does not meet minimum requirements for %2$s. The plugin requires WordPress %3$s.'=>'<strong>Ката:</strong> WordPress\'тин учурдагы нускасы (%1$s) %2$s үчүн минималдуу талаптарга жооп бербейт. Бул плагинге %3