e of software for the database WordPress uses to store all your site&#8217;s content and settings.'=>'SQL сервери &mdash Сайттын бардык мазмунун жана анын жөндөөлөрүн сактаган маалымат базасы менен иштөө үчүн WordPress колдонгон программалык камсыздоо.','PHP modules perform most of the tasks on the server that make your site run. Any changes to these must be made by your server administrator.'=>'PHP кеңейтүүлөрү сайтыңыздын иштеши үчүн серверде көптөгөн тапшырмаларды аткарат. Адатта, аларга бардык өзгөртүүлөр сервердин системалык администратору тарабынан жүргүзүлөт.','Manage your themes'=>'Cайттын темасын башкаруу','Manage inactive plugins'=>'Активдүү эмес плагиндерди башкаруу','Update your plugins'=>'Плагиндерди жаңыртуу','Manage your plugins'=>'Cайттын плагиндерин башкаруу','View Privacy Policy Guide.'=>'Купуялык саясатынын колдонмосун көрүү.','User Language'=>'Колдонуучу тили','The value, %1$s, has either been enabled by %2$s or added to your configuration file. This will make errors display on the front end of your site.'=>'%1$s аныктамасы же туруктуу %2$s тарабынан камтылган же конфигурация файлына кошулган. Каталар коноктор үчүн сайттын бөлүгүндөгү браузерде көрсөтүлөт.','[%s] Background Update Finished'=>'[%s] Фондук жаңыртуу аяктады','[%s] Background Update Failed'=>'[%s] Фондук жаңыртуу ишке ашкан жок','Plugin could not be resumed because it triggered a <strong>fatal error</strong>.'=>'Плагиндин кодун аткарууну улантуу мүмкүн эмес, анткени ал <strong>өтө коркунучтуу ката</strong>га алып келди.','You should remove inactive themes'=>'Активдүү эмес темаларды өчүрүү сунушталат','Your site has 1 installed theme, and it is up to date.'=>'Сайтыңызда бир орнотулган тема бар, актуалдуу абалда.','Your site has 1 active plugin, and it is up to date.'=>'Сайтыңызда бир орнотулган плагин бар, актуалдуу абалда.','Passed tests'=>'Өткөрүлгөн сыноолор','Sorry, you are not allowed to access site health information.'=>'Кечиресиз, сизге сайттын ден соолук маалыматына кирүүгө ук