tion'=>'Жеке маалыматтарды тазалоо тизмеси боюнча багыттоо','Filter erase personal data list'=>'Жеке маалыматтарды тазалоо тизме чыпкасы','Export personal data list'=>'Жеке маалыматтарды экспорттоо үчүн тизме','Export personal data list navigation'=>'Жеке маалыматтарды экспорттоо тизмеси боюнча багыттоо','Filter export personal data list'=>'Жеке маалыматтарды экспорттоо тизме чыпкасы','There is a new version of %1$s available, but it does not work with your version of PHP. <a href="%2$s" %3$s>View version %4$s details</a> or <a href="%5$s">learn more about updating PHP</a>.'=>'%1$s жаңы нускасы жеткиликтүү, бирок жаңыртуу сиздин PHP нускаңыз менен иштебейт. <a href="%2$s" %3$s>%4$s нускасынын дайынын</a> же <a href="%5$s">PHP жаңыртуу маалыматын</a> көрүү.','This plugin failed to load properly and is paused during recovery mode.'=>'Плагиндин кодун туура жүктөлгөн жок жана калыбына келтирүү абалында токтотулду.','Go to the Themes screen'=>'Темалар экранына өтүңүз','Total size is not available. Some errors were encountered when determining the size of your installation.'=>'Жалпы өлчөмү жеткиликсиз. Орнотууңуз колдонгон мейкиндикти эсептөөдө каталар кетти.','The size cannot be calculated. The directory is not accessible. Usually caused by invalid permissions.'=>'Колдонууга жарактуу мейкиндикти эсептөө мүмкүн эмес. Папка жеткиликсиз, ага кирүү укугу туура эмес коюлган болушу мүмкүн.','The directory size calculation has timed out. Usually caused by a very large number of sub-directories and files.'=>'Колдонулган мейкиндикти эсептөө өтө көпкө созулду. Сизде өтө көп ички папкалар жана файлдар болушу мүмкүн.','These settings alter where and how parts of WordPress are loaded.'=>'Бул жөндөөлөр WordPress компоненттеринин кайда жана кантип жүктөлөрүн өзгөртөт.','%s item with no issues detected'=>'%s элементи эч кандай көйгөйлөр табылган жок','%s recommended improvement'=>'%s сунушталган жаңыртуу','The site health check shows information about your WordPress configuration and items that may need your attention.'=>'Сайттын ден соолук абалы WordPress конфигурациясы жана көңүл бурууңуз керек болгон нерселер жөнүндө маалыматты көрсөтөт.','Site Health Status'=>'Сайттын ден-соолугунун абалы','Everything is running smoothly here.'=>'Баары мыкты иштейт.','Great job!'=>'Эң сонун!','Secondary menu'=>'Кошумча меню','The loopback request to your site completed successfully.'=>'Сайтыңызга кайчылаш сурамы ийгиликтүү аяктады.','The loopback request returned an unexpected http status code, %d, it was not possible to determine if this will prevent features from working as expected.'=>'Кайчылаш сурамы күтүлбөгөн http жообун - %d кайтарды, бул иштин майнаптуулугуна кандай таасир тийгизерин аныктоо мүмкүн болгон жок.','The loopback request to your site failed, this means features relying on them are not currently working as expected.'=>'Сайтыңызга кайчылаш сурамы ишке ашкан жок. Анын иштешине көз каранды болгон мүмкүнчүлүктөр талаптагыдай иштей албайт.','No scheduled events exist on this site.'=>'Бул сайтта пландаштырылган иш-чаралар жок.','REST API availability'=>'REST API жеткиликтүүлүгү','Loopback request'=>'Кайчылаш сурамы','Debugging enabled'=>'Ката аныктоо иштетилди','HTTP Requests'=>'HTTP сурамдары','Scheduled events'=>'Пландаштырылган иш-чаралар','Secure communication'=>'Коопсуз туташуу','HTTPS status'=>'HTTPS абалы','MySQL utf8mb4 support'=>'MySQL utf8mb4 коддоштуруу колдоосу','PHP Extensions'=>'PHP Кеңейтүүлөрү','Database Server version'=>'Маалымат базасы серверинин нускасы','PHP Version'=>'PHP Нускасы','Theme Versions'=>'Тема Нускалары','Plugin Versions'=>'Плагин Нускалары','WordPress Version'=>'WordPress Нускасы','The REST API did not process the %s query parameter correctly.'=>'REST API сурамдын %s параметрин туура иштете алган жок.','The REST API did not behave correctly'=>'REST API туура иштебей жатат','The REST API encountered an unexpected result'=>'REST API күтүлбөгөн натыйжа берди','The REST API encountered an error'=>'REST API ката жиберди','The REST API is one way that WordPress and other applications communicate with the server. For example, the block editor screen relies on the REST API to display and save your posts and pages.'=>'REST API - WordPress жана башка колдонмолордун сервер менен байланышуу жолдорунун бири. Мисалы, блоктордун редакторунун экраны аны жазууларды жана баракчаларды көрсөтүү жана сактоо үчүн колдонот.','The REST API is available'=>'REST API жеткиликтүү','HTTP requests are partially blocked'=>'HTTP сурамдары жарым-жартылай бөгөттөлгөн','HTTP requests are blocked'=>'HTTP сурамдары бөгөттөлгөн','It is possible for site maintainers to block all, or some, communication to other sites and services. If set up incorrectly, this may prevent plugins and themes from working as intended.'=>'Сайт башка сайттарга жана кызматтарга бардык же кээ бир байланыштарды гана бөгөттөп коюшу мүмкүн. Туура эмес орнотулган болсо, бул темалардын жана плагиндердин туура эмес иштешине алып келиши мүмкүн.','HTTP requests seem to be working as expected'=>'HTTP сурамдары иштейт','Your site could not complete a loopback request'=>'Сиздин сайтыңыз кайчылаш сурамды аягына чыгара алган жок','Loopback requests are used to run scheduled events, and are also used by the built-in editors for themes and plugins to verify code stability.'=>'Кайчылаш сурамдары пландаштырылган тапшырмаларды аткаруу үчүн колдонулат, ошондой эле коддун тууралыгын текшерүү үчүн плагиндердин жана темалардын камтылган код редактору тарабынан колдонулат.','Your site can perform loopback requests'=>'Сиздин сайт кайчылаш сурамдарды аткара алат','Background updates may not be working properly'=>'Фондук жаңыртуулар туура иштебей калышы мүмкүн','Background updates are not working as expected'=>'Фондук жаңыртуулар туура иштебей жатат','Passed'=>'Ийгиликтүү','Background updates ensure that WordPress can auto-update if a security update is released for the version you are currently using.'=>'Фондук жаңыртуулар маанилүү чыгарылыштардын бир тармагында автоматтык WordPress коопсуздук жаңыртуулары үчүн колдонулат.','Background updates are working'=>'Фондук жаңыртуулар иштейт','The scheduled event, %s, failed to run. Your site still works, but this may indicate that scheduling posts or automated updates may not work as intended.'=>'Пландаштырылган тапшырма %s ишке ашкан жок. Сайтыңыз дагы эле иштеп жатат, бирок жазмаларды автоматтык түрдө жаңыртуу же кечиктирилип жарыялоо менен байланыштуу көйгөйлөр болушу мүмкүн.','A scheduled event has failed'=>'Пландаштырылган тапшырма ишке ашкан жок','While trying to test your site&#8217;s scheduled events, the following error was returned: %s'=>'Сайтта пландаштырылган тапшырмаларды текшерүүдө ката кетти: %s','It was not possible to check your scheduled events'=>'Пландаштырылган тапшырмаларды текшерүү мүмкүн эмес','Scheduled events are what periodically looks for updates to plugins, themes and WordPress itself. It is also what makes sure scheduled posts are published on time. It may also be used by various plugins to make sure that planned actions are executed.'=>'Пландаштырылган тапшырмалар плагиндерге, темаларга жана WordPress\'тин өзүнө жаңыртууларды мезгил-мезгили менен текшерип, пландаштырылган жазууларды жарыялайт. Кээ бир плагиндер аларды аткарылган иш-аракеттерди пландаштыруу үчүн да колдонушат.','Scheduled events are running'=>'Пландаштырылган тапшырмалар аткарылууда','Talk to your web host about OpenSSL support for PHP.'=>'PHP\'де OpenSSL\'ди иштетүү үчүн хостингдин техникалык колдоосуна кайрылыңыз.','Your site is unable to communicate securely with other services'=>'Сиздин сайт коопсуз башка кызматтарга туташа албайт','Your site can communicate securely with other services'=>'Сиздин сайт коопсуз башка кызматтарга туташа алат','Securely communicating between servers are needed for transactions such as fetching files, conducting sales on store sites, and much more.'=>'Серверлердин ортосундагы коопсуз туташуу файлдарды кабыл алуу, дүкөндөрдүн сайттарындагы сатып алуулар жөнүндө маалыматты өткөрүү жана башка көптөгөн нерселер үчүн колдонулат.','Learn more about why you should use HTTPS'=>'Эмне үчүн HTTPS колдонуу керектиги жөнүндө көбүрөөк билиңиз','Your website does not use HTTPS'=>'Сиздин сайтыңыз HTTPS колдонбойт','Your website is using an active HTTPS connection'=>'Сайтыңыз активдүү HTTPS туташуусун колдонуп жатат','You are accessing this website using HTTPS, but your <a href="%s">Site Address</a> is not set up to use HTTPS by default.'=>'Сиз HTTPS аркылуу сайтка кирдиңиз, бирок <a href="%s">WordPress дареги</a> демейки боюнча HTTPS колдонууга коюлган эмес.','Your site is set to display errors to site visitors'=>'Сайттын жөндөөлөрү коноктор үчүн каталарды көрсөтүүгө мүмкүндүк берет','The value, %s, has been added to this website&#8217;s configuration file. This means any errors on the site will be written to a file which is potentially available to all users.'=>'%s туруктуу файл конфигурациясына кошулат. Сайтта пайда болгон каталар жөнөкөй колдонуучулар кире ала турган файлга жазылат.','Your site is set to log errors to a potentially public file'=>'Сиздин сайт жалпыга жеткиликтүү файлдагы каталарды жазат','Debug mode is often enabled to gather more details about an error or site failure, but may contain sensitive information which should not be available on a publicly available website.'=>'Көйгөйдү аныктоо режими адатта сайттагы ката же көйгөй тууралуу көбүрөөк маалымат чогултуу үчүн колдонулат, бирок бул маалыматтар жалпыга жеткиликсиз болгон жашыруун маалыматты камтышы мүмкүн.','Your site is not set to output debug information'=>'Сиздин сайт ката маалыматты чыгаруу үчүн орнотулган эмес','Your site is unable to reach WordPress.org at %1$s, and returned the error: %2$s'=>'Сайтыңыз WordPress.org сайтына %1$s дарегинде туташа алган жок жана катаны кайтарды: %2$s','Could not reach WordPress.org'=>'Wordpress.org жеткиликсиз','Communicating with the WordPress servers is used to check for new versions, and to both install and update WordPress core, themes or plugins.'=>'WordPress.org серверлерине туташуу WordPress\'тин жаңы нускаларын, орнотууларын жана жаңыртууларын, плагиндерди жана темаларды текшерүү үчүн колдонулат.','Can communicate with WordPress.org'=>'WordPress.org жеткиликтүү','utf8mb4 requires a newer client library'=>'utf8mb4 жаңыраак кардар китепканасын талап кылат','Your MariaDB version supports utf8mb4.'=>'Сиздин MariaDB нускаңыз utf8mb4 колдойт.','utf8mb4 requires a MariaDB update'=>'utf8mb4 MariaDB жаңыртуусун талап кылат','Your MySQL version supports utf8mb4.'=>'Сиздин MySQL нускаңыз utf8mb4 колдойт.','utf8mb4 requires a MySQL update'=>'utf8mb4 MySQL жаңыртуусун талап кылат','UTF8MB4 is supported'=>'UTF8MB4 колдоого алынат','WordPress requires %1$s version %2$s or higher. Contact your web hosting company to correct this.'=>'WordPress үчүн %1$s нускасы %2$s же андан жаңыраак талап кылынат. Кырдаалды оңдоо үчүн хостинг колдооңузга кайрылыңыз.','Severely outdated SQL server'=>'Абдан эскирген SQL сервери','For optimal performance and security reasons, you should consider running %1$s version %2$s or higher. Contact your web hosting company to correct this.'=>'Иштин майнаптуулугу жана коопсуздук себептери үчүн, %1$s нускасын %2$s же андан жаңыраак колдонуу сунушталат. Кырдаалды оңдоо үчүн хостинг колдооңузга кайрылыңыз.','Outdated SQL server'=>'SQL сервери эскирген','SQL server is up to date'=>'SQL сервери жаңыртылган','One or more required modules are missing'=>'Талап кылынган бир же бир нече кеңейтүүлөр жок.','One or more recommended modules are missing'=>'Сунушталган бир же бир нече кеңейтүүлөр жок','The optional module, %s, is not installed, or has been disabled.'=>'Сунушталган %s кеңейтүүсү орнотулган эмес же өчүрүлгөн.','The required module, %s, is not installed, or has been disabled.'=>'Талап кылынган %s кеңейтүүсү орнотулган эмес же өчүрүлгөн.','Error'=>'Ката','Required and recommended modules are installed'=>'Талап кылынган жана сунушталган кеңейтүүлөр орнотулган','Your site does not have any default theme. Default themes are used by WordPress automatically if anything is wrong with your chosen theme.'=>'Сайтта орнотулган демейки темалар жок. Демейки темалар учурдагы темада көйгөйлөр жаралган учурда WordPress тарабынан автоматтык түрдө чакырылат.','Have a default theme available'=>'Демейки теманы орнотуңуз','To enhance your site&#8217;s security, you should consider removing any themes you are not using. You should keep %1$s, the default WordPress theme, %2$s, your active theme, and %3$s, its parent theme.'=>'Сайттын коопсуздугун жогорулатуу үчүн колдонулбаган темаларды өчүрүү сунушталат. Сиз демейки %1$s WordPress темасын, учурдагы %2$s темасын жана анын %3$s негизги темасын сакташыңыз керек.','To enhance your site&#8217;s security, you should consider removing any themes you are not using. You should keep your active theme, %1$s, and %2$s, its parent theme.'=>'Сайттын коопсуздугун жогорулатуу үчүн колдонулбаган темаларды өчүрүү сунушталат. Учурдагы %1$s темасын жана анын негизги темасы %2$s сакташыңыз керек.','You should remove inactive plugins'=>'Активдүү эмес плагиндерди өчүрүү сунушталат','Your site has %d installed theme, and it is up to date.'=>'Сайтта %d орнотулган тема актуалдуу абалда.','Your site has %d theme waiting to be updated.'=>'Сиздин %d сайтыңызда жаңыланууну күтүп жаткан тема бар.','You have themes waiting to be updated'=>'Темалар үчүн жеткиликтүү жаңыртуулар бар','Themes add your site&#8217;s look and feel. It&#8217;s important to keep them up to date, to stay consistent with your brand and keep your site secure.'=>'Темалар сайтыңыздын сырткы көрүнүшүн жаратат. Сайттын коопсуздугун жана сайттын бирдиктүү имиджин сактоо үчүн аларды жаңыртып туруу өтө маанилүү.','Your themes are all up to date'=>'Сиздин темаларыңыз актуалдуу','Your site has %d active plugin, and it is up to date.'=>'Сайтта %d активдүү плагин актуалдуу абалда.','Your site has %d plugin waiting to be updated.'=>'Сиздин %d сайтыңызда жаңыланууну күтүп ж