rdPress иштеп чыгуу жаңыртуулары %s константасы тарабынан бөгөттөлгөн.','All of your WordPress files are writable.'=>'Бардык WordPress файлдары жазуу үчүн жеткиликтүү.','Some files are not writable by WordPress:'=>'Кээ бир файлдар WordPress жаздыруу үчүн жеткиликтүү эмес:','This could mean that connections are failing to WordPress.org.'=>'Бул WordPress.org менен туташуу жеткиликтүү эмес дегенди билдирет.','Couldn\'t retrieve a list of the checksums for WordPress %s.'=>'WordPress %s үчүн текшерүү суммасынын тизмесин алуу мүмкүн эмес.','Your installation of WordPress does not require FTP credentials to perform updates.'=>'Сиздин WordPress орнотууңуз жаңыртуу үчүн FTP кирүү дайындарын талап кылбайт.','(Your site is performing updates over FTP due to file ownership. Talk to your hosting company.)'=>'(Сиздин сайтыңыз файлдын ээсине байланыштуу FTP аркылуу жаңыртылды. Хостинг колдооңузга кайрылыңыз.)','Your installation of WordPress prompts for FTP credentials to perform updates.'=>'Сиздин WordPress орнотууңуз жаңыртуу үчүн FTP кирүү маалыматын талап кылат.','No version control systems were detected.'=>'Файлдын нускасын башкаруу тутуму аныкталган жок.','The folder %1$s was detected as being under version control (%2$s).'=>'%1$s папкасы файл нускасын башкаруу тутумунун (%2$s) көзөмөлүндө катары аныкталган.','The folder %1$s was detected as being under version control (%2$s), but the %3$s filter is allowing updates.'=>'%1$s папкасы файл нускасын башкаруу тутумунун (%2$s) көзөмөлүндө катары аныкталган, бирок %3$s чыпкасы жаңыртууларга уруксат берет.','A previous automatic background update could not occur.'=>'Мурунку автоматтык фондук жаңыртуу ишке ашкан жок.','The error code was %s.'=>'Ката коду %s болду.','When you\'ve been able to update using the "Update now" button on Dashboard > Updates, this error will be cleared for future update attempts.'=>'Аспап панели > Жаңыртуулардагы "Азыр жаңыртуу" баскычын колдонсоңуз, бул ката келечектеги жаңыртуу аракеттери үчүн тазаланат.'