 - %s. Демейки категорияны өчүрүүгө болбойт.','The block widgets require JavaScript. Please enable JavaScript in your browser settings, or install the <a href="%s">Classic Widgets plugin</a>.'=>'Блоктун редактору JavaScript\'ти талап кылат. Сураныч, браузериңиздин жөндөөлөрүнөн JavaScript иштетиңиз же <a href="%s">Classic Widgets</a> плагинин колдонуп көрүңүз.','A post type mismatch has been detected.'=>'Жазуу түрүнүн дал келбегендиги аныкталды.','A post ID mismatch has been detected.'=>'Жазуунун ID\'ру дал келбегендиги аныкталды.','Please open the <a href="%s">classic editor</a> to use this meta box.'=>'Сураныч, бул метадайындар талаасын колдонуу үчүн <a href="%s">классикалык редакторду</a> ачыңыз.','Please activate the <a href="%s">Classic Editor plugin</a> to use this meta box.'=>'Сураныч, бул метадайындар талаасын колдонуу үчүн <a href="%s">классикалык редакторду</a> плагинин активдештириңиз.','Please install the <a href="%s">Classic Editor plugin</a> to use this meta box.'=>'Сураныч, бул метадайындар талаасын колдонуу үчүн <a href="%s">классикалык редакторду</a> плагинди орнотуңуз.','This meta box is not compatible with the block editor.'=>'Бул метадайын талаасы блок редактору менен шайкеш келбейт.','To distribute copies of your modified versions to others.'=>'Өзүңүз өзгөрткөн программанын көчүрмөлөрүн эркин таратыңыз.','The 4th Freedom'=>'Төртүнчү Эркиндик','To redistribute.'=>'Жайылтуу','The 3rd Freedom'=>'Үчүнчү Эркиндик','To study how the program works and change it to make it do what you wish.'=>'Программанын кантип иштээрин билип, аны өз максаттарыңызга жетүү үчүн өзгөртүңүз.','The 2nd Freedom'=>'Экинчи Эркиндик','To run the program for any purpose.'=>'Программаны каалаган максатта иштетиңиз.','The 1st Freedom'=>'Биринчи Эркиндик','Created'=>'Түзүлгөн','Welcome to WordPress. This is your first post. Edit or delete it, then start writing!'=>'WordPress\'ке кош келиңиз. Бул сиздин биринчи жазууңуз. Аны түзөтүңүз же өчүрүңүз, андан кийин жазууну толтуруп баштаңыз!','As a new WordPress user, you should go to <a href="%s">your dashboard</a> to delete this page and create new pages for your content. Have fun!'=>'Бул баракты өчүрүп, жаңысын түзүү үчүн <a href="%s">консолго</a> өтүңүз. Ийгилик!','The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.'=>'&laquo;XYZ Doohickey&raquo; компаниясы 1971-жылы негизделип, ошондон бери сапаттуу буюмдарды чыгарып келет. Компания Готам шаарында жайгашкан, 2000-ден ашуун кызматкерлери бар жана Готамдын элине чоң баалуулуктарды алып келет.','...or something like this:'=>'...же ушул сыяктуу:','Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)'=>'Саламатсызбы! Күндүз мен курьермин, ал эми кечинде &#8212; жаңыдан келе жаткан актёрмун. Бул менин блогум. Мен Кызыл-Кыяда жашайм, мен Джек деген итимди жакшы көрөм жана пина коладаны (Жана жамгырга калып калууну).','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:'=>'Бул мисал баракчасы болуп саналат. Блог жазмалардан айырмаланып турат, анткени ал бир жерде калат жана сайтыңыздын менюсунда (көпчүлүк темаларда) көрсөтүлөт. Көпчүлүк сайттын ээлери, потенциалдуу конокторго "Маалымат" барагынан баштап, өздөрү жөнүндө айтып беришет. Мисалы, бул сыяктуу:','Export &#8220;%s&#8221; as JSON'=>'&#8220;%s&#8221; JSON катары экспорттоо','1 pattern not updated, somebody is editing it.'=>'1 паттерн жаңыртылган жок, кимдир бирөө аны түзөтүп жатат.','%s pattern restored from the Trash.'=>'%s паттерн себеттен калыбына келтирилди.','<strong>Error:</strong> "Table Prefix" must not be empty.'=>'<strong>Ката:</strong> "Таблица префикси" бош болушу мүмкүн эмес.','This meta box, from the %s plugin, is not compatible with the block editor.'=>'%s плагининин метадайындар талаасы блок редактору менен шайкеш келбейт.','personal data group labelAbout'=>'Дайындар','page titleAbout'=>'Биз тууралуу','<a href="%1$s">Edit</a> or <a href="%2$s">preview</a> your Privacy Policy page content.'=>'Купуялык саясаты барагынын мазмунун <a href="%1$s">түзөтүңүз</a> же <a href="%2$s">көрүңүз</a>.','Privacy Policy Page'=>'Купуялык Саясат барагы','%s (Draft)'=>'%s (Карануска)','Privacy Policy page updated successfully.'=>'Купуялык Саясаты барагы жаңыланды.','The suggested privacy policy content should be added by using the %s (or later) action. Please see the inline documentation.'=>'Купуялык саясаты үчүн сунуш кылынган мазмун %s аракети менен кошулушу керек (же андан кийинки). Сураныч, камтылган документтерди карагыла.','The suggested privacy policy content should be added only in wp-admin by using the %s (or later) action.'=>'Купуялык Саясаты үчүн сунушталган мазмун wp-admin\'ге %s аракети менен кошулушу керек (же кийинчерээк).','The suggested privacy policy text has changed. Please <a href="%s">review the guide</a> and update your privacy policy.'=>'Купуялык саясатынын сунушталган тексти өзгөрдү. Сураныч, <a href="%s">колдонмону карап чыгыңыз</a> жана купуялык саясатыңызды жаңыртыңыз.','There are no pages.'=>'Барактар жок.','Need help putting together your new Privacy Policy page? <a href="%1$s" %2$s>Check out our privacy policy guide%3$s</a> for recommendations on what content to include, along with policies suggested by your plugins and theme.'=>'Купуялык саясатыңыздын жаңы барагынын долбоорун түзүүгө жардам керекпи? <a href="%1$s" %2$s>Плагиндериңиз жана темаларыңыз сунуштаган мазмунду киргизүү боюнча сунуштарды жана саясаттарды көрүү үчүн биздин%3$s колдонмобузду</a> карап чыгыңыз.','Privacy Policy Guide'=>'Купуялык саясаты боюнча колдонмо','Visitor comments may be checked through an automated spam detection service.'=>'Колдонуучунун комментарийлерин автоматтык түрдө спам аныктоо кызматы тарабынан текшерилиши мүмкүн.','In this subsection you should note what analytics package you use, how users can opt out of analytics tracking, and a link to your analytics provider&#8217;s privacy policy, if any.'=>'Бул бөлүмдө сиз колдонгон веб аналитика топтомун, колдонуучулар өздөрүнө көз салуудан кантип баш тарта аларын жана бар болсо, веб аналитика провайдеринин купуялык саясатына шилтемени кошуңуз.','In this subsection you should note what information may be disclosed by users who can upload media files. All uploaded files are usually publicly accessible.'=>'Бул бөлүмдө сиз медиа файлдарды жүктөө мүмкүнчүлүгү бар колдонуучулардан кандай маалымат ачык болуп калаарын көрсөтүүңүз керек. Бардык жүктөлүп берилген файлдар адатта жалпыга жеткиликтүү болот.','In this subsection you should note what information is captured through comments. We have noted the data which WordPress collects by default.'=>'Бул бөлүмдө комментарийлер менен бирге кандай маалыматтар сакталганын белгилеп кетүү зарыл. Биз буга чейин WordPress демейки боюнча эмне курарын белгилеп кеткенбиз.','In this section you should note what personal data you collect from users and site visitors. This may include personal data, such as name, email address, personal account preferences; transactional data, such as purchase information; and technical data, such as information about cookies.'=>'Бул бөлүмдө сиз колдонуучулардан жана коноктордон кандай жеке маалыматтарды чогултуп жатканыңызды белгилешиңиз керек, бул аты-жөнү, email дареги, аккаунттун жөндөөлөрү, сатып алуу маалыматтары сыяктуу операциялык маалыматтар, кукилер тууралуу маалымат сыяктуу техникалык маалыматтар.','Suggested text:'=>'Сунушталган текст:','Updated %s.'=>'Жаңыланды %s.','You deactivated this plugin on %s and may no longer need this policy.'=>'Сиз бул %s плагинди өчүрдүңүз жана мындан ары бул саясаттын кереги жок болушу мүмкүн.','Removed %s.'=>'%s өчүрүлдү.','Introduction'=>'Киришүү','Need help putting together your new Privacy Policy page? Check out our guide for recommendations on what content to include, along with policies suggested by your plugins and theme.'=>'Купуялык саясатыңыздын жаңы барагын иштеп чыгууга жардам керекпи? Плагиндериңиз жана темаңыз тарабынан сунушталган талап кылынган мазмун жана саясаттар боюнча сунуштар үчүн биздин колдонмобузду караңыз.','Erasing data...'=>'Дайындар өчүрүлүүдө...','Add Data Erasure Request'=>'Дайындарды өчүрүүгө сурам кошуңуз','Send export link'=>'Экспорттук шилтемени жөнөтүү','If you are a member of a regulated industry, or if you are subject to additional privacy laws, you may be required to disclose that information here.'=>'Эгер сиз жөнгө салынуучу тармактын мүчөсү болсоңуз же купуялык боюнча кошумча мыйзамдарга баш ийсеңиз, бул маалыматты бул жерге кошсоңуз болот.','Industry regulatory disclosure requirements'=>'Тармактык ченемдик талаптарды ачыкка чыгаруу талаптары','What automated decision making and/or profiling we do with user data'=>'Колдонуучунун маалыматтарынын негизинде кандай автоматтык чечимдер кабыл алынат','What third parties we receive data from'=>'Биз маалыматтарды кайсы үчүнчү тараптардан алабыз','In this section you should explain what procedures you have in place to deal with data breaches, either potential or real, such as internal reporting systems, contact mechanisms, or bug bounties.'=>'Бул жерде сиз бузуулардан коргоо үчүн кандай процедуралар көрүлүп жатканын, мүмкүн болгон же реалдуу, мисалы, ички аныктоо тутумдары, байланыш механизми же каталарды издөө үчүн стимул программаларын тизмектеп чыгышыңыз керек.','What data breach procedures we have in place'=>'Маалыматтарды бузууга каршы кандай процедуралар бар','In this section you should explain what measures you have taken to protect your users&#8217; data. This could include technical measures such as encryption; security measures such as two factor authentication; and measures such as staff training in data protection. If you have carried out a Privacy Impact Assessment, you can mention it here too.'=>'Бул бөлүмдө колдонуучуларыңыздын маалыматтарын коргоо үчүн көрүлгөн чаралар түшүндүрүлүшү керек. Бул шифрлөө сыяктуу техникалык чараларды, 2 фактордук аутентификация сыяктуу коопсуздук чараларын жана кызматкерлер тараптагы чараларды камтыйт (маалыматтарды коргоо курстары алар аяктаган). Эгер сиз таасирине баалоо (Privacy Impact Assessment (PIA)) жүргүзгөн болсоңуз, бул тууралуу да эскере аласыз.','How we protect your data'=>'Сиздин маалыматыңызды кантип коргойбуз','If you use your site for commercial purposes and you engage in more complex collection or processing of personal data, you should note the following information in your privacy policy in addition to the information we have already discussed.'=>'Эгерде сиз өз сайтыңызды коммерциялык максатта колдонсоңуз жана жеке маалыматтарды татаалыраак чогултуу же иштетүүнү ишке ашырсаңыз, анда купуялык билдирүүсүндө кошумча түрдө төмөнкү маалыматтарды беришиңиз керек.','Additional information'=>'Кошумча маалымат','In this section you should provide a contact method for privacy-specific concerns. If you are required to have a Data Protection Officer, list their name and full contact details here as well.'=>'Бул жерде сиз купуялык маселелери боюнча сиз менен байланышуу ыкмасын көрсөтүшүңүз керек. Эгерде сизде маалыматтарды коргоо боюнча адис болсо, анын аты-жөнүн жана толук байланыш маалыматтарын бериңиз.','European data protection law requires data about European residents which is transferred outside the European Union to be safeguarded to the same standards as if the data was in Europe. So in addition to listing where data goes, you should describe how you ensure that these standards are met either by yourself or by your third party providers, whether that is through an agreement such as Privacy Shield, model clauses in your contracts, or binding corporate rules.'=>'ЕБ\'тин Маалыматтарды коргоо боюнча жалпы жобосу ЕБ\'дин чегинен тышкары берилген европалык жашоочулар жөнүндө маалыматтарды ЕБ\'дегидей эле стандарттарга ылайык коргоону талап кылат. Ошентип, маалыматтар кайда өткөрүлүп берилгенин тизмелөөдөн тышкары, сиз же үчүнчү тарап стандарттарга кандайча жооп берип жатканын, мисалы, "Privacy Shield" келишими, келишимдердеги пункттар же милдеттүү корпоративдик эрежелерди көрсөтүү керек.','In this section you should list all transfers of your site data outside the European Union and describe the means by which that data is safeguarded to European data protection standards. This could include your web hosting, cloud storage, or other third party services.'=>'Бул бөлүмдө ЕБ\'ден тышкаркы бардык берилиштер тизмеси жана ЕБ стандарттарына ылайык маалыматтарды коргоо чараларын камсыз кылуу керек. Бул сиздин веб-хостингиңизди, булут сактагычыңызды жана башка үчүнчү тараптын кызматтарын камтышы мүмкүн.','If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.'=>'Эгер сайтта аккаунтуңуз болсо же комментарий калтырсаңыз, биз сиз жөнүндө сактаган жеке маалыматтардын, анын ичинде сиз берген маалыматтардын экспорттук файлын талап кыла аласыз. Сиз ошондой эле бул маалыматтарды өчүрүүнү сурансаңыз болот, бул биз административдик, юридикалык же коопсуздук максаттары үчүн сактоого милдеттүү болгон маалыматтарды камтыбайт.','In this section you should explain what rights your users have over their data and how they can invoke those rights.'=>'Бул бөлүмдө колдонуучулардын өз маалыматтарына кандай укуктары бар жана алар аларды кантип колдонсо болорун түшүндүрүшү керек.','What rights you have over your data'=>'Сиздин маалыматтарыңызга кандай укуктарыңыз бар','For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.'=>'Биздин сайтта катталган колдонуучулар үчүн биз алардын профилинде көрсөткөн жеке маалыматын сактайбыз. Бардык колдонуучулар каалаган убакта (колдонуучунун атын кошпогондо) өздөрүнүн профилдик маалыматын көрүп, түзөтүп же өчүрө алышат. Вебсайттын администрациясы да бул маалыматты көрүп жана өзгөртө алат.','If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.'=>'Эгерде сиз комментарий калтырсаңыз, комментарийдин өзү жана анын метадайындары чексиз сакталат. Бул кийинки комментарийлерди кабылдоо үчүн кезекке коюунун ордуна, автоматтык түрдө аныктоо жана кабылдоо максатында жасалат.','How long we retain your data'=>'Сиздин маалыматыңызды канча убакытка чейин сактайбыз','By default WordPress does not share any personal data with anyone.'=>'Демейки боюнча, WordPress эч кандай жеке маалымат менен бөлүшпөйт.','In this section you should name and list all third party providers with whom you share site data, including partners, cloud-based services, payment processors, and third party service providers, and note what data you share with them and why. Link to their own privacy policies if possible.'=>'Бул сиз сайттын дайындарын бөлүшкөн бардык үчүнчү тараптарды, анын ичинде өнөктөштөрдү, булут кызматтарын, төлөм шлюздарын жана башка кызмат көрсөтүүчүлөрдү атап, тизмектеши керек. Аларга кандай маалыматтарды жана эмне үчүн бергениңизди белгилеңиз. Мүмкүн болсо, алардын купуялык эскертүүлөрүнө шилтеме бериңиз.','Who we share your data with'=>'Дайындарыңызды ким менен бөлүшөбүз','By default WordPress does not collect any analytics data. However, many web hosting accounts collect some anonymous analytics data. You may also have installed a WordPress plugin that provides analytics services. In that case, add information from that plugin here.'=>'WordPress өз алдынча эч кандай аналитикалык маалыматтарды чогултпайт. Бирок, көптөгөн хостинг компаниялары жашыруун маалыматтарды чогултат. Сиз ошондой эле веб аналитика плагинин орноткон болушуңуз мүмкүн. Бул учурда, бул плагиндин маалыматын бул жерге кошуңуз.','Analytics'=>'Веб-аналитика','These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.'=>'Бул сайттар сиз жөнүндө маалыматтарды чогултушу, кукилерди колдонушу, үчүнчү жактын кошумча көзөмөлүн жүргүзүшү жана киргизилген мазмун менен болгон өз ара мамилеңизди, анын ичинде аккаунтуңуз бар болсо жана ошол сайтка авторизацияланган болсоңуз, өз ара аракеттенишиңизди көзөмөлдөп турушу мүмкүн.','Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.'=>'Бул сайттагы макалалар кыналган мазмунду камтышы мүмкүн (мисалы, видеолор, сүрөттөр, макалалар жана башкалар.), ушул сыяктуу мазмун башка сайтка кирген адам сыяктуу эле жүрөт.','Embedded content from other websites'=>'Башка веб-сайттардын кыналган мазмуну','If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.'=>'Браузерде макаланы түзөтүүдө же жарыялоодо кошумча куки сакталат, ал жеке маалыматтарды камтыбайт жана сиз түзөткөн жазуунун ID\'ун гана камтыйт, 1 күндөн кийин мөөнөтү бүтөт.','When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.'=>'Аккаунтуңузга киргениңизде, биз кирүү чоо-жайы жана экран жөндөөлөрү менен бир нече куки файлдарын орнотобуз. Кирүү кукилери эки күн сакталат, экран жөндөөлөрү бир жыл бою сакталат. Эгер сиз "Мени эстеп кал" опциясын тандасаңыз, кирүү маалыматыңыз эки жума бою сакталат. Аккаунтуңуздан чыкканыңызда, кирүү кукилери өчүрүлөт.','If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.'=>'Эгерде сиздин сайтта аккаунтуңуз болсо жана сиз кирсеңиз, биз сиздин браузериңиз кукилерди колдой тургандыгын аныктоо үчүн убактылуу куки файлын орнотобуз, кукилер эч кандай жеке маалыматты камтыбайт жана браузериңизди жапканыңызда өчүрүлөт.','If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.'=>'Эгер сиз биздин сайтка комментарий калтырсаңыз, атыңызды, емайл дарегин жана сайтыңызды куки файлында сактоону тандасаңыз болот. Бул сиздин ынгайлуулугуңуз үчүн, кайра комментарий жазганда маалыматтарды кайра толтурбоо үчүн жасалат. Бул кукилер бир жыл бою сакталат.','Cookies'=>'Куки','An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.'=>'Сиздин емайл дарегиңизден ("хэш") түзүлгөн анонимдүү сап Gravatar кызматын колдонуп жатканыңызды аныктоо үчүн берилиши мүмкүн. Gravatar купуялык саясаты бул жерде жеткиликтүү: https://automattic.com/privacy/ . Комментарий кабылдангандан кийин, профилиңиздин сүрөтү комментарийиңиздин контекстинде жалпыга ачык болот.','When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.'=>'Эгерде конок сайтка комментарий калтырса, биз комментарий формасында көрсөтүлгөн маалыматтарды, ошондой эле спам аныктоо максатында коноктун IP дарегин жана браузердин колдонуучу-агентинин маалыматтарын чогултабыз.','By default, WordPress does not include a contact form. If you use a contact form plugin, use this subsection to note what personal data is captured when someone submits a contact form, and how long you keep it. For example, you may note that you keep contact form submissions for a certain period for customer service purposes, but you do not use the information submitted through them for marketing purposes.'=>'WordPress\'тин өзүнүн байланыш формасы жок. Эгер сиз байланыш формасынын плагинин колдонуп жатсаңыз, байланыш формасын толтурууда кандай маалыматтар чогултулуп, аны канча убакытка чейин сактай турганыңызды көрсөтүү үчүн бул бөлүмдү колдонуңуз. Мисалы, сиз кардарларды тейлөө максатында форманын дайындарын бир нече убакытка сактап кала турганыңызды, бирок маалыматты маркетинг максаттары үчүн колдонбой турганыңызды белгилесеңиз болот.','Contact forms'=>'Байланыш формалары','If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.'=>'Эгер сиз катталган колдонуучу болсоңуз жана сайтка сүрөттөрдү жүктөсөңүз, анда EXIF ​​метадайындары бар сүрөттөрдү жүктөөдөн качсаңыз болот, анткени алар GPS жайгашкан жериңизди камтышы мүмкүн. Коноктор бул маалыматты сайттан сүрөттөрдү жүктөп алуу менен чыгара алышат.','By default WordPress does not collect any personal data about visitors, and only collects the data shown on the User Profile screen from registered users. However some of your plugins may collect personal data. You should add the relevant information below.'=>'Демейки боюнча, WordPress катталган колдонуучулар үчүн колдонуучунун профилинин бетинде көрсөтүлгөндөн башка коноктор жөнүндө эч кандай жеке маалыматтарды чогултпайт. Бирок, сиздин плагиндериңиздин айрымдары жеке маалыматтарды жана башка маалыматты чогултушу мүмкүн. Сиз бул маалыматты төмөндө кошушуңуз керек.','Personal data is not just created by a user&#8217;s interactions with your site. Personal data is also generated from technical processes such as contact forms, comments, cookies, analytics, and third party embeds.'=>'Жеке маалыматтар колдонуучу сайт менен иштешкенде гана түзүлбөстөн, ошондой эле байланыш формалары, комментарийлер, кукилер, аналитикалык маалыматтар жана үчүнчү жактардын кошумчалары сыяктуу техникалык процесстер аркылуу түзүлөт.','In addition to listing what personal data you collect, you need to note why you collect it. These explanations must note either the legal basis for your data collection and retention or the active consent the user has given.'=>'Чогултулган жеке маалыматтардын тизмесинен тышкары, сиз аны эмне үчүн чогултуп жатканыңызды белгилешиңиз керек. Бул түшүндүрмөлөр маалыматтарды чогултуунун жана сактоонун мыйзамдуулугун же колдонуучу берген макулдугун негиздеши керек.','You should also note any collection and retention of sensitive personal data, such as data concerning health.'=>'Сиз ошондой эле, мисалы, ден соолук маалыматтары сыяктуу купуя маалыматтарды чогултуу жана сактоо фактысын баса белгилешиңиз керек.','What personal data we collect and why we collect it'=>'Биз кандай жеке маалыматтарды жана кандай максатта чогултабыз','Our website address is: %s.'=>'Биздин сайттын дареги: %s.','The amount of information you may be required to show will vary depending on your local or national business regulations. You may, for example, be required to display a physical address, a registered address, or your company registration number.'=>'Талап кылынган маалыматтын көлөмү жергиликтүү же улуттук эрежелерге жараша айырмаланышы мүмкүн. Мисалы, сизден юридикалык даректи, чыныгы даректи же уюмдун каттоо номерин көрсөтүүнү талап кылынышы мүмкүн.','In this section you should note your site URL, as well as the name of the company, organization, or individual behind it, and some accurate contact information.'=>'Бул бөлүмдө сайтыңыздын дарегин (URL), анын артында турган компаниянын, уюмдун же жеке адамдардын атын, ошондой эле так байланыш маалыматын кошушуңуз керек.','Who we are'=>'Биз кимбиз','It is your responsibility to write a comprehensive privacy policy, to make sure it reflects all national and international legal requirements on privacy, and to keep your policy current and accurate.'=>'Сиздин бардык улуттук жана эл аралык талаптарды камтыган купуялык саясатын жазуу жана аны так жана жаңыртуу сиздин милдетиңиз.','Please edit your privacy policy content, making sure to delete the summaries, and adding any information from your theme and plugins. Once you publish your policy page, remember to add it to your navigation menu.'=>'Сураныч, купуялык саясатыңыздын мазмунун жалпылоону алып салуу жана темаларыңыздан жана плагиндериңизден маалымат кошуу менен түзөтүңүз. Купуялык саясаты жарыялангандан кийин, аны багыттоо менюсуна кошууну унутпаңыз.','As a website owner, you may need to follow national or international privacy laws. For example, you may need to create and display a privacy policy.'=>'Сайттын ээси катары сиз улуттук же эл аралык купуялык мыйзамдарына баш ийишиңиз керек. Мисалы, конокторго купуялык саясатынын барагын түзүп, көрсөтүшүңүз керек болот.','Force erasure has failed.'=>'Мажбурлап өчүрүү ишке ашкан жок.','Email could not be sent.'=>'Емайл билдирүүсүн жиберүү мүмкүн эмес.','date/timeOn'=>'Күйгүзүү','website URLAt URL'=>'URL боюнча','website nameFor site'=>'Сайт үчүн','email addressReport generated for'=>'Төмөнкүлөр үчүн отчет түзүлдү','Exporter array at index %s does not include a friendly name.'=>'Экспорттоочу массивдин %s индексинде жараксыз аталыш табылды.','Sorry, you are not allowed to erase personal data on this site.'=>'Кечиресиз, бул сайттагы жеке маалыматтарды өчүрүүгө укугуңуз жок.','Sorry, you are not allowed to export personal data on this site.'=>'Кечиресиз, бул сайттан жеке маалыматтарды экспорттоого укугуңуз жок.','Eraser index is out of range.'=>'Тазалоочу функциянын индекси уруксат берилген чектен тышкары.','Missing eraser index.'=>'Тазалоочу функциясы үчүн индекс жок.','Expected done (boolean) in response array from exporter: %s.'=>'Экспорттоочу жооп массивинде аяктоо күтүлүүдө (логикалык): %s.','Expected data array in response array from exporter: %s.'=>'Экспорттоочу жооп массиви катары күтүлгөн маалымат массиви: %s.','Expected data in response array from exporter: %s.'=>'Экспорттоочунун жооп массиви катары күтүлгөн маалыматтар: %s.','Expected response as an array from exporter: %s.'=>'Экспорттоочудан массив катары күтүлгөн жооп: %s.','Exporter callback is not a valid callback: %s.'=>'Экспорттоочунун кайра чалуусу жараксыз: %s.','Exporter does not include a callback: %s.'=>'Экспорттоочу кайра чалууларды камтыбайт: %s.','Expected an array describing the exporter at index %s.'=>'%s индексине экспорттоочунун сүрөттөлүшү менен массив күтүлүүдө.','Exporter index is out of range.'=>'Экспорттоочунун индекси уруксат берилген чектен тышкары.','Exporter index cannot be negative.'=>'Экспорттоочунун индекси терс болушу мүмкүн эмес.','An exporter has improperly used the registration filter.'=>'Экспорттоочу каттоо чыпкасын туура эмес колдонгон.','Missing page index.'=>'Барактын индекси жетишпейт.','Missing exporter index.'=>'Экспорттоо үчүн индекс жок.','Invalid request type.'=>'Сурамдын түрү туура эмес.','Use This Page'=>'Бул баракты колдонуңуз','Select a Privacy Policy page'=>'Купуялык саясатынын барагын тандаңыз','Change your Privacy Policy page'=>'Купуялык саясатыңыздын барагын түзөтүңүз','<a href="%1$s">Edit</a> or <a href="%2$s">view</a> your Privacy Policy page content.'=>'Купуялык саясат барагыңыздын мазмунун <a href="%1$s">түзөтүңүз</a> же <a href="%2$s">көрүңүз</a>.','You should also review your privacy policy from time to time, especially after installing or updating any themes or plugins. There may be changes or new suggested information for you to consider adding to your policy.'=>'Ошондой эле купуялык саясатыңызды мезгил-мезгили менен карап чыгуу сунушталат, айрыкча плагиндерди жана темаларды орнотуп же жаңырткандан кийин. Ал саясатыңызга жаңы маалыматты кошуу үчүн өзгөртүүлөрдү же сунуштарды камтышы мүмкүн.','However, it is your responsibility to use those resources correctly, to provide the information that your privacy policy requires, and to keep that information current and accurate.'=>'Бирок, бул ресурстарды туура колдонуу, купуялык саясатыңыз талап кылган маалыматты камсыз кылуу жана аны актуалдуу жана так сактоо сиздин жоопкерчилигиңиз.','The new page will include help and suggestions for your privacy policy.'=>'Жаңы баракча сиздин купуялык саясатыңыз боюнча жардам жана сунуштарды камтышы керек.','If you already have a Privacy Policy page, please select it below. If not, please create one.'=>'Эгер сизде купуялык саясаты барагы бар болсо, аны төмөндө тандаңыз. Эгер жок болсо, анда аны түзүңүз.','The currently selected Privacy Policy page is in the Trash. Please create or select a new Privacy Policy page or <a href="%s">restore the current page</a>.'=>'Учурда тандалган купуялык саясатынын барагы себетке чыгарылды. Жаңы баракты түзүңүз же тандаңыз, сиз ошондой эле <a href="%s">себеттен баракты калыбына келтирсеңиз</a> болот.','The currently selected Privacy Policy page does not exist. Please create or select a new page.'=>'Учурда тандалган купуялык саясатынын барагы жок. Жаңы баракты түзүңүз же тандаңыз.','Unable to create a Privacy Policy page.'=>'Купуялык саясатынын барагын түзүү мүмкүн эмес.','privacy-policy'=>'privacy-policy','Privacy Policy page setting updated successfully. Remember to <a href="%s">update your menus</a>!'=>'Купуялык саясатынын барагы жаңыртылды. <a href="%s">менюну жаңыртууну</a> унутпаңыз!','Copy suggested policy text from %s.'=>'Сунушталган купуялык саясатынын текстин %s\'ден көчүрүңүз.','Howdy,

