 массивге шилтемеси бар билдирүү ачкычы күтүлүүдө (индекс %2$d).','Expected messages key in response array from %1$s eraser (index %2$d).'=>'%1$s тазалоочу функцияларынын жооп массивинде билдирүү ачкычы күтүлүүдө (индекс %2$d).','Expected items_retained key in response array from %1$s eraser (index %2$d).'=>'Ачкыч items_retained %1$s тазалоочу функциясынан жооп массивинде күтүлөт (индекс %2$d).','Expected items_removed key in response array from %1$s eraser (index %2$d).'=>'Ачкыч items_removed %1$s тазалоочу функциясынан жооп массивинде күтүлөт (индекс %2$d).','Did not receive array from %1$s eraser (index %2$d).'=>'%1$s тазалоочу функциясынан массив алынган жок (индекс %2$d).','Eraser array at index %d does not include a friendly name.'=>'%d индексиндеги тазалоочу массиви колдонуучунун атын камтыбайт.','Expected an array describing the eraser at index %d.'=>'%d индексиндеги тазалоочу функциясынын сүрөттөмөлөрүнүн массиви күтүлүүдө.','Page index cannot be less than one.'=>'Барактын индекси бирден кем болбошу керек.','Eraser index cannot be less than one.'=>'Тазалоочунун индекси бирден кем болбошу керек.','Invalid email address in request.'=>'Сурамда емайл дареги жараксыз.','Requires PHP Version:'=>'Талап кылынган PHP нускасы:','This changeset cannot be further modified.'=>'Бул өзгөртүүлөр топтомун мындан ары өзгөртүү мүмкүн эмес.','This data is used to provide general enhancements to WordPress, which includes helping to protect your site by finding and automatically installing new updates. It is also used to calculate statistics, such as those shown on the <a href="%s">WordPress.org stats page</a>.'=>'Бул маалымат жалпы WordPress жакшыртуулары үчүн колдонулат, анын ичинде издөө менен сайтыңызды коргоо жана жаңы жаңыртууларды автоматтык түрдө орнотуу. Алар ошондой эле <a href="%s">WordPress.org статистика барагында</a> көрсөтүлгөн статистиканы түзүү үчүн колдонулат.','There is no need to change your CSS here &mdash; you can edit and live preview CSS changes in the <a href="%s">built-in CSS editor</a>.'=>'Бул жерде CSS өзгөртүүнүн кереги жок &mdash; сиз өзгөртүүлөрүңүздү <a href="%s">Inline CSS</a> редакторунда түзөтүп жана алдын ала көрө аласыз.','Did you know?'=>'Сиз билесизби?','Noteworthy Contributors'=>'Белгилей кетүүчү көмөкчүлөр','If you decide to go ahead with direct edits anyway, use a file manager to create a copy with a new name and hang on to the original. That way, you can re-enable a functional version if something goes wrong.'=>'Эгер сиз дагы эле түз түзөтүүнү улантууну чечсеңиз, түпнускага өзгөртүү киргизүүдөн мурун жаңы ат менен көчүрмөнү түзүү үчүн файл менеджерин колдонуңуз. Ушундай жол менен бир нерсе туура эмес болуп калса, функционалдык нусканы кайра иштете аласыз.','If you absolutely have to make direct edits to this plugin, use a file manager to create a copy with a new name and hang on to the original. That way, you can re-enable a functional version if something goes wrong.'=>'Эгер сиз бул плагинге түздөн-түз түзөтүүлөрдү жасашыңыз керек болсо, түпнусканы өзгөртүүдөн мурун жаңы ат менен көчүрмөнү түзүү үчүн файл менеджерин колдонуңуз. Ушундай жол менен бир нерсе туура эмес болуп калса, функционалдык нусканы кайра иштете аласыз.','You appear to be making direct edits to your plugin in the WordPress dashboard. Editing plugins directly is not recommended as it may introduce incompatibilities that break your site and your changes may be lost in future updates.'=>'Сиз WordPress консолунан плагинди түз түзөтүүгө аракет кылып жаткан окшойсуз. Биз муну жасоону сунуш кылбайбыз! Бул сиздин сайтыңызды бузган шайкешсиздиктерди жаратышы мүмкүн жана өзгөрүүлөр келечектеги жаңыртуулар менен сакталбай калышы мүмкүн.','WordPress is not notifying any <a href="%1$s">Update Services</a> because of your site&#8217;s <a href="%2$s">visibility settings</a>.'=>'Сайтыңыздын <a href="%2$s">көрүнүү мүмкүнчүлүгүн орнотууга</a> ылайык WordPress эч кандай <a href="%1$s">Жаңыртуу көзөмөлдөө кызматтарына</a> кабар бербейт.','<strong>Error:</strong> The root directory of your site is not <a href="%1$s">writable</a>, so creating a file automatically was not possible. This is the URL rewrite rule you should have in your %2$s file. Create a new file called %2$s in the root directory of your site. Click in the field and press %3$s (or %4$s on Mac) to select all. Then insert this code into the %2$s file.'=>'<strong>Ката:</strong> Сайттын түпкү папкасы <a href="%1$s">жазууга мүмкүн эмес</a>, андыктан файл автоматтык түрдө түзүлбөй калды. Бул жерде %2$s файлында болушу керек болгон шилтемени которуу эрежеси келтирилген. Сайтыңыздын түпкү папкасында %2$s деген жаңы файлды түзүңүз. Бардык текстти тандоо үчүн кутучаны, андан соң %3$s (Mac\'та: %4$s) баскычын басыңыз. Андан кийин бул кодду %2$s ичине кыстарыңыз.','Enter the same address here unless you <a href="%s">want your site home page to be different from your WordPress installation directory</a>.'=>'Эгер сиз <a href="%s">сайттын дареги WordPress орнотуу каталогунан айырмаланышын кааласаңыз</a>, даректи бул жерге киргизиңиз.','We take privacy and transparency very seriously. To learn more about what data we collect, and how we use it, please visit <a href="%s">our Privacy Policy</a>.'=>'Биз маалыматтарды чогултуунун купуялуулугуна жана ачыктыгына жакшы карайбыз. Биз чогулткан маалыматтар жана аларды кантип колдонгонубуз жөнүндө көбүрөөк билүү үчүн <a href="%s">WordPress.org/about/privacy</a> дарегине баш багыңыз.','https://wordpress.org/about/license/'=>'https://kir.wordpress.org/about/license/','From time to time, your WordPress site may send data to WordPress.org &#8212; including, but not limited to &#8212; the version you are using, and a list of installed plugins and themes.'=>'Мезгил-мезгили менен сиздин WordPress сайтыңыз WordPress.org сайтына маалыматтарды жөнөтүшү мүмкүн, анын ичинде сиз колдонуп жаткан WordPress нускасын, ошондой эле орнотулган плагиндер менен темалардын тизмесин.','Uploaded on: %s'=>'Жүктөлгөн: %s','Downloading installation 