'%s (жазылган жылы, 4 цифра, мисалы 2004.)','Theme Installation'=>'Теманы орнотуу','%s is currently editing this post.'=>'%s учурда бул жазууну түзөтүүдө.','%s is currently editing this post. Do you want to take over?'=>'%s учурда бул жазууну түзөтүүдө. Сиз тартып алгыңыз келеп жатабы?','Custom installation script.'=>'Кошумча орнотуу скрипти.','Active Installations:'=>'Активдүү орнотуулар:','Plugin Installation'=>'Плагинди орнотуу','<strong>Settings</strong> &mdash; This page shows a list of all settings associated with this site. Some are created by WordPress and others are created by plugins you activate. Note that some fields are grayed out and say Serialized Data. You cannot modify these values due to the way the setting is stored in the database.'=>'<strong>Жөндөөлөр</strong> &mdash; Бул баракчада бул сайтка тиешелүү бардык жөндөөлөрдүн тизмеси көрсөтүлгөн, алардын айрымдары WordPress тарабынан түзүлгөн, башкалары сиз иштеткен плагиндер тарабынан түзүлгөн. Кээ бир талаалар көлөкөлөнүп, серияланган маалыматтарды камтыганына көңүл буруңуз, алар маалымат базасында сакталгандыктан, бул маанилерди түздөн-түз өзгөртө албайсыз.','<strong>Themes</strong> &mdash; This area shows themes that are not already enabled across the network. Enabling a theme in this menu makes it accessible to this site. It does not activate the theme, but allows it to show in the site&#8217;s Appearance menu. To enable a theme for the entire network, see the <a href="%s">Network Themes</a> screen.'=>'<strong>Темалар</strong> &mdash; Бул аймакта тармакка уруксат берилбеген темалар көрсөтүлгөн. Бул менюдагы теманы иштетүү аны бул сайт үчүн жеткиликтүү кылат, ал теманы иштетпейт, бирок аны сайттын "Сырткы көрүнүш" менюсунда жеткиликтүү кылат. Бүтүндөй веб үчүн теманы иштетүү үчүн <a href="%s">Тармак темалары</a> экранын караңыз,','<strong>Users</strong> &mdash; This displays the users associated with this site. You can also change their role, reset their password, or remove them from the site. Removing the user from the site does not remove the user from the network.'=>'<strong>Колдонуучулар</strong> &mdash; Бул жерде сайт менен байланышкан колдонуучулар көрсөтүлгөн. Сиз ошондой эле алардын ролун өзгөртүп, сырсөзүн баштапкы абалга келтирип же сайттан өчүрө аласыз. Колдонуучуну сайттан өчүрүү аларды өз тармактарынан өчүрбөйт.','<strong>Info</strong> &mdash; The site URL is rarely edited as this can cause the site to not work properly. The Registered date and Last Updated date are displayed. Network admins can mark a site as archived, spam, deleted and mature, to remove from public listings or disable.'=>'<strong>Маалымат</strong> &mdash; Сайттын URL дарегин көп оңдоого болбойт, анткени бул сайттын туура иштеши үчүн көйгөйлөрдү жаратышы мүмкүн. Катталган датасы жана акыркы жаңыртуусу көрсөтүлөт. Тармактын администраторлору сайтты ачык тизмелерден же бөгөттөлгөн тизмелерден өчүрүү үчүн аны жашыруун, спам, өчүрүлгөн же "чоңдор үчүн" деп белгилей алышат.','The menu is for editing information specific to individual sites, particularly if the admin area of a site is unavailable.'=>'Бул меню айрым сайттарга тиешелүү маалыматты түзөтүү үчүн, айрыкча сайттын администратор аймагы жеткиликсиз болсо.','Unable to write to file.'=>'Файлга жазуу мүмкүн эмес.','Your PHP code changes were not applied due to an error on line %1$s of file %2$s. Please fix and try saving again.'=>'PHP кодуңуздун өзгөртүүлөрү %2$s файлындагы %1$s сабындагы катадан улам артка кайтарылды. Аны оңдоп, кайра сактоого аракет кылып көрүңүз.','Events and News dashboard widgethttps://wordpress.org/news/'=>'https://kir.wordpress.org/news/','Your Recent Drafts'=>'Сиздин акыркы каранускаңыз','nameUnknown'=>'Белгисиз','View posts by %s'=>'%s авторунун жазууларын көрүү','No description'=>'Сүрөттөмө жок','%s Active Installations'=>'%s Активдүү орнотуулар','Theme installation failed.'=>'Теманы орнотуу ишке ашкан жок.','Plugin installation failed.'=>'Плагинди орнотуу ишке ашкан жок.','Activate Plugin &amp; Go 