<a href="%s">use in your theme</a>.'=>'Кошумча талаалар сизге <a href="%s">темаңызда колдоно турган</a> жазууларга метадайындарды кошууга мүмкүндүк берет.','Trackbacks are a way to notify legacy blog systems that you&#8217;ve linked to them. If you link other WordPress sites, they&#8217;ll be notified automatically using <a href="%s">pingbacks</a>, no other action necessary.'=>'Артка шилтемелер &#8212; бул башка блогдорго шилтемеленгениңизди кабарлоонун бир жолу. Эгер сиз WordPress блогуна шилтеме кылсаңыз, ага автоматтык түрдө <a href="%s">билдирүү</a> жөнөтүлөт, мындан ары эч кандай аракет талап кылынбайт.','Excerpts are optional hand-crafted summaries of your content that can be used in your theme. <a href="%s">Learn more about manual excerpts</a>.'=>'Үзүндү - тема шаблондорунда колдонула турган текстиңиздин кошумча кыскача корутундусу. <a href="%s">Көбүрөөк билүү.</a>','The Text mode allows you to enter HTML along with your post text. Note that &lt;p&gt; and &lt;br&gt; tags are converted to line breaks when switching to the Text editor to make it less cluttered. When you type, a single line break can be used instead of typing &lt;br&gt;, and two line breaks instead of paragraph tags. The line breaks are converted back to tags automatically.'=>'Текст режими HTML кодун киргизүүгө мүмкүндүк берет. Текст режимине өткөндө &lt;p&gt; жана &lt;br&gt; тегдери текстти окууга ыңгайлуу кылуу үчүн саптык котормолорго айландырылаарын эске алыңыз. Терип жатканда &lt;br&gt; тегинин ордуна саптын бир котормосун жана &lt;p&gt; тегинин ордуна эки котормосун колдоно аласыз. Сайттагы текстти көрсөткөндө, сап котормолору автоматтык түрдө кайра тегдерге айландырылат.','Visual mode gives you an editor that is similar to a word processor. Click the Toolbar Toggle button to get a second row of controls.'=>'Визуалдык режимде сизде форматтоону көрсөткөн редактор бар. «Аспаптар панелин көрсөтүү/жашыруу» баскычын басуу менен, баскычтардын экинчи катарын ача аласыз.','Error saving media file.'=>'Медиафайлды сактоодо ката кетти.','%s media file restored from the Trash.'=>'Себеттен %s медиафайлы калыбына келтирилди.','%s media file moved to the Trash.'=>'%s медиафайлы себетке жылдырылды.','%s media file permanently deleted.'=>'%s медиафайлы биротоло өчүрүлдү.','%s media file detached.'=>'%s медиафайлы жазуудан ажыратылды.','Media file detached.'=>'Медиафайл жазуудан ажыратылды.','%s media file attached.'=>'%s медиафайлы жазууга тиркелди.','Media file attached.'=>'Медиафайл жазууга тиркелди.','Media file updated.'=>'Медиафайл жаңыртылды.','View %1$s version %2$s details'=>'%1$s нускасы %2$s тууралуу маалыматты көрүү','dashboard%1$s, %2$s'=>'%1$s, %2$s','<strong>Publish</strong> &mdash; You can set the terms of publishing your post in the Publish box. For Status, Visibility, and Publish (immediately), click on the Edit link to reveal more options. Visibility includes options for password-protecting a post or making it stay at the top of your blog indefinitely (sticky). The Password protected option allows you to set an arbitrary password for each post. The Private option hides the post from everyone except editors and administrators. Publish (immediately) allows you to set a future or past date and time, so you can schedule a post to be published in the future or backdate a post.'=>'<strong>Жарыялоо</strong> &#8212; &laquo;Жарыялоо&raquo; кутучасында жазууну жарыялоонун шарттарын орното аласыз. &laquo;Абалы&raquo;, &laquo;Көрүнүшү&raquo; жана &laquo;Жарыялоо (дароо)&raquo; бөлүмдөрүнүн кошумча параметрлерин көрүү үчүн алардын жанындагы &laquo;Өзгөртүү&raquo; шилтемесин басыңыз. &laquo;Көрүнүшү&raquo; бөлүмүндө сиз жазууну сырсөз менен коргой аласыз же аны дайыма жогору жагында көрсөтө аласыз (жабыштыруу). &laquo;Сырсөз менен корголгон&raquo; пунктунун жардамы менен жазууну көрүү үчүн сырсөз орното аласыз. &laquo;Жеке&raquo; пункту жазууну редакторлор менен администраторлордон башкалардын баарынан жашырат. &laquo;Жарыялоо (дароо)&raquo; бөлүмү келечектеги же өткөн күндү белгилөөгө мүмкүндүк берет, андыктан сиз жазууну пландаштырып же кийинчерээк жарыялай аласыз.','There is a pending change of your email to %s.'=>'Емайл дарегиңиз %s болуп өзгөргөндүгүн ырастоо күтүлүүдө.','Error while saving the new email address. Please try again.'=>'Жаңы емайл дарегин сактоодо ката кетти. Сураныч, кайра аракет кылыңыз.','You can narrow the list by file type/status or by date using the dropdown menus above the media table.'=>'Сиз тизмени файлдын түрү жана статусу боюнча же датасы боюнча файл таблицасынын үстүндөгү ачылуучу менюларды колдонуп тактай аласыз.','The following themes are installed but incomplete.'=>'Төмөнкү темалар орнотулган, бирок алар толук эмес.','New theme activated.'=>'Жаңы тема активдештирилди.','Settings saved and theme activated.'=>'Жөндөөлөр сакталды жана тема активдештирилди.','https://wordpress.org/themes/'=>'https://kir.wordpress.org/themes/','Sorry, you are not allowed to delete that user.'=>'Кечиресиз, бул колдонуучуну өчүрүүгө укугуңуз жок.','Your database password.'=>'Маалыматтар базасынын сырсөзү.','Your database username.'=>'Маалымат базасынын колдонуучу аты.','The name of the database you want to use with WordPress.'=>'WordPress\'ти орноткуңуз келген маалымат базасынын аты.','plugin%1$s by %2$s'=>'%1$s автору %2$s','%1$s by %2$s (will also <strong>delete its data</strong>)'=>'%1$s автору %2$s (плагин ошондой эле <strong>анын дайындарын өчүрөт</strong>)','There is a pending change of the admin email to %s.'=>'Администратордун емайл дареги %s болуп өзгөргөндүгүн ырастоо күтүлүүдө.','WordPress has been installed. Thank you, and enjoy!'=>'WordPress орнотулду. Ишиңизге ийгилик каалайбыз!','The constant %s cannot be defined when installing WordPress.'=>'%s константасы WordPress орнотуу учурунда активдүү болушу мүмкүн эмес.','Your %s file has an empty database table prefix, which is not supported.'=>'%s файлыңызда бош маалымат базасынын таблицасынын префикси камтылган. Бул конфигурация колдоого алынбайт.','Di