','You cannot delete a theme while it has an active child theme.'=>'Теманы анын кичи-темасы активдүү болуп турганда өчүрө албайсыз.','Mystery Person'=>'Табышмактуу Адам','Usernames can have only alphanumeric characters, spaces, underscores, hyphens, periods, and the @ symbol.'=>'Колдонуучунун аты латын тамгаларын, боштуктарды, астынкы сызыктарды, дефистерди, чекиттерди жана @ символун гана камтышы мүмкүн.','Enable full-height editor and distraction-free functionality.'=>'Редактордун созулган бийиктигин жана толук экран режимин иштетүү.','https://planet.wordpress.org/feed/'=>'https://planet.wordpress.org/feed/','https://planet.wordpress.org/'=>'https://planet.wordpress.org/','Untested with your version of WordPress'=>'WordPress нускаңыз менен сыналган эмес.','All categories'=>'Бардык категориялар','Filter by comment type'=>'Комментарий түрү боюнча чыпкалоо','%s has been logged out.'=>'%s колдонуучусунун сессиялары аяктады.','You are now logged out everywhere else.'=>'Сиз башка сессиялардан чыктыңыз.','Could not log out user sessions. Please try again.'=>'Колдонуучу сессияларынан чыгуу ишке ашкан жок. Сураныч, кайра аракет кылыңыз.','This preview is unavailable in the editor.'=>'Редактордо алдын ала кароо жеткиликтүү эмес.','You can insert media files by clicking the button above the post editor and following the directions. You can align or edit images using the inline formatting toolbar available in Visual mode.'=>'Сиз редактордун үстүндөгү сүрөтчөлөрдү басуу жана көрсөтмөлөрдү аткаруу менен медиафайлдарды жүктөй аласыз. Сиз визуалдык режимде жеткиликтүү калкыма панелдин жардамы менен сүрөттөрдү тегиздеп же түзөтө аласыз.','<strong>Post editor</strong> &mdash; Enter the text for your post. There are two modes of editing: Visual and Text. Choose the mode by clicking on the appropriate tab.'=>'<strong>Жазуу редактору</strong> &#8212; жазууңуздун текстин киргизиңиз. Эки түзөтүү режими бар: визуалдык жана текст. Тиешелүү өтмөктү басуу менен алардын ортосунда которулуштура аласыз.','You can now manage and live-preview Custom Header in the <a href="%s">Customizer</a>.'=>'Эми сиз <a href="%s">тема жөндөөлөрүнүн экранынан</a> кошумча аталышыңызды башкара аласыз жана өзгөрүүлөрдү көрө аласыз.','You can now manage and live-preview Custom Backgrounds in the <a href="%s">Customizer</a>.'=>'Эми сиз <a href="%s">тема жөндөөлөрүнүн экранынан</a> кошумча фонуңузду башкара аласыз жана өзгөрүүлөрдү көрө аласыз.','Welcome panelWelcome'=>'Кош келиңиз','usersAll <span class="count">(%s)</span>'=>'Баары <span class="count">(%s)</span>','link nameName'=>'Аталышы','If you like, you may enter custom structures for your category and tag URLs here. For example, using <code>topics</code> as your category base would make your category links like <code>%s/topics/uncategorized/</code>. If you leave these blank the defaults will be used.'=>'Кааласаңыз, категория жана тег URL даректери үчүн кошумча префикстерди кошо аласыз. Мисалы, <code>/topics/</code> категория шилтемелерин төмөнкүдөй кылып түзөт: <code>%s/topics/uncategorized/</code>. Эгер талааларды бош калтырсаңыз, демейки маанилер колдонулат.','Release Lead'=>'Чыгаруу жетекчиси','Use the arrow buttons at the top of the dialog, or the left and right arrow keys on your keyboard, to navigate between media items quickly.'=>'Файлдар арасында тез жылыш үчүн терезенин жогору жагындагы жебелерди же сол/оң баскычтарды колдонуңуз.','You can also delete individual items and access the extended edit screen from the details dialog.'=>'Параметрлер терезесинде сиз жеке элементти өчүрө аласыз же кеңейтилген түзөтүүгө өтсөңүз болот.','Clicking an item will display an Attachment Details dialog, which allows you to preview media and make quick edits. Any changes you make to the attachment details will be automatically saved.'=>'Элементти басуу менен &laquo;Файл жөндөөлөрү&raquo; терезеси ачылат, анда сиз файлды көрүп, майда түзөтүүлөрдү жасай аласыз. Бардык өзгөртүүлөр автоматтык түрдө сакталат.','To delete media items, click the Bulk Select button at the top of the screen. Select any items you wish to delete, then click the Delete Selected button. Clicking the Cancel Selection button takes you back to viewing your media.'=>'Файлдарды өчүрүү үчүн, экрандын жогору жагындагы "Көптүк тандоо" баскычын басыңыз. Өчүргүңүз келген элементтерди тандап, андан кийин "Тандалгандарды өчүрүү"баскычын басыңыз. "Тандоону өчүрүү" баскычын басуу менен сиз файлдарды кароого кайтып келе аласыз.','You can view your media in a simple visual grid or a list with columns. Switch between these views using the icons to the left above the media.'=>'Сиз файлдарды жөнөкөй визуалдык тор же тилкелери бар тизме катары көрө аласыз. Файлдардын үстүндөгү сол жактагы сүрөтчөлөрдү колдонуп, керектүү көрүнүштү тандаңыз.','All the files you&#8217;ve uploaded are listed in the Media Library, with the most recent uploads listed first.'=>'Сиз жүктөгөн файлдардын баары файлдар китепканасында тизмеленген, эң акыркысы биринчи орунда.','If you just want to get an idea of what&#8217;s available, you can browse Featured and Popular plugins by using the links above the plugins list. These sections rotate regularly.'=>'Эгер сиз жөн гана идея алгыңыз келсе, тизменин үстүндөгү шилтемелер аркылуу тандалган жана популярдуу плагиндерди карап чыга аласыз. Бул бөлүмдөр дайыма жаңыланып турат.','Browse Plugins'=>'Плагинди карап чыгуу','Add Plugins'=>'Плагин кошуу','The %1$s constant in your %2$s file is no longer needed.'=>'%2$s файлындагы туруктуу %1$s мындан ары кереги жок.','Invalid translation type.'=>'Котормонун түрү туура эмес.','Welcome to the famous five-minute WordPress installation process! Just fill in the information below and you&#8217;ll be on your way to using the most extendable and powerful personal publishing platform in the world.'=>'Белгилүү беш мүнөттүк WordPress орнотуусуна кош келиңиз! Жөн гана талааларды толтуруңуз &#8212; жана дүйнөдөгү эң күчтүү жана ийкемдүү жеке жарыялоо платформасын колдонууга өтүңүз!','<strong>Compatible</strong> with your version of WordPress'=>'Сиздин WordPress нускаңыз менен <strong>шайкеш</strong> келет','<strong>Incompatible</strong> with your version of WordPress'=>'Сиздин WordPress нускаңыз менен <strong>шайкеш</strong> келбейт','%d star'=>'%d жылдыз','Select bulk action'=>'Жапырт аракетти тандаңыз','The grid view for the Media Library requires JavaScript. <a href="%s">Switch to the list view</a>.'=>'Файл китепканасын тор режиминде көрүү үчүн JavaScript талап кылынат. <a href="%s">Тизме режимине которулуу</a>.','Contributors'=>'Өнүктүрүү катышуучулары','Donate to this plugin &#187;'=>'Кайрымдуулук кылуу &#187;','Plugin installer section titleReviews'=>'Сын-пикирлер','The WordPress team is willing to help you. Forward this email to %s and the team will work with you to make sure your site is working.'=>'WordPress командасы сизге өз жардамын сунуштайт. Бул катты %s дарегине жөнөтүңүз, биз сиздин сайтыңыздын иштешин камсыз кылуу үчүн сиз менен байланышабыз.','themesRecently Updated'=>'Жакында жаңылангандар','Number/count of itemsCount'=>'Жазуулар','More Details'=>'Дайындар','Plugin installer group titleTools'=>'Аспаптар','Plugin installer group titleSocial'=>'Коомдук тармак','Plugin installer group titlePerformance'=>'Өндүрүмдүүлүк','Plugin InstallerBeta Testing'=>'Бета-сыноо','%s failed to embed.'=>'%s кыстаруу ишке ашкан жок.','Filtering by:'=>'Учурдагы чыпка:','Displayed on attachment pages.'=>'Тиркеме баракчаларында пайда болот.','You can edit the image while preserving the thumbnail. For example, you may wish to have a square thumbnail that displays just a section of the image.'=>'Сүрөттү түзөтсө болот, бирок миниатюраны сактагандан кийин. Эгер сиз сүрөттүн бир бөлүгүн гана камтыган төрт бурчтуу миниатюра калтыргыңыз келсе, бул пайдалуу болушу мүмкүн.','Once you have made your selection, you can adjust it by entering the size in pixels. The minimum selection size is the thumbnail size as set in the Media settings.'=>'Аймак тандалгандан кийин, өлчөмүн пиксел менен көрсөтүү менен аны жөндөй аласыз. Минималдуу аймак өлчөмү &laquo;Медиафайл Жөндөөлөр&raquo; бетинде коюлган миниатюра өлчөмүнө барабар.','The aspect ratio is the relationship between the width and height. You can preserve the aspect ratio by holding down the shift key while resizing your selection. Use the input box to specify the aspect ratio, e.g. 1:1 (square), 4:3, 16:9, etc.'=>'Пропорциялар &#8212; туурасынын бийиктикке болгон катышы болуп саналат. Тандалган аймактын өлчөмүн өзгөртүүдө, Shift баскычын басып туруп пропорцияларды сактасаңыз болот. Төмөнкү талааларда керектүү пропорцияларды көрсөтүңүз, мисалы 1:1 (квадрат), 4:3, 16:9 ж.б.','To crop the image, click on it and drag to make your selection.'=>'Сүрөттү кесүү үчүн, аны басып, чычкан баскычын басып туруп, керектүү бөлүгүн тандаңыз.','You can proportionally scale the original image. For best results, scaling should be done before you crop, flip, or rotate. Images can only be scaled down, not up.'=>'Сиз тараптардын катышын сактап, түпнуска сүрөттүн өлчөмүн өзгөртсөңүз болот. Эң жакшы натыйжаларга жетишүү үчүн, масштабдоо кесүү, айландыруу жана айлантуудан мурун жасалышы керек. Сүрөттөрдү кичирейтсе болот, бирок чоңойтууга болбойт.','Keyboard users: When you are working in the visual editor, you can use %s to access the toolbar.'=>'Баскычтоп колдонуучулары: Визуалдык редактордо иштегенде, куралдар тилкесине өтүү үчүн %s баскычын бассаңыз болот.','A red bar on the left means the comment is waiting for you to moderate it.'=>'Сол жактагы кызыл тилке комментарий сиздин карооңузду күтүп жатканын билдирет.','All comment types'=>'Комментарийлердин баардык түрү','themesLatest'=>'Соңку','themesPopular'=>'Популярдуу','themesFeatured'=>'Тандалган','Attribute all content to:'=>'Бардык мазмунду байланыштыруу:','Delete all content.'=>'Бардык мазмунду өчүрүү','What should be done with content owned by this user?'=>'Бул колдонуучунун жазууларын эмне кылуу керек?','<strong>Delete</strong> brings you to the Delete Users screen for confirmation, where you can permanently remove a user from your site and delete their content. You can also delete multiple users at once by using bulk actions.'=>'<strong>Өчүрүү</strong> ырастоо экранын ачат, анда сиз колдонуучуну да, алар түзгөн билдирүүлөрдү да сайттан биротоло өчүрө аласыз. Аракеттер менюсун колдонуп, бир эле учурда бир нече колдонуучуну өчүрө аласыз.','<strong>Remove</strong> allows you to remove a user from your site. It does not delete their content. You can also remove multiple users at once by using bulk actions.'=>'<strong>Өчүрүү</strong> колдонуучуну сайттан өчүрүүгө мүмкүндүк берет. Анын жазуулары сакталып калат. Аракеттер менюсун колдонуп, бир эле учурда бир нече колдонуучуну өчүрө аласыз.','themeDetails &amp; Preview'=>'Сүрөттөмө жана Көрүү','Search themes...'=>'Темаларды издөө...','Search Themes'=>'Темаларды издөө','Add Themes'=>'Темаларды кошуу','https://wordpress.org/support/forum/how-to-and-troubleshooting'=>'https://ru.wordpress.org/support/forum/how-to-and-troubleshooting','<strong>At a Glance</strong> &mdash; Displays a summary of the content on your site and identifies which theme and version of WordPress you are using.'=>'<strong>Көрүнүп турган жерде</strong> &mdash; сайтыңыздын мазмунунун, анын ичинде теманын жана WordPress нускасынын кыскача мазмунун көрсөтөт.','<strong>Box Controls</strong> &mdash; Click the title bar of the box to expand or collapse it. Some boxes added by plugins may have configurable content, and will show a &#8220;Configure&#8221; link in the title bar if you hover over it.'=>'<strong>Блок жөндөөлөрү</strong> &#8212; аны жайылтуу же жыйыштыруу үчүн блоктун аталышын басыңыз. Плагиндер тарабынан кошулган кээ бир блоктордун кошумча жөндөөлөрү болушу мүмкүн &#8212; курсорду алардын аталышына алып келгенде, &laquo;Жөндөө&raquo; шилтемеси пайда болот.','Sorry, you are not allowed to resume this theme.'=>'Кечиресиз, бул теманы иштетүүнү улантууга укугуңуз жок.','Edit date and time'=>'Убакыт жана күндү түзөтүү','Browse revisions'=>'Нускаларды көрүү','Edit visibility'=>'Көрүнүшүн түзөтүү','Edit status'=>'Абалын түзөтүү','<a href="https://wordpress.org/support/forum/multisite/">Support forums</a>'=>'<a href="https://ru.wordpress.org/support/forum/multisite/">Колдоо форумдары</a>','Thank you for creating with <a href="%s">WordPress</a>.'=>'<a href="%s">WordPress</a> менен чыгармачылык менен мамиле кылганыңыз үчүн рахмат.','Search installed themes...'=>'Орнотулган темаларды издөө...','<strong>Translations</strong> &mdash; The files translating WordPress into your language are updated for you whenever any other updates occur. But if these files are out of date, you can <strong>click the &#8220;Update Translations&#8221;</strong> button.'=>'<strong>Котормолор</strong> &mdash; Сиздин тилиңиз үчүн WordPress котормо файлдары башка файлдар менен бирге жаңыртылат. Бирок алар эскирип калса, <strong>Котормолорду жаңыртуу</strong> баскычын бассаңыз болот.','In most cases, WordPress will automatically apply maintenance and security updates in the background for you.'=>'Көпчүлүк учурларда, WordPress техникалык жана коопсуздук жаңыртууларын фондо автоматтык түрдө орнотот.','<strong>WordPress</strong> &mdash; Updating your WordPress installation is a simple one-click procedure: just <strong>click on the &#8220;Update now&#8221; button</strong> when you are notified that a new version is available.'=>'<strong>WordPress</strong> &mdash; WordPress\'ти жаңылоо абдан оңой; болгону жаңы нуска жеткиликтүү болгондо <strong>&#8220;Азыр жаңыртуу&#8221;</strong> баскычын бассаңыз эле болот.','If an update is available, you&#8127;ll see a notification appear in the Toolbar and navigation menu.'=>'Жаңыртуу жеткиликтүү болгондо, сиз сол жактагы үстүнкү тилкеде жана менюдан эскертмени көрөсүз.','<strong>Themes and Plugins</strong> &mdash; To update individual themes or plugins from this screen, use the checkboxes to make your selection, then <strong>click on the appropriate &#8220;Update&#8221; button</strong>. To update all of your themes or plugins at once, you can check the box at the top of the section to select all before clicking the update button.'=>'<strong>Темалар жана плагиндер</strong> &mdash; Жеке темаларды жана плагиндерди жаңыртуу үчүн, алардын кутучаларын белгилеп, андан соң <strong>тиешелүү &laquo;Жаңыртуу&raquo; баскычын</strong> басыңыз. Бардык темаларды же плагиндерди бир эле учурда жаңыртуу үчүн, баскычты басуудан мурун, бардык элементтерди тандоо үчүн таблицанын жогору жагындагы кутучаны белгилеңиз.','On this screen, you can update to the latest version of WordPress, as well as update your themes, plugins, and translations from the WordPress.org repositories.'=>'Бул экрандан WordPress\'тин жаңы нускасын орнотуп, ошондой эле WordPress.org каталогунан темаларды, плагиндерди жана котормолорду жаңырта аласыз.','If you would like to see more themes to choose from, click on the &#8220;Add New Theme&#8221; button and you will be able to browse or search for additional themes from the <a href="%s">WordPress Theme Directory</a>. Themes in the WordPress Theme Directory are designed and developed by third parties, and are compatible with the license WordPress uses. Oh, and they&#8217;re free!'=>'Тема тандооңузду кеңейтүүнү кааласаңыз, &#8220;Жаңы кошуу&#8221; баскычын басып, <a href="%s">WordPress каталогунан</a> кошумча темаларды карап же издесеңиз болот. WordPress каталогундагы темалар үчүнчү тараптар тарабынан түзүлүп, WordPress лицензиясы менен шайкеш келет. Ооба, жана алар бекер!','%1$s MB (%2$s%%) Space Used'=>'%1$s МБ (%2$s%%) бош эмес','%s MB Space Allowed'=>'%s МБ бөлүнгөн','M jS'=>'d.m.Y','%s Page'=>'%s барак','%s Post'=>'%s жазма','When this setting is in effect, a reminder is shown in the At a Glance box of the Dashboard that says, &#8220;Search engines discouraged&#8221;, to remind you that you have directed search engines to not crawl your site.'=>'Бул жөндөө колдонулганда, консолдун башкы бетинде &laquo;Көрүнүп турган жерде&raquo; аттуу блокто сайт индекстелбей жатканын эскертиш үчүн &laquo;Издөө системалары бөгөттөлдү&raquo; деген эскертүү көрсөтүлөт.','At a Glance'=>'Көрүнүп турган жерде','themeActive:'=>'Активдүү:','Accessibility Ready'=>'Атайын мүмкүнчүлүктөрдү колдоо','This is a child theme of %s.'=>'Бул %s үчүн кичи-темасы.','When previewing on smaller monitors, you can use the collapse icon at the bottom of the left-hand pane. This will hide the pane, giving you more room to preview your site in the new theme. To bring the pane back, click on the collapse icon again.'=>'Кичинекей мониторлордон көрүп жатканда, сол панелдин төмөнкү бөлүгүндөгү &laquo;Жыйыштыруу&raquo; белгисин бассаңыз болот. Панел жашырылып, сайтыңызды жаңы тема менен көрүү үчүн орун бошотот. Панелди кайтаруу үчүн &laquo;Кайтаруу&raquo; сүрөтчөсүн кайра  дагы бир жолу.','The theme being previewed is fully interactive &mdash; navigate to different pages to see how the theme handles posts, archives, and other page templates. The settings may differ depending on what theme features the theme being previewed supports. To accept the new settings and activate the theme all in one step, click the Activate &amp; Publish button above the menu.'=>'Сиз көрүп жаткан тема толугу менен интерактивдүү &mdash; Бул темада жазмалардын, архивдердин жана башка баракчалардын шаблондорунун кандайча көрүнөрүн көрүү үчүн шилтемелерди басыңыз. Орнотуулар сиз көрүп жаткан тема кандай функцияларды колдой турганына жараша темалардын ортосунда айырмаланышы мүмкүн. Өзгөртүүлөрдү колдонуу жана теманы дароо активдештирүү үчүн, &laquo;Сактоо жана активдештирүү&raquo; баскычын басыңыз менюнун жогору жагында.','Tap or hover on any theme then click the Live Preview button to see a live preview of that theme and change theme options in a separate, full-screen view. You can also find a Live Preview button at the bottom of the theme details screen. Any installed theme can be previewed and customized in this way.'=>'Каалаган теманы басыңыз же көрсөтүңүз, андан кийин ал шаблондун жандуу алдын ала көрүнүшүн көрүү жана өзүнчө толук экранда теманын жөндөөлөрүн өзгөртүү үчүн &laquo;Алдын ала көрүү&raquo; баскычын басыңыз. Теманын дайынын экранынын ылдый жагында &laquo;Алдын ала көрүү&raquo; баскычынан таба аласыз. Каалаган курама теманы ушундай жол менен карап, ыңгайлаштырса болот.','The active theme is displayed highlighted as the first theme.'=>'Учурдагы тема түс менен бөлүнүп, биринчи көрсөтүлөт.','Click Customize for the active theme or Live Preview for any other theme to see a live preview'=>'Учурдагы тема үчүн алдын ала көрүү терезесин ачуу үчүн &laquo;Жөндөө&raquo; баскычын же башка каалаган тема үчүн &laquo;Көрүү&raquo; баскычын басыңыз.','Click on the theme to see the theme name, version, author, description, tags, and the Delete link'=>'Теманы, анын аталышын, нускасын, авторун, сүрөттөмөсүн, тегдерин жана &laquo;Өчүрүү&raquo; шилтемесин көрүү үчүн басыңыз.','Hover or tap to see Activate and Live Preview buttons'=>'Курсорду теманын үстүнө алып барыңыз же &laquo;Активдештирүү&raquo; жана &laquo;Жандуу көрүү&raquo; баскычтарын көрүү үчүн көрсөтүңүз же басыңыз.','This screen is used for managing your installed themes. Aside from the default theme(s) included with your WordPress installation, themes are designed and developed by third parties.'=>'Бул экран орнотулган темаларды башкаруу үчүн колдонулат. WordPress орнотуусуна киргизилген демейки темалардан тышкары, темалар үчүнчү тараптар тарабынан түзүлөт.','To activate a widget drag it to a sidebar or click on it. To deactivate a widget and delete its settings, drag it back.'=>'Виджетти активдештирүү үчүн аны каптал тилкесине сүйрөп же аны басыңыз. Виджетти алып салуу же анын жөндөөлөрүн өчүрүү үчүн аны артка сүйрөңүз.','%s rating'=>'%s рейтинги','%1$s rating based on %2$s rating'=>'%2$s добушунун негизинде %1$s рейтинги','This screen shows an individual user all of their sites in this network, and also allows that user to set a primary site. They can use the links under each site to visit either the front end or the dashboard for that site.'=>'Бул экран колдонуучуга тармактагы бардык сайттарын көрсөтөт жана ошондой эле аларга негизги сайтты тандоого мүмкүндүк берет. Ар бир сайттын астындагы шилтемелерди колдонуу менен колдонуучу сайттын сырткы бөлүгүнө же консолуна өтө алат.','Error: [%1$s] %2$s'=>'Ката: [%1$s] %2$s','Rollback Error: [%1$s] %2$s'=>'Артка кайтаруу катасы: [%1$s] %2$s','The following translations failed to update:'=>'Төмөнкү котормолорду жаңыртуу мүмкүн болгон жок:','The following themes failed to update:'=>'Төмөнкү темаларды жаңыртуу мүмкүн эмес:','The following plugins failed to update:'=>'Төмөнкү плагиндерди жаңыртуу мүмкүн эмес:','The following translations were successfully updated:'=>'Төмөнкү котормолор ийгиликтүү жаңыртылды:','The following themes were successfully updated:'=>'Төмөнкү темалар ийгиликтүү жаңыртылды:','The following plugins were successfully updated:'=>'Төмөнкү плагиндер ийгиликтүү жаңыртылды:','Add Widget'=>'Виджет кошуу','Show next theme'=>'Кийинки теманы көрсөтүү','Show previous theme'=>'Мурунку теманы көрсөтүү','Update Available'=>'Жаңыртуу жеткиликтүү','Add New Theme'=>'Жаңы тема кошуу','Are you sure you want to delete this theme?

Click \'Cancel\' to go back, \'OK\' to confirm the delete.'=>'Бул теманы чын эле өчүрөсүзбү?

\'Жокко чыгаруу\' - кайтаруу, \'OK\' - өчүрүү.','Unable to submit this form, please refresh and try again.'=>'Форманы жөнөтүү мүмкүн эмес, баракты жаңыртып, дагы бир жолу аракет кылып көрүңүз.','<strong>Quick Draft</strong> &mdash; Allows you to create a new post and save it as a draft. Also displays links to the 3 most recent draft posts you\'ve started.'=>'<strong>Ыкчам карануска</strong> &#8212; жаңы жазуу түзүүгө жана аны карануска катары сактоого мүмкүнчүлүк берет. Ал ошондой эле сиз түзгөн акыркы 3 каранусканы көрсөтөт.','<strong>Activity</strong> &mdash; Shows the upcoming scheduled posts, recently published posts, and the most recent comments on your posts and allows you to moderate them.'=>'<strong>Активдүүлүк</strong> &#8212; пландаштырылган жана жакында жарыяланган жазууларды, ошондой эле аларды модерациялоо мүмкүнчүлүгү бар эң акыркы комментарийлерди көрсөтөт.','<strong>Screen Options</strong> &mdash; Use the Screen Options tab to choose which Dashboard boxes to show.'=>'<strong>Экран жөндөөлөрү</strong> &#8212; керектүү блокторду тандоо үчүн &laquo;Экран жөндөөлөрү&raquo; өтмөгүн колдонуңуз.','Manage Uploads'=>'Файлдарды башкаруу','Popular Plugin'=>'Популярдуу плагин','Tomorrow'=>'Эртең','No activity yet!'=>'Азырынча активдүүлүк болгон жок.','Recently Published'=>'Жакында жарыяланган','Publishing Soon'=>'Жарыялоону күтүүдө','What&#8217;s on your mind?'=>'Эмне жөнүндө жазгыңыз келет?','WordPress %1$s running %2$s theme.'=>'%2$s кооздоо темасы менен %1$s WordPress.','Quick Draft'=>'Ыкчам карануска','Activity'=>'Активдүүлүк','FAILED: %s'=>'КАТА: %s','SUCCESS: %s'=>'ИЙГИЛИК: %s','FAILED: WordPress failed to update to %s'=>'КАТА: WordPress %s нускасына чейин жаңыртылган жок','SUCCESS: WordPress was successfully updated to %s'=>'ИЙГИЛИК: WordPress %s нускасына ийгиликтүү жаңыртылды','WordPress site: %s'=>'WordPress сайты: %s','Your site was running version %s.'=>'Сиздин сайтыңызда %s нускасы орнотулган.','Your site at %1$s experienced a critical failure while trying to update WordPress to version %2$s.'=>'Сиздин %1$s сайтыңыз WordPress\'ти %2$s нускасына жаңыртуу аракетинде коркунучтуу катага туш болду.','WordPress %s is also now available.'=>'WordPress %s дагы жеткиликтүү.','The update cannot be installed because your site is unable to copy some files. This is usually due to inconsistent file permissions.'=>'Жаңыртууну орнотуу мүмкүн эмес, анткени биз кээ бир файлдарды көчүрө албайбыз. Бул, адатта, туура эмес файл уруксаттарына байланыштуу.','Your translations are all up to date.'=>'Сиздин котормоңузду жаңыртуунун кереги жок.','Translations'=>'Котормолор','Error code: %s'=>'Катанын коду: %s','Your hosting company, support forum volunteers, or a friendly developer may be able to use this information to help you:'=>'Сиздин хостинг провайдериңиз, колдоо форумундагы ыктыярчылар же дос-тааныш иштеп чыгуучу бул маалыматты сизге жардам берүү үчүн колдоно алат:','The WordPress Team'=>'WordPress Жамааты','You also have some plugins or themes with updates available. Update them now:'=>'Ошондой эле бир нече плагиндердин же темалардын жаңыртуулары жеткиликтүү. Аларды жаңыртыңыз:','If you experience any issues or need support, the volunteers in the WordPress.org support forums may be able to help.'=>'Эгер көйгөйгө туш болуп, колдоого муктаж болсоңуз, WordPress.org форумдарындагы ыктыярчылар жардам бере алышат.','Keeping your site updated is important for security. It also makes the internet a safer place for you and your readers.'=>'Коопсуздук себептеринен улам сайтты өз убагында жаңыртуу маанилүү. Ал ошондой эле Интернетти сиз жана окурмандарыңыз үчүн коопсуз жайга айлантат.','Please check out your site now. It\'s possible that everything is working. If it says you need to update, you should do so:'=>'Азыр сайтыңызды текшериңиз. Мүмкүн баары иштеп жаткандыр. Эгер ал сизден жаңыртууну сунуштаса, муну жасаңыз:','This means your site may be offline or broken. Don\'t panic; this can be fixed.'=>'Сайтыңыз жеткиликсиз же бузулган болушу мүмкүн. Кабатыр болбоңуз; муну оңдоого болот.','Your site at %1$s experienced a critical failure while trying to update to the latest version of WordPress, %2$s.'=>'%1$s сайтыңыз WordPress\'тин учурдагы %2$s нускасына жаңыртуу аракетинде коркунучтуу катага туш болду.','Updating is easy and only takes a few moments:'=>'Жаңыртуу жолдору жөнөкөй жана бир нече секундга созулат:','Please update your site at %1$s to WordPress %2$s.'=>'Сураныч, %1$s сайтыңызды WordPress %2$s нускасына жаңыртыңыз.','For more on version %s, see the About WordPress screen:'=>'%s нускасы тууралуу "WordPress жөнүндө" экранынан тапса болот:','No further action is needed on your part.'=>'Сиз тараптан эч кандай чара талап кылынбайт.','Howdy! Your site at %1$s has been updated automatically to WordPress %2$s.'=>'Сиздин %1$s сайтыңыз WordPress %2$s үчүн автоматтык түрдө жаңыртылган.','[%1$s] URGENT: Your site may be down due to a failed update'=>'[%1$s] ШАШЫЛЫШ: Жаңыртуу ишке ашпай калгандыктан, сайтыңыз жеткиликсиз болушу мүмкүн','[%1$s] WordPress %2$s is available. Please update!'=>'[%1$s] WordPress %2$s жеткиликтүү. Сураныч, жаңыртыңыз!','[%1$s] Your site has updated to WordPress %2$s'=>'[%1$s] Сайтыңыз WordPress %2$s чейин жаңыртылды','Translations for %s'=>'%s үчүн котормолор','Updating translations for %1$s (%2$s)&#8230;'=>'%1$s (%2$s) үчүн котормолорун жаңыртуу&#8230;','Update Translations'=>'Котормолорду жаңыртуу','Background updates'=>'Фон жаңыртуулары','There is not enough free disk space to complete the update.'=>'Жаңыртууну аягына чыгаруу үчүн дискте орун жетишсиз.','Updating plugin: %s'=>'Плагин жаңыланууда: %s','Updating theme: %s'=>'Тема жаңыланууда: %s','Translation updated successfully.'=>'Котормо ийгиликтүү жаңыланды.','Translation update failed.'=>'Котормону жаңыртуу ишке ашкан жок.','Some of your translations need updating. Sit tight for a few more seconds while they are updated as well.'=>'Айрым котормолоруңуз жаңыланууга муктаж. Бир нече секунд күтө туруңуз, биз аларды да жаңыртабыз.','Create a brand new user and add them to this site.'=>'Жаңы колдонуучу аккаунтун түзүп, аны бул сайтка кошуңуз.','Upgrading to a newer version of the same theme will override changes made here. To avoid this, consider creating a <a href="%s">child theme</a> instead.'=>'Тема жаңыланган учурда, сиз киргизген өзгөртүүлөр кайра жазылат. Мунун алдын алуу үчүн, сиз <a href="%s">кичи-теманы</a> түзсөңүз болот.','The sizes listed below determine the maximum dimensions in pixels to use when adding an image to the Media Library.'=>'Төмөндө көрсөтүлгөн сандар сүрөттүн максималдуу өлчөмүн, аны файл китепканасына кошууда пиксел менен аныктайт.','Comment must be manually approved'=>'Комментарий кол менен кабыл алынышы керек','<strong>Clicking the arrow to the right of any menu item</strong> in the editor will reveal a standard group of settings. Additional settings such as link target, CSS classes, link relationships, and link descriptions can be enabled and disabled via the Screen Options tab.'=>'<strong>Менюдагы каалаган элементтин оң жагындагы жебени басканда</strong> редактордо жөндөөлөрдүн стандарттуу топтому ачылат. Кошумча жөндөөлөр, мисалы, шилтеме максаты, CSS класстары, шилтемелердин байланышы жана сүрөттөлүшү &laquo;Экран орнотуулары&raquo; өтмөгүндө күйгүзүп же өчүрсө болот.','Menus can be displayed in locations defined by your theme, even used in sidebars by adding a &#8220;Navigation Menu&#8221; widget on the <a href="%1$s">Widgets</a> screen. If your theme does not support the navigation menus feature (the default themes, %2$s and %3$s, do), you can learn about adding this support by following the documentation link to the side.'=>'Менюларды <a href="%1$s">&laquo;Виджеттер&raquo;</a> экранында &#8220;Багыттоо менюсунун&#8221; виджетин кошуу менен тема аймактарында же виджет аймактарында көрсөтүүгө болот. Эгер сиздин темаңыз кошумча менюларды колдоого албаса (демейки темалар %2$s жана %3$s колдойт), сиз каптал тилкесинин шилтемесиндеги документтерди окуп, өзүңүз колдоону кантип кошууну үйрөнө аласыз.','Your theme does not natively support menus, but you can use them in sidebars by adding a &#8220;Navigation Menu&#8221; widget on the <a href="%s">Widgets</a> screen.'=>'Сиздин темаңыз кошумча менюларды колдобойт, бирок сиз аларды каптал тилкелериңизде <a href="%s">Виджеттер</a>ди башкаруу барагында &#8220;Багыттоо менюсу&#8221; виджетин кошуу менен колдоно аласыз.','Sorry, that is not a valid email address. Email addresses look like <code>username@example.com</code>.'=>'Кечиресиз, бул емайл дареги жараксыз. Мисалы дарек: <code>username@example.com</code>.','You must provide an email address.'=>'Сиз емайл дарегин киргизишиңиз керек.','Your passwords do not match. Please try again.'=>'Сырсөз дал келбейт. Сураныч, кайра аракет кылыңыз.','The username you provided has invalid characters.'=>'Киргизилген колдонуучунун аты жараксыз белгилерди камтыйт.','Please provide a valid username.'=>'Сураныч, жарактуу колдонуучу атын киргизиңиз.','Copying the required files&#8230;'=>'Керектүү файлдарды көчүрүү&#8230;','Preparing to install the latest version&#8230;'=>'Жаңы нускасын орнотууга даярданууда&#8230;','This password will not be stored on the server.'=>'Бул сырсөз серверде сакталбайт.','The checksum of the file (%1$s) does not match the expected checksum value (%2$s).'=>'Файлдын текшерүү суммасы (%1$s) күтүлгөн мааниге (%2$s) дал келбейт.','WordPress %s'=>'WordPress %s','Updating to WordPress %s'=>'WordPress %s чейин жаңыртуу','Due to an error during updating, WordPress has been restored to your previous version.'=>'Жаңыртуу катасынан улам биз WordPress\'тин мурунку нускасына кайтык.','Looking for %1$s in %2$s'=>'%2$s ичинен %1$s издөө','%s page restored from the Trash.'=>'%s барагы себеттен калыбына келтирилди.','%s page moved to the Trash.'=>'%s барагы себетке жылдырылды.','%s page permanently deleted.'=>'%s барагы биротоло өчүрүлдү.','%s page not updated, somebody is editing it.'=>'%s барагы жаңыртылган жок, аны кимдир бирөө түзөтүп жатат.','%s page updated.'=>'%s барагы жаңыртылды.','%s post restored from the Trash.'=>'%s жазуу себеттен калыбына келтирилди.','%s post moved to the Trash.'=>'%s жазуу себетке жылдырылды.','%s post permanently deleted.'=>'%s жазуу биротоло өчүрүлдү.','%s post not updated, somebody is editing it.'=>'%s жазуу жаңыртылган жок, аны кимдир бирөө түзөтүп жатат.','Tags deleted.'=>'Тегдер өчүрүлдү.','Tag not updated.'=>'Тег жаңыланган жок.','Tag not added.'=>'Тег кошулган жок.','Tag updated.'=>'Тег жаңыртылды.','Tag deleted.'=>'Тег өчүрүлдү.','Tag added.'=>'Тег кошулду.','Categories deleted.'=>'Категория өчүрүлдү.','Category not updated.'=>'Категория жаңыланган жок.','Category not added.'=>'Категория кошулган жок.','Category updated.'=>'Категория жаңыланды.','Category deleted.'=>'Категория өчүрүлдү.','Category added.'=>'Категория кошулду.','Compare two different revisions by <strong>selecting the &#8220;Compare any two revisions&#8221; box</strong> to the side.'=>'Оң жактагы <strong>&laquo;Эки нусканы салыштыруу&raquo; кутучасын белгилөө менен</strong> эки башка нусканы салыштыра аласыз.','Compare any two revisions'=>'Каалаган эки нусканы салыштырыңыз','Restore This Autosave'=>'Бул автосактоону калыбына келтириңиз','Current Revision by %s'=>'Учурдагы колдонуучунун нускасы %s','Autosave by %s'=>'Колдонуучуну автосактоо %s','revisionsBrowse'=>'Көрүү','Revisions: %s'=>'Нускасы: %s','"%s".'=>'"%s".','"%1$s" by %2$s.'=>'«%1$s» аткаруучу «%2$s».','"%1$s" from %2$s.'=>'«%1$s» «%2$s» альбомунан.','"%1$s" from %2$s by %3$s.'=>'%3$s тарабынан «%2$s» альбомундагы «%1$s».','Revision by %s'=>'Колдонуучунун нускасы %s','<strong>Connection lost.</strong> Saving has been disabled until you are reconnected.'=>'<strong>Серверге туташуу жоголду.</strong> Туташуу калыбына келмейинче, сактоо өчүрүлөт.','Sorry, something went wrong. The requested comparison could not be loaded.'=>'Кечиресиз, ката кетти. Суралган салыштырууну жүктөө мүмкүн болгон жок.','Repeat Password'=>'Сырсөздү кайталаңыз','Repeat New Password'=>'Жаңы сырсөздү кайталаңыз','Add menu items from the column on the left.'=>'Сол жактагы тилкеден меню элементтерин кошуңуз.','Plugins extend and expand the functionality of WordPress. You may install plugins in the <a href="%s">WordPress Plugin Directory</a> right from here, or upload a plugin in .zip format by clicking the button at the top of this page.'=>'Плагиндер WordPress\'тин функционалдуулугун кеңейтип, толуктайт. Сиз аларды <a href="%s">WordPress плагиндин каталогу</a>нан автоматтык түрдө орното аласыз же барактын жогору жагындагы баскычты басуу менен плагин архивин .zip форматында жүктөп алсаңыз болот.','http://wordpress.org/plugins/hello-dolly/'=>'http://kir.wordpress.org/plugins/hello-dolly/','The theme contains no files.'=>'Темада файлдар жок.','The package contains no files.'=>'Архивде файлдар жок.','To navigate between revisions, <strong>drag the slider handle left or right</strong> or <strong>use the Previous or Next buttons</strong>.'=>'Нускалардын ортосунда которуштуруу үчүн, <strong>сыдырманы солго же оңго сүйрөңүз</strong> же <strong>&laquo;Мурунку&raquo; жана &laquo;Кийинки&raquo; баскычтарды колдонуңуз</strong>.','Loading&hellip;'=>'Жүктөө&hellip;','This item has already been deleted.'=>'Бул элемент эчак эле өчүрүлгөн.','The item you are trying to restore from the Trash no longer exists.'=>'Себеттен калыбына келтирүүгө аракет кылып жаткан элемент жок.','The item you are trying to move to the Trash no longer exists.'=>'Сиз себетке жылдырууга аракет кылып жаткан элемент жок.','Drag the items into the order you prefer. Click the arrow on the right of the item to reveal additional configuration options.'=>'Элементтерди сүйрөп жылдыруу аркылуу каалаган тартипте жайгаштырыңыз. Кошумча жөндөөлөрдү ачуу үчүн элементтин оң жагындагы жебени бассаңыз да болот.','If you have not yet created any menus, <strong>click the &#8217;create a new menu&#8217; link</strong> to get started'=>'Эгер сизде азырынча бир дагы меню жок болсо, <strong>&laquo;жаңы меню түзүү&raquo; шилтемесин басыңыз</strong>.','To restore a revision, <strong>click Restore This Revision</strong>.'=>'Нусканы калыбына келтирүү үчүн, <strong>Бул нусканы калыбына келтирүү</strong> баскычын басыңыз.','From this screen you can review, compare, and restore revisions:'=>'Бул экрандан сиз нускаларды көрүп, салыштырып жана калыбына келтире аласыз:','Revisions are saved copies of your post or page, which are periodically created as you update your content. The red text on the left shows the content that was removed. The green text on the right shows the content that was added.'=>'Нускалары &#8212; булар сиздин жазууңуздун же баракчаңыздын жаңыртылган сайын түзүлүп турган сакталган көчүрмөлөрү. Сол жактагы кызыл текст эмнелер өчүрүлгөнүн көрсөтөт. Оң жактагы жашыл текст эмне кошулганын көрсөтөт.','This screen is used for managing your content revisions.'=>'Бул экран нускаларды башкаруу үчүн колдонулат.','Followed by post revision infoTo:'=>'Оң жакта:','Button label for a next revisionNext'=>'Кийинки','Button label for a previous revisionPrevious'=>'Мурунку','Followed by post revision infoFrom:'=>'Сол жакта:','menuUse new menu'=>'Жаңы менюну колдонуу','menuEdit'=>'Түзөтүү','Select a Menu'=>'Менюну тандаңыз','Assigned Menu'=>'Дайындалган меню','Theme Location'=>'Тема аймагы','Manage Locations'=>'Аймакты башкаруу','Edit Menus'=>'Менюларды түзөтүү','To add a new menu instead of assigning an existing one, <strong>click the &#8217;Use new menu&#8217; link</strong>. Your new menu will be automatically assigned to that theme location'=>'Дайындалган менюнун ордуна жаңы меню түзүү үчүн, <strong>&laquo;Жаңы менюну колдонуу&raquo; шилтемесин басыңыз</strong>. Жаңы менюңуз ошол аймакка автоматтык түрдө дайындалат.','To edit a menu currently assigned to a theme location, <strong>click the adjacent &#8217;Edit&#8217; link</strong>'=>'Аймактардын бирине дайындалган менюну өзгөртүү үчүн <strong>анын жанындагы &laquo;Түзөтүү&raquo; шилтемесин басыңыз</strong>.','To assign menus to one or more theme locations, <strong>select a menu from each location&#8217;s dropdown</strong>. When you are finished, <strong>click Save Changes</strong>'=>'Теманын бир же бир нече аймагына менюну дайындоо үчүн, <strong>тиешелүү аймак үчүн ачылып түшүүчү тизмеден менюну тандаңыз</strong>. Бүткөндөн кийин, <strong>&laquo;Өзгөртүүлөрдү сактоо&raquo; баскычын чыкылдатыңыз </strong>.','This screen is used for globally assigning menus to locations defined by your theme.'=>'Бул экран жасалгалоо темасында каралган аймактарга менюларды көрсөтүү үчүн колдонулат.','Editing Menus'=>'Менюларды түзөтүү','Delete a menu item by <strong>expanding it and clicking the Remove link</strong>'=>'Менюдагы элементтин <strong>аны жайып, &laquo;Өчүрүү&raquo;</strong> шилтемесин басуу менен өчүрсөңүз болот.','To reorganize menu items, <strong>drag and drop items with your mouse or use your keyboard</strong>. Drag or move a menu item a little to the right to make it a submenu'=>'Меню элементтеринин тартибин өзгөртүү үчүн <strong>аларды курсор менен сүйрөңүз же клавиатураны колдонуңуз</strong>. Субменюну түзүү үчүн элементти бир аз оңго сүйрөңүз же жылдырыңыз.','Add one or several items at once by <strong>selecting the checkbox next to each item and clicking Add to Menu</strong>'=>'<strong>Ар бир элементти текшерип, &laquo;Менюга кошуу&raquo;</strong> баскычын басуу менен бир же бир нече элементти кошуңуз.','Each navigation menu may contain a mix of links to pages, categories, custom URLs or other content types. Menu links are added by selecting items from the expanding boxes in the left-hand column below.'=>'Ар бир багыттоо менюсу барактарга шилтемелерди, категорияларды, кошумча даректерди жана башка мазмун түрлөрүн камтышы мүмкүн. Шилтемелер менюга сол жактагы тилкедеги ачылып түшүүчү блоктордон элементтерди тандоо менен кошулат.','Menu Management'=>'Менюну башкаруу','You can assign theme locations to individual menus by <strong>selecting the desired settings</strong> at the bottom of the menu editor. To assign menus to all theme locations at once, <strong>visit the Manage Locations tab</strong> at the top of the screen.'=>'Меню редакторунун ылдый жагындагы <strong>каалаган жөндөөлөрдү</strong> тандоо менен теманын бир же бир нече аймактары үчүн өзүнчө менюну дайындай аласыз. Теманын бардык аймактарына бир эле учурда менюну дайындоо үчүн, экрандын жогору жагындагы <strong>&laquo;Аймактарды башкаруу&raquo; өтмөгүнө</strong> өтүңүз.','To edit an existing menu, <strong>choose a menu from the dropdown and click Select</strong>'=>'Учурдагы менюну өзгөртүү үчүн <strong>аны ачыл түшүүчү тизмеден тандап, &laquo;Тандоо&raquo;</strong> баскычын басыңыз.','The menu management box at the top of the screen is used to control which menu is opened in the editor below.'=>'Экрандын жогору жагындагы меню башкаруу блогу төмөндөгү редактордо көрсөтүлө турган менюну тандоо үчүн колдонулат.','Add, organize, and modify individual menu items'=>'Жеке меню элементерин кошуу, сорттоо жана өзгөртүү','Create, edit, and delete menus'=>'Менюларды түзүү, түзөтүү жана өчүрүү','From this screen you can:'=>'Бул экранда сиз төмөнкүлөрдү аткара аласыз:','This screen is used for managing your navigation menus.'=>'Бул экран багыттоо менюларыңызды башкаруу үчүн колдонулат.','Menu locations updated.'=>'Меню үчүн аймактар жаңыртылды.','Your latest changes were saved as a revision.'=>'Акыркы өзгөртүүлөрүңүз нуска катары сакталды.','Audio Codec:'=>'Аудиокодек:','Audio Format:'=>'Аудиоформат:','Genre: %s.'=>'Жанр: %s.','Track %1$s of %2$s.'=>'Трек %1$s ичинен %2$s.','Released: %d.'=>'Чыгарылган күнү: %d.','%1$s by %2$s.'=>'«%1$s» аткаруучу %2$s.','Restore This Revision'=>'Бул нусканы калыбына келтириңиз','Denied: %s'=>'Четке кагылды: %s','Capabilities'=>'Мүмкүнчүлүктөрү','Menu Settings'=>'Меню жөндөөлөрү','Menu structure'=>'Менюнун түзүлүшү','To the top'=>'Жогору','Down one'=>'Төмөн','Up one'=>'Жогору','Move'=>'Жылдыруу','Draft created on %1$s at %2$s'=>'Карануска %2$s ичинде %1$s тарабынан түзүлдү','You cannot move this item to the Trash. %s is currently editing.'=>'Бул элементти себетке жылдыра албайсыз. Учурда аны %s түзөтүүдө.','%s has taken over and is currently editing.'=>'%s кармап алды азыр бул материалды түзөтүп жатат.','Select a menu to edit:'=>'Өзгөртүү үчүн менюну тандаңыз:','Thank you for Updating! Please visit the <a href="%s">Upgrade Network</a> page to update all your sites.'=>'Жаңы нускасын орнотконуңуз үчүн рахмат! Сураныч, бардык сайттарды жаңыртуу үчүн <a href="%s">&laquo;Тармакты жаңыртуу&raquo;</a> барагына өтүңүз.','All right, sparky! You&#8217;ve made it through this part of the installation. WordPress can now communicate with your database. If you are ready, time now to&hellip;'=>'Баары жайында! Сиз орнотуунун бул бөлүгүн ийгиликтүү аяктадыңыз. WordPress азыр маалымат базасына туташа алат. Эгер даяр болсоңуз, убакыт келди&hellip;','Client version'=>'Кардардын нускасы','Auto add pages'=>'Барактарды автоматтык түрдө кошуу','Give your menu a name, then click Create Menu.'=>'Менюнун атын киргизип, андан кийин &laquo;Менюну түзүү&raquo; баскычын басыңыз.','Edit your default menu by adding or removing items. Drag the items into the order you prefer. Click Create Menu to save your changes.'=>'Элементтерди кошуу же өчүрүү менен түпнуска менюну түзөтүңүз. Элементтерди жылдыруу менен керектүү тартипте жайгаштырыңыз. Өзгөртүүлөрүңүздү сактоо үчүн &laquo;Менюну түзүү&raquo; баскычын басыңыз.','Selected menus have been successfully deleted.'=>'Тандалган менюлар ийгиликтүү өчүрүлдү.','For PHP files, you can use the documentation dropdown to select from functions recognized in that file. Look Up takes you to a web page with reference material about that particular function.'=>'PHP файлдарын түзөтүүдө, сиз файлда камтылган функцияларды тандоо үчүн ылдый түшүүчү менюну колдоно аласыз. &laquo;Издөө&raquo; баскычы бул функция жөнүндө маалымат камтылган веб-баракчага алып барат.','Look Up'=>'Издөө','The documentation menu below the editor lists the PHP functions recognized in the plugin file. Clicking Look Up takes you to a web page about that particular function.'=>'Редактордун астындагы &laquo;Документтер&raquo; менюсу плагин файлында табылган бардык PHP функцияларынын тизмеси. &laquo;Издөө&raquo; баскычын басуу менен бул функция жөнүндө маалымат камтылган веб-баракча ачылат.','%s is currently editing'=>'%s учурда бул материалды түзөтүүдө','You can upload and insert media (images, audio, documents, etc.) by clicking the Add Media button. You can select from the images and files already uploaded to the Media Library, or upload new media to add to your page or post. To create an image gallery, select the images to add and click the &#8220;Create a new gallery&#8221; button.'=>'Сиз &laquo;Медиафайлды кошуу&raquo; баскычын басуу менен медиафайлдарды (сүрөттөр, аудио файлдар, документтер ж.б.) жүктөп жана кыстарсаңыз болот. Сиз медиаканаңызга мурда жүктөлгөн сүрөттөрдү жана файлдарды тандай аласыз, же жаңы файлдарды жүктөп, аларды жазууга же баракка кошо аласыз. Галерея түзүү үчүн, сүрөттөрдү тандап, &laquo;Жаңы галерея түзүү&raquo; баскычын басыңыз.','Image rotation is not supported by your web host.'=>'Сүрөттү айлантуу сервериңизде колдоого алынбайт.','If you are looking to use the link manager, please install the <a href="%s">Link Manager plugin</a>.'=>'Эгер сиз шилтемени башкаруу барагын издеп жатсаңыз, <a href="%s">Шилтеме башкаргыч</a> плагинин орнотуңуз.','When changing themes, there is often some variation in the number and setup of widget areas/sidebars and sometimes these conflicts make the transition a bit less smooth. If you changed themes and seem to be missing widgets, scroll down on this screen to the Inactive Widgets area, where all of your widgets and their settings will have been saved.'=>'Темаларды өзгөртүү көбүнчө виджет аймактарынын жөндөөлөрүн жана санын өзгөртөт. Кээде бул келишпестиктер жаңы темага өтүүнү анчалык жылмакай кылбайт. Эгер сиз теманы өзгөрткөн болсоңуз жана виджеттериңиз жок болсо, бул экранды &laquo;Активдүү эмес виджеттер&raquo; панелине ылдый жылдырыңыз, анда сакталган жөндөөлөр менен бардык виджеттериңизди таба аласыз.','<strong>Parent</strong> &mdash; Categories, unlike tags, can have a hierarchy. You might have a Jazz category, and under that have child categories for Bebop and Big Band. Totally optional. To create a subcategory, just choose another category from the Parent dropdown.'=>'<strong>Энелик</strong> &#8212; Тегдерден айырмаланып, категориялар иерархиялык болушу мүмкүн. Мисалы, сиз &laquo;Джаз&raquo; бөлүмүн түзө аласыз, анда &laquo;Бибоп&raquo; жана &laquo;Биг-бэнд&raquo; бөлүмчөлөрү бар. Толугу менен ыктыярдуу. Субкатегория түзүү үчүн жөн гана &laquo;Энелик&raquo; тизмесинен башка категорияны тандаңыз.','Several boxes on this screen contain settings for how your content will be published, including:'=>'Бул экрандын бир нече блоктору жарыялоо жөндөөлөрүн камтыйт. Алардын арасында:','Inserting Media'=>'Медиафайлдарды кыстаруу','The title field and the big Post Editing Area are fixed in place, but you can reposition all the other boxes using drag and drop. You can also minimize or expand them by clicking the title bar of each box. Use the Screen Options tab to unhide more boxes (Excerpt, Send Trackbacks, Custom Fields, Discussion, Slug, Author) or to choose a 1- or 2-column layout for this screen.'=>'Аталыш жана жазуу редакторунун жайгашкан жери бекитилген, бирок сиз башка блокторду сүйрөп жылдырсаңыз болот. Блок аталышын басып, аларды жыйнап же ачууга болот. &laquo;Экран жөндөөлөрү&raquo; өтмөгүнөн кошумча блокторду (&laquo;Үзүндү&raquo;, &laquo;Артка шилтеме жөнөтүү&raquo;, &laquo;Кошумча талаа&raquo;, &laquo;Талкуу&raquo;, "&laquo;Жарлык&raquo;", &laquo;Автор&raquo;) жана ошондой эле экранды 1 же 2 тилке кылып белгилөөнү тандап алууга болот.','Do not forget to click &#8220;Save Changes&#8221; when you are done!'=>'Бүткөндөн кийин &laquo;Өзгөртүүлөрдү сактоону&raquo; басууну унутпаңыз!','To use a background image, simply upload it or choose an image that has already been uploaded to your Media Library by clicking the &#8220;Choose Image&#8221; button. You can display a single instance of your image, or tile it to fill the screen. You can have your background fixed in place, so your site content moves on top of it, or you can have it scroll with your site.'=>'Фондук сүрөттү колдонуу үчүн, аны жүктөңүз же &laquo;Сүрөттү тандоо&raquo; баскычын басып, файлдар медиатекасынан мурда жүктөлгөн сүрөттү тандаңыз. Сиз сүрөттү бир нускада көрсөтсөңүз болот же  экранга бөлсөңүз болот. Фонду сайттын мазмуну анын үстүндө калкып тургудай кылып оңдоп койсоңуз болот же аны сайт менен кошо жылдырсаңыз болот.','You are using the multi-file uploader. Problems? Try the <a href="%1$s" %2$s>browser uploader</a> instead.'=>'Сиз көп файл жүктөгүчтү колдонуп жатасыз. Көйгөйлөр барбы? <a href="%1$s" %2$s>браузер жүктөгүчтү</a> колдонуп көрүңүз.','media itemEdit'=>'Оңдоо','colorDefault: %s'=>'Демейки боюнча: %s','column nameUploaded to'=>'Жүктөлгөн','The uploaded file is not a valid image. Please try again.'=>'Жүктөлгөн файл сүрөт эмес. Сураныч, кайра аракет кылыңыз.','Choose a Custom Header'=>'Кошумча аталышты тандаңыз','Choose a Background Image'=>'Фондук сүрөттү тандаңыз','In the Header Text section of this page, you can choose whether to display this text or hide it. You can also choose a color for the text by clicking the Select Color button and either typing in a legitimate HTML hex value, e.g. &#8220;#ff0000&#8221; for red, or by choosing a color using the color picker.'=>'Бул барактын &laquo;Аталыштын тексти&raquo; бөлүмүндө текстти көрсөтүүнү же жашырууну тандай аласыз. Сиз ошондой эле тексттин түсүн &laquo;Түстү тандоо&raquo; баскычын басып, HTML\'де кабыл алынган жарактуу HEX-кодду киргизүү менен (мисалы, &laquo;#ff0000&raquo; &#8212; кызыл) же пайда болгон куралдын жардамы менен түстү тандоо менен көрсөтсөңүз болот.','You can also choose a background color by clicking the Select Color button and either typing in a legitimate HTML hex value, e.g. &#8220;#ff0000&#8221; for red, or by choosing a color using the color picker.'=>'Сиз ошондой эле &laquo;Түстү тандоо&raquo; баскычын басып жана HTML\'де кабыл алынган жарактуу HEX-кодун киргизүү менен (мисалы, &laquo;#ff0000&raquo; &#8212; кызыл) же пайда болгон куралды колдонуп түстү тандоо менен фондун түсүн тандай аласыз.','In the <strong>In response to</strong> column, there are three elements. The text is the name of the post that inspired the comment, and links to the post editor for that entry. The View Post link leads to that post on your live site. The small bubble with the number in it shows the number of approved comments that post has received. If there are pending comments, a red notification circle with the number of pending comments is displayed. Clicking the notification circle will filter the comments screen to show only pending comments on that post.'=>'<strong>&laquo;Жооп катары&raquo;</strong> тилкеси үч элементти камтыйт. Текст &#8212; бул комментарий жазылган жазуунун аталышы жана бул жазууну түзөтүү үчүн шилтеме. &laquo;Жазманы көрүү&raquo; шилтемеси сайттын тышкы бөлүгүндө бул жазууга алып барат. Аз сандагы булут бул жазуу канча кабыл алынганын көрсөтөт. Эгерде текшерүүнү күтүп жаткан комментарийлер болсо, алардын номери менен кызыл тегерекче көрсөтүлөт. Аны басуу менен сиз бул жазуу боюнча текшерилбеген комментарийлерди гана көрө аласыз.','ID #%1$s: %2$s'=>'ID #%1$s: %2$s','ID #%1$s: %2$s <strong>The current user will not be deleted.</strong>'=>'ID #%1$s: %2$s <strong>Учурдагы колдонуучу өчүрүлбөйт.</strong>','Used: %1$s%% of %2$s'=>'Бош эмес: %2$s ичинен %1$s%%','Please select an option.'=>'Сураныч, вариантты тандаңыз.','After you&#8217;ve done that, click &#8220;Run the installation&#8221;.'=>'Муну аткаргандан кийин, &#8220;Орнотууну баштоо.&#8221; баскычын басыңыз.','If you want to install a plugin that you&#8217;ve downloaded elsewhere, click the Upload Plugin button above the plugins list. You will be prompted to upload the .zip package, and once uploaded, you can activate the new plugin.'=>'Эгер сиз башка жерден жүктөлүп алынган плагинди орноткуңуз келсе, плагиндердин тизмесинин жогору жагындагы &laquo;Плагинди жүктөө&raquo; баскычын басыңыз. Сизден .zip архивин жүктөө сунушталат, андан кийин жаңы плагинди активдештире аласыз.','You can also browse a user&#8217;s favorite plugins, by using the Favorites link above the plugins list and entering their WordPress.org username.'=>'Сиз ошондой эле плагиндер тизмесинин үстүндөгү &laquo;Сүйүктүү&raquo; шилтемесин басып, WordPress.org колдонуучу атын киргизүү менен колдонуучунун сүйүктүү плагиндеринин тизмесин көрө аласыз.','If you know what you are looking for, Search is your best bet. The Search screen has options to search the WordPress Plugin Directory for a particular Term, Author, or Tag. You can also search the directory by selecting popular tags. Tags in larger type mean more plugins have been labeled with that tag.'=>'Эгер сиз эмне издеп жатканыңызды билсеңиз, издөөнү колдонушуңуз керек. &laquo;Издөө&raquo; экранында сиз WordPress каталогунан плагиндерди белгилүү бир ачкыч сөз, автор же тег боюнча издей аласыз. Сиз ошондой эле таанымал тегдерди тандоо менен каталогду издей аласыз. Чоңураак тег ариби бул тег көбүрөөк плагиндерге ыйгарылганын билдирет.','It is up to search engines to honor this request.'=>'Бул сурам &mdash; эске алынабы издөө тутумдарына көз каранды.','Discourage search engines from indexing this site'=>'Издөө тутумдарынан сайтты индекстебөөсүн сураныңыз','Allow search engines to index this site'=>'Издөө тутумдарына сайтыңызды индекстөөнү уруксат бериңиз','Search engine visibility'=>'Издөө тутумдары үчүн көрүнүү','Welcome to WordPress %1$s. You will be redirected to the About WordPress screen. If not, click <a href="%2$s">here</a>.'=>'%1$s WordPress\'ке кош келиңиз. Сиз азыр &laquo;WordPress жөнүндө&raquo; экранына багытталасыз. Эгерде ал аткарылбаса, <a href="%2$s">бул жерди</a> басыңыз.','Get Favorites'=>'Тизмени алуу','Your WordPress.org username:'=>'Сиздин WordPress.org колдонуучу атыңыз:','If you have marked plugins as favorites on WordPress.org, you can browse them here.'=>'Эгерде сизде WordPress.org сайтында сүйүктүү плагиндер болсо, аларды бул жерден көрө аласыз.','Welcome to WordPress!'=>'WordPress\'ке кош келиңиз!','Search engines discouraged'=>'Издөө тутумдары бөгөттөлдү','This <a href="%1$s">child theme</a> requires its parent theme, %2$s.'=>'Бул <a href="%1$s">кичи тема</a> үчүн энелик темасы талап кылат, &#8212; %2$s.','Plugin InstallerFavorites'=>'Сүйүктүү','To install the theme so you can preview it with your site&#8217;s content and customize its theme options, click the "Install" button at the top of the left-hand pane. The theme files will be downloaded to your website automatically. When this is complete, the theme is now available for activation, which you can do by clicking the "Activate" link, or by navigating to your Manage Themes screen and clicking the "Live Preview" link under any installed theme&#8217;s thumbnail image.'=>'Теманы орнотуу жана аны сайтыңыздын мазмуну жана жөндөөлөрүңүз менен көрүү үчүн, сол панелдин жогору жагындагы &laquo;Орнотуу&raquo; баскычын басыңыз. Тема автоматтык түрдө сиздин сайтка жүктөлөт. Жүктөлгөндөн кийин, тема активдештирүү үчүн жеткиликтүү болот. Сиз &laquo;Активдештирүү&raquo; шилтемесин басып же &laquo;Темаларды башкаруу&raquo; экранына өтүп, орнотулган темаларыңыздын биринин миниатюрасынын астындагы &laquo;Көрүү&raquo; шилтемесин бассаңыз болот.','widgetAdd'=>'Кошуу','widgetEdit'=>'Оңдоо','Search by tag'=>'Тег боюнча издөө','Search by author'=>'Автор боюнча издөө','Search by keyword'=>'Ачкыч сөз боюнча издөө','Type of search'=>'Издөөнүн түрү','Screen Options Tab'=>'«Экран жөндөөлөрү» өтмөгү','Contextual Help Tab'=>'Контексттик жардам өтмөгү','Select %s'=>'%s тандоо','Select comment'=>'Комментарийди тандоо','Tags can be selectively converted to categories using the <a href="%s">tag to category converter</a>.'=>'Категорияларды тандап <a href="%s">категорияларды тегке которгучтун</a> жардамы менен тегдерге айландырса болот.','You can delete Link Categories in the Bulk Action pull-down, but that action does not delete the links within the category. Instead, it moves them to the default Link Category.'=>'Шилтемелер категориясын &laquo;Аракеттер&raquo; ачылып түшүүчү менюсунун жардамы менен өчүрө аласыз, бирок бул андагы шилтемелерди өчүрбөйт. Алар демейки категорияга жылдырылат.','Creating a Page is very similar to creating a Post, and the screens can be customized in the same way using drag and drop, the Screen Options tab, and expanding/collapsing boxes as you choose. This screen also has the distraction-free writing space, available in both the Visual and Text modes via the Fullscreen buttons. The Page editor mostly works the same as the Post editor, but there are some Page-specific features in the Page Attributes box.'=>'Баракты түзүү жазууларды түзүүгө абдан окшош &#8212; экранды сүйрөп жылдыруу, &laquo;Экран жөндөөлөрү&raquo; өтмөгү жана блокторду жыйыштыруу/ачуу аркылуу дал ушундай жол менен жөндөөгө болот. Бул экранда визуалдык жана тексттик редактордо атайын баскыч аркылуу жеткиликтүү болгон ыңгайлуу толук экран режими бар. Барак редактору жазуу редактору сыяктуу иштейт, бирок &laquo;Барак атрибуттары&raquo; блокторунда барактарга гана тиешелүү бир нече элементтер бар.','You can select an image to be shown at the top of your site by uploading from your computer or choosing from your media library. After selecting an image you will be able to crop it.'=>'Сүрөттү компьютериңизден жүктөп же файлдар медиатекасынан тандап, сайтыңыздын жогору жагында көрсөтүлө турган сүрөттү көрсөтсөңүз болот. Сүрөттү тандап алгандан кийин, аны кесүүгө болот.','Skip to main content'=>'Негизги мазмунга өтүү','You can set a custom image header for your site. Simply upload the image and crop it, and the new header will go live immediately. Alternatively, you can use an image that has already been uploaded to your Media Library by clicking the &#8220;Choose Image&#8221; button.'=>'Сиз сайттын аталышында каалаган сүрөттү колдоно аласыз. Жөн гана жүктөп жана сүрөттү кесип, ал ошол замат сайтта болот. Сиз ошондой эле &laquo;Сүрөт тандоо&raquo; баскычын басуу менен файл медиатекасынан мурда жүктөлгөн сүрөттү тандай аласыз.','Skip Cropping, Publish Image as Is'=>'Кыркып салбаңыз, кандай болсо ошондой жарыялаңыз','Choose Image'=>'Сүрөттү тандаңыз','Or choose an image from your media library:'=>'Же файл китепканасынан сүрөт тандаңыз:','Select Image'=>'Сүрөттү тандаңыз','Collapse'=>'Жыйыштыруу','If you do not want a header image to be displayed on your site at all, click the &#8220;Remove Header Image&#8221; button at the bottom of the Header Image section of this page. If you want to re-enable the header image later, you just have to select one of the other image options and click &#8220;Save Changes&#8221;.'=>'Эгер сиз сайтка аталыш катары эч кандай сүрөт чыгаргыңыз келбесе, анда &laquo;Аталыш сүрөтү&raquo; бөлүмүнүн астындагы &laquo;Аталыш сүрөтүн өчүрүү&raquo; баскычын басыңыз. Эгер кийинчерээк аны кайтаргыңыз келсе, берилген варианттардын бирин тандап, &laquo;Өзгөртүүлөрдү сактоо&raquo; баскычын басыңыз.','This theme is already installed and is up to date'=>'Бул тема эчак эле орнотулган жана жаңыртылышын талап кылбайт','pluginInstalled'=>'Орнотулду','Previewing and Customizing'=>'Көрүү жана Жөндөө','Previewing and Installing'=>'Көрүү жана Орнотуу','Once you have generated a list of themes, you can preview and install any of them. Click on the thumbnail of the theme you are interested in previewing. It will open up in a full-screen Preview page to give you a better idea of how that theme will look.'=>'Темалардын тизмесин алгандан кийин, алардын каалаганын көрүүгө жана орнотууга болот. Көргүңүз келген теманын миниатюрасын басыңыз. Толук экрандагы көрүү терезеси ачылат, андыктан сиз тема тууралуу жакшыраак түшүнүк ала аласыз.','You are using the browser&#8217;s built-in file uploader. The WordPress uploader includes multiple file selection and drag and drop capability. <a href="#">Switch to the multi-file uploader</a>.'=>'Сиз браузер жүктөгүчтү колдонуп жатасыз. WordPress жүктөөчүсү бир эле учурда бир нече файлды тандоого, ошондой эле аларды сүйрөп жылдыруу аркылуу жүктөөгө мүмкүндүк берет. <a href="#">Көп файл жүктөөчүгө которулуңуз</a>.','Preview %s'=>'%s көрүү','The Categories and Tags Converter link on this screen will take you to the Import screen, where that Converter is one of the plugins you can install. Once that plugin is installed, the Activate Plugin &amp; Run Importer link will take you to a screen where you can choose to convert tags into categories or vice versa.'=>'Бул экранда &laquo;Категория жана тег конвертери&raquo; шилтемеси &laquo;Импорттоо&raquo; экранына алып барат, ал жерде бул конвертер плагиндердин бири катары жүктөлүп алынат. Аны орноткондон кийин, &laquo;Плагинди активдештирүү жана импортту иштетүү&raquo; шилтемеси сизди тегдерди категорияларга же тескерисинче айландыра турган баракчага алып барат.','Categories have hierarchy, meaning that you can nest sub-categories. Tags do not have hierarchy and cannot be nested. Sometimes people start out using one on their posts, then later realize that the other would work better for their content.'=>'Категориялардын иерархиясы бар, б.а. демек сиз субкатегорияларды түзө аласыз. Тегдердин иерархиясы жок. Кээде сайт ээлери бир вариантты колдоно башташат, бирок андан кийин алардын мазмуну үчүн экинчиси жакшыраак болорун түшүнүшөт.','For most themes, the header text is your Site Title and Tagline, as defined in the <a href="%s">General Settings</a> section.'=>'Көпчүлүк темалар <a href="%s">"Жалпы жөндөөлөр"</a> бөлүмүндө белгиленгендей, алардын аталышынын тексти катары сайттын аталышын жана кыскача сүрөттөмөсүн көрсөтөт.','If your theme has more than one default header image, or you have uploaded more than one custom header image, you have the option of having WordPress display a randomly different image on each page of your site. Click the &#8220;Random&#8221; radio button next to the Uploaded Images or Default Images section to enable this feature.'=>'Эгерде сиздин темаңызда бирден ашык демейки аталыш сүрөтү болсо, же сиз өзүңүз бирден ашык аталыш сүрөтүн жүктөгөн болсоңуз, анда сайттын ар бир бетинде туш келди сүрөттү көрсөтүү үчүн WordPress\'ти жөндөсөңүз болот. &laquo;Жүктөлгөн сүрөттөр&raquo; же &laquo;Демейки сүрөттөр&raquo; астындагы &laquo;Туш келди&raquo; вариантын тандаңыз.','Some themes come with additional header images bundled. If you see multiple images displayed, select the one you would like and click the &#8220;Save Changes&#8221; button.'=>'Айрым темалар кошумча аталыш сүрөттөрүн камтыйт. Эгер сиз бир нече сүрөттү көрсөңүз &#8212; жаккан сүрөттү тандап, &laquo;Өзгөртүүлөрдү сактоо&raquo; баскычын басыңыз.','You can choose from the theme&#8217;s default header images, or use one of your own. You can also customize how your Site Title and Tagline are displayed.'=>'Сиз демейки сүрөттөрдүн бирин тандап же өзүңүздүкүн жүктөй аласыз. Ошондой эле сайттын аталышын жана кыскача сүрөттөмөсүн көрсөтүүгө болот.','This screen is used to customize the header section of your theme.'=>'Бул экран темаңыздын аталышын жөндөө үчүн колдонулат.','Configuration Error'=>'Конфигурация катасы','Revert to the <strong>Browser Uploader</strong> by clicking the link below the drag and drop box.'=>'Сүйрөп жылдыруу аймагынын астындагы шилтемени басып, <strong>браузер жүктөгүчкө</strong> которула алсаңыз болот.','User deleted.'=>'Колдонуучу өчүрүлдү.','Could not copy files. You may have run out of disk space.'=>'Файлдарды көчүрүүгө болбоду. Кыязы, дискте орун калбай калгандыр.','Find a theme based on specific features.'=>'Белгилүү өзгөчөлүктөрү боюнча теманы табыңыз.','Search for themes by keyword.'=>'Темаларды ачкыч сөз менен издеңиз.','In all likelihood, these items were supplied to you by your web host. If you do not have this information, then you will need to contact them before you can continue. If you are ready&hellip;'=>'Бул маалыматты хостинг провайдериңиз берген болушу мүмкүн. Эгерде сизде бул маалымат жок болсо, алардын колдоо кызматына кайрылыңыз. А эгер бар болсо, анда уланта берсеңиз болот&hellip;','This theme is broken.'=>'Бул тема бузулган.','Set as header'=>'Аталышы катары коюу','Set as background'=>'Фон кылып коюу','Customize &#8220;%s&#8221;'=>'Жөндөө &laquo;%s&raquo;','(required)'=>'(сөзсүз)','Edit Link'=>'Шилтемени түзөтүү','<strong>Error:</strong> This email is already registered. Please choose another one.'=>'<strong>Ката:</strong> Бул емайл эчак эле катталган. Сураныч, башкасын киргизиңиз.','<strong>Error:</strong> Please enter a nickname.'=>'<strong>Ката:</strong>Сураныч, лакап атын киргизиңиз.','https://wordpress.org/about/'=>'https://kir.wordpress.org/about/','Select All'=>'Баарын тандоо','Public, Sticky'=>'Ачык, Жабышкан','Privately Published'=>'Өздүк жарыяланды','Save as Pending'=>'Кабыл алуу үчүн сактаңыз','Enter a link URL or click above for presets.'=>'Шилтемени киргизиңиз же баскычтардын бирин басыңыз.','Link URL'=>'Шилтеме','No comments yet.'=>'Комментарийлер жок.','Version:'=>'Нуска:','Collapse Sidebar'=>'Панелди жыйыштыруу','Plugin'=>'Плагин','All'=>'Баары','Word count: %s'=>'Сөздөрдүн саны: %s','Edit comment'=>'Комментарийди түзөтүү','Preview:'=>'Көрүү:','E-mail'=>'E-mail','<strong>The parent theme could not be found.</strong> You will need to install the parent theme, %s, before you can use this child theme.'=>'<strong>Энелик тема табылган жок.</strong> Бул кичи теманы колдонуу үчүн, адегенде %s негизги темасын орнотушуңуз керек.','Successfully installed the parent theme, <strong>%1$s %2$s</strong>.'=>'Энелик тема, <strong>%1$s %2$s</strong> ийгиликтүү орнотулду.','The parent theme, <strong>%1$s %2$s</strong>, is currently installed.'=>'Энелик тема, <strong>%1$s %2$s</strong> эчак эле орнотулган.','Preparing to install <strong>%1$s %2$s</strong>&#8230;'=>'<strong>%1$s %2$s</strong> орнотууга даярдалууда&#8230;','This theme requires a parent theme. Checking if it is installed&#8230;'=>'Бул тема энелик темасын талап кылат. Анын орнотулгандыгын текшериңиз&#8230;','Show header text with your image.'=>'Сүрөт менен бирге аталыштын текстин көрсөтүү.','Header Text'=>'Аталыш тексти','There is a new version of %1$s available. <a href="%2$s" %3$s>View version %4$s details</a> or <a href="%5$s" %6$s>update now</a>.'=>'%1$s жаңы нускасы жеткиликтүү. Сиз <a href="%2$s" %3$s>%4$s нуска маалыматын көрө аласыз</a> же <a href="%5$s" %6$s>азыр жаңырта аласыз</a> .','By %s.'=>'Автор: %s.','Add Comment'=>'Комментарий кошуу','Add New Comment'=>'Комментарий кошуу','http://ma.tt/'=>'http://ma.tt/','This is not just a plugin, it symbolizes the hope and enthusiasm of an entire generation summed up in two words sung most famously by Louis Armstrong: Hello, Dolly. When activated you will randomly see a lyric from <cite>Hello, Dolly</cite> in the upper right of your admin screen on every page.'=>'Бул жөн эле плагин эмес, ал Луи Армстронгдун эң белгилүү аткарган ырындагы эки сөз менен туюнтулган бүтүндөй бир муундун үмүтүн жана шыктануусун билдирет: &laquo;Hello, Dolly&raquo;. Плагинди активдештиргенден кийин, башкаруу панелинин ар бир барагы жогорку оң бурчта <cite>Hello, Dolly</cite> ырынан туш келди сапты көрсөтөт.','Hello Dolly'=>'Hello Dolly','<strong>Welcome</strong> &mdash; Shows links for some of the most common tasks when setting up a new site.'=>'<strong>Кош келиңиз</strong> &#8212; жаңы сайтты түзүүдө эң көп аткарылуучу тапшырмаларга шилтемелерди көрсөтөт.','There is a new version of %1$s available. <a href="%2$s" %3$s>View version %4$s details</a>. <em>Automatic update is unavailable for this theme.</em>'=>'%1$s акыркы нускасы жеткиликтүү. <a href="%2$s" %3$s>%4$s нускасынын маалыматын көрүңүз</a>. <em>Бул теманы автоматтык түрдө жаңыртуу мүмкүн эмес.</em>','HowdyWelcome'=>'Кош келиңиз','Delete My Site Permanently'=>'Менин сайтымды түбөлүккө өчүрүү','I\'m sure I want to permanently delete my site, and I am aware I can never get it back or use %s again.'=>'Мен өзүмдүн сайтымды биротоло өчүргүм келет жана мен аны эч качан кайтара албайм же %s колдоно албасымды түшүнөм.','Remember, once deleted your site cannot be restored.'=>'Өчүрүлгөндөн кийин сайтты калыбына келтирүү мүмкүн эмес экенин эске алыңыз.','If you do not want to use your %s site any more, you can delete it using the form below. When you click <strong>Delete My Site Permanently</strong> you will be sent an email with a link in it. Click on this link to delete your site.'=>'Эгер сиз %s сайтыңызды колдонгуңуз келбесе, аны ушул форманы колдонуп өчүрсөңүз болот. Сиз <strong>Сайтты биротоло өчүрүү</strong> дегенди басканда, биз сизге шилтемеси бар емайл кат жөнөтөбүз. Сайтты өчүрүү үчүн аны аткарыңыз.','Thank you. Please check your email for a link to confirm your action. Your site will not be deleted until this link is clicked.'=>'Рахмат. Сураныч, аракетиңизди ырастоо үчүн келген катыңыздан шилтемени текшериңиз. Бул шилтемени басмайынча сайт өчүрүлбөйт.','Sorry, the link you clicked is stale. Please select another option.'=>'Тилекке каршы, сиз жазылган шилтеме эскирип калган. Сураныч, башка параметрди тандаңыз.','Thank you for using %s, your site has been deleted. Happy trails to you until we meet again.'=>'&laquo;%s&raquo; тармагындагы ишиңиз үчүн рахмат, сайтыңыз өчүрүлдү. Биз дагы кайрадан жолукканга чейин сизге ак жол!','Primary Site'=>'Негизги сайт','British English'=>'Британ англис тили','American English'=>'Америка англис тили','View Site'=>'Сайтты көрүү','Visit Dashboard'=>'Консолго өтүү','Your Sites'=>'Сиздин сайттар','If you reached this screen by accident and meant to visit one of your own sites, here are some shortcuts to help you find your way.'=>'Эгер сиз жаңылыштык менен бул экранга түшүп калсаңыз жана өзүңүздүн сайттарыңыздын бирин ачкыңыз келсе, анда төмөнкү шилтемелерди колдонсоңуз болот.','You attempted to access the "%1$s" dashboard, but you do not currently have privileges on this site. If you believe you should be able to access the "%1$s" dashboard, please contact your network administrator.'=>'Сиз &laquo;%1$s&raquo; сайтынын консолуна кирүүгө аракет кылдыңыз, бирок учурда ага кирүү мүмкүнчүлүгүңүз жок. Эгер сиз &laquo;%1$s&raquo; сайтына кирүү мүмкүнчүлүгүңүз болушу керек деп ойлосоңуз, тармак администраторуңуз менен байланышыңыз.','MB (Leave blank for network default)'=>'МБ (демейки үчүн бош калтырыңыз)','[%s] New Admin Email Address'=>'[%s] Жаңы Админ емайл дареги','Disabled'=>'Өчүрүлгөн','Paused <span class="count">(%s)</span>'=>'Токтотулган <span class="count">(%s)</span>','Global Settings'=>'Жалпы Жөндөөлөр','You must be a member of at least one site to use this page.'=>'Бул баракты колдонуу үчүн сиз жок дегенде бир сайттын мүчөсү болушуңуз керек.','The primary site you chose does not exist.'=>'Негизги сайт катары тандалган сайт жок.','If you want to run multiple WordPress installations in a single database, change this.'=>'Эгер сиз бир эле маалымат базасында бир нече WordPress нускасынларын иштеткиңиз келсе, бул маанини өзгөртүңүз.','Table Prefix'=>'Таблицалардын префикси','Database Host'=>'Маалымат базасынын сервери','example passwordpassword'=>'password','example usernameusername'=>'username','Database Name'=>'Маалымат базасынын аты','Below you should enter your database connection details. If you are not sure about these, contact your host.'=>'Бул жерге маалымат базасына туташуу маалыматын киргизиңиз. Эгер сиз бул жөнүндө так билбесеңиз, хостингиңиздин колдоосуна кайрылыңыз.','Let&#8217;s go!'=>'Алга!','Table prefix (if you want to run more than one WordPress in a single database)'=>'Таблица префикси (эгерде сиз бир эле маалымат базасында бирден ашык WordPress\'ти иштеткиңиз келсе)','Database host'=>'Маалымат базасынын сервер дареги','Database password'=>'Маалымат базасынын сырсөзү','Database username'=>'Маалымат базасынын колдонуучу аты','Database name'=>'Маалымат базасынын аты','WordPress &rsaquo; Setup Configuration File'=>'WordPress &rsaquo; Конфигурация файлын орнотуу','The file %1$s already exists one level above your WordPress installation. If you need to reset any of the configuration items in this file, please delete it first. You may try <a href="%2$s">installing now</a>.'=>'%1$s файлы эчак эле WordPress каталогунан бир деңгээлде жогору турат. Эгер андагы жөндөөлөрдүн бирин баштапкы абалга келтирүү керек болсо, адегенде аны өчүрүңүз. Эми сиз <a href="%2$s">орнотууну иштетсеңиз</a> болот.','The file %1$s already exists. If you need to reset any of the configuration items in this file, please delete it first. You may try <a href="%2$s">installing now</a>.'=>'%1$s файлы эчак эле бар. Эгер андагы жөндөөлөрдүн бирин баштапкы абалга келтирүү керек болсо, адегенде аны өчүрүңүз. Эми сиз <a href="%2$s">орнотуп иштете аласыз</a>.','Sorry, I need a %s file to work from. Please re-upload this file to your WordPress installation.'=>'Кечиресиз, мага %s файл булак катары керек. Сураныч, аны бөлүштүрүүдөн кайра жүктөп алыңыз.','To allow use of this page to automatically repair database problems, please add the following line to your %s file. Once this line is added to your config, reload this page.'=>'Маалымат базасын автоматтык түрдө оңдоо үчүн бул баракты колдонууга уруксат берүү үчүн, %s файлыңызга төмөнкү сапты кошуңуз. Кошкондон кийин баракты кайра жүктөңүз.','No comments awaiting moderation.'=>'Текшерүүнү күтүүдөгү комментарийлер жок.','Plugin installer section titleOther Notes'=>'Эсбелгилер','Plugin installer section titleChangelog'=>'Өзгөртүүлөр','Plugin installer section titleScreenshots'=>'Скриншоттор','Plugin installer section titleFAQ'=>'FAQ.KG','Plugin installer section titleInstallation'=>'Орнотуу','Plugin installer section titleDescription'=>'Баяндама','Plugin Homepage &#187;'=>'Плагин барагы &#187;','You can export a file of your site&#8217;s content in order to import it into another installation or platform. The export file will be an XML file format called WXR. Posts, pages, comments, custom fields, categories, and tags can be included. You can choose for the WXR file to include only certain posts or pages by setting the dropdown filters to limit the export by category, author, date range by month, or publishing status.'=>'Вебсайтыңыздын мазмунун башка сайтка же платформага импорттоо үчүн файлга экспорттоого болот. Файл WXR деп аталган XML-файл болот. Ага жазууларды, баракчаларды, комментарийлерди, кошумча талааларды, категорияларды жана тегдерди кошууга болот. Категория, автор, күн диапазону жана жарыялоо абалын чектөө үчүн ачылуучу чыпкаларды колдонуп, белгилүү бир жазууларды же барактарды гана тандоого болот.','Failed to repair the %1$s table. Error: %2$s'=>'%1$s таблицасы калыбына келтирилген жок. Ката: %2$s','New users will receive an email letting them know they&#8217;ve been added as a user for your site. This email will also contain their password. Check the box if you do not want the user to receive a welcome email.'=>'Жаңы колдонуучулар бул сайтка кошулгандыгы жөнүндө емайл кат алышат. Бул емайл кат ошондой эле алардын сырсөзүн да камтыйт. Эгер колдонуучуга саламдашуу емайл катын жөнөткүңүз келбесе, кутучаны белгилеңиз.','There are unsaved changes that will be lost. \'OK\' to continue, \'Cancel\' to return to the Image Editor.'=>'Сакталбаган өзгөртүүлөр жоголот. \'OK\' - улантуу, \'Жокко чыгаруу\' - сүрөт редакторуна кайтуу.','Post via email settings allow you to send your WordPress installation an email with the content of your post. You must set up a secret email account with POP3 access to use this, and any mail received at this address will be posted, so it&#8217;s a good idea to keep this address very secret.'=>'Электрондук почта аркылуу жарыялоо сиздин сайтка жазуулардын тексттери менен кат жөнөтүүгө мүмкүнчүлүк берет. Бул үчүн, сиз POP3 кирүү мүмкүнчүлүгү бар жашыруун емайл почтаны түзүшүңүз керек. Бул дарекке жөнөтүлгөн бардык билдирүүлөр жарыяланып турат, андыктан бул даректи купуя сактаганыңыз жакшы.','You can filter the list of users by User Role using the text links above the users list to show All, Administrator, Editor, Author, Contributor, or Subscriber. The default view is to show all users. Unused User Roles are not listed.'=>'Бардык колдонуучуларды, администраторлорду, редакторлорду, авторлорду, салым кошуучуларды же жазылуучуларды көрүү үчүн тизменин үстүндөгү тексттик шилтемелерди колдонуп, колдонуучу тизмесин ролу боюнча чыпкалай аласыз. Демейки боюнча, бардык колдонуучулар көрсөтүлөт. Колдонулбаган ролдор тизмеге киргизилген эмес.','In previous versions of WordPress, all importers were built-in. They have been turned into plugins since most people only use them once or infrequently.'=>'WordPress\'тин мурунку нускаларында бардык импорттук скрипттер орнотулган. Азыр алар плагиндер катары иштелип чыккан, анткени көпчүлүк адамдар аларды бир гана жолу же сейрек колдонушат.','There is an autosave of this post that is more recent than the version below. <a href="%s">View the autosave</a>'=>'Автоматтык түрдө сакталган жаздыруунун жаңыраак көчүрмөсү табылды. <a href="%s">Көчүрмөсүн көрүү</a>','Image could not be processed. Please go back and try again.'=>'Сүрөт оңдоо ишке ашкан жок. Сураныч, дагы бир жолу аракет кылыңыз.','The active theme is broken. Reverting to the default theme.'=>'Учурдагы тема бузулган. Демейки тема калыбына келтирилди.','WordPress can also attempt to optimize the database. This improves performance in some situations. Repairing and optimizing the database can take a long time and the database will be locked while optimizing.'=>'WordPress маалымат базасын оптималдаштырууга да аракет кылышы мүмкүн. Кээ бир учурларда, бул иштин натыйжалуулугун жогорулатууга жардам берет. Маалыматтар базасын оңдоо жана оптималдаштыруу көп убакытты талап кылышы мүмкүн, оптималдаштыруу процессинин жүрүшүндө маалымат базасы бөгөттөлөт.','WordPress can automatically look for some common database problems and repair them. Repairing can take a while, so please be patient.'=>'WordPress автоматтык түрдө жалпы маалымат базасынын каталарын таап, аларды оңдой алат. Оңдоо үчүн бир аз убакыт талап кылынышы мүмкүн &#8212; сураныч сабырдуу болуңуз.','Repairs complete. Please remove the following line from wp-config.php to prevent this page from being used by unauthorized users.'=>'Оңдоо аяктады. Уруксатсыз колдонуучулардын бул баракка кирүүсүн алдын алуу үчүн wp-config.php сайтынан төмөнкү сапты алып салыңыз.','The %1$s table is not okay. It is reporting the following error: %2$s. WordPress will attempt to repair this table&hellip;'=>'%1$s таблицасы бузулган. Төмөнкү ката кабарланды: %2$s. WordPress бул таблицаны оңдоого аракет кылат&hellip;','Enter the email address or username of an existing user on this network to invite them to this site. That person will be sent an email asking them to confirm the invite.'=>'Аларды сайтка чакыруу үчүн емайл дарегин же учурдагы тармак колдонуучусунун атын киргизиңиз. Чакырууну ырастоо үчүн ага емайл кат жөнөтүлөт.','Enter the email address of an existing user on this network to invite them to this site. That person will be sent an email asking them to confirm the invite.'=>'Учурдагы тармак колдонуучусун сайтка чакыруу үчүн анын емайл дарегин киргизиңиз. Чакырууну ырастоо үчүн ага емайл кат жөнөтүлөт.','Show Toolbar when viewing site'=>'Сайтты көрүп жатканда үстүнкү панелди көрсөтүү','For more information, see <a href="%s">the release notes</a>.'=>'Кошумча маалымат алуу үчүн <a href="%s">чыгарылыш эскертүүсүнөн</a>  тапса болот.','<strong>Version %1$s</strong> addressed some security issues and fixed %2$s bug.'=>'<strong>%1$s</strong> нускасында бир нече коопсуздук көйгөйлөрү чечилип, %2$s катасы оңдолду.','<strong>Version %1$s</strong> addressed a security issue and fixed %2$s bug.'=>'<strong>%1$s</strong> нускасында коопсуздук көйгөйү чечилип, %2$s катасы оңдолду.','<strong>Version %1$s</strong> addressed %2$s bug.'=>'<strong>%1$s</strong> нускаларында %2$s катасы оңдолду.','<strong>Version %s</strong> addressed some security issues.'=>'<strong>%s нускасында</strong> бир нече коопсуздук көйгөйлөрү чечилди.','Maintenance and Security Release'=>'Техникалык коопсуздукту жаңыртуу','Security Release'=>'Коопсуздукту жаңылоо','Maintenance Release'=>'Техникалык жаңыртуу','What&#8217;s New'=>'Эмне жаңылык бар','This screen allows you to choose your permalink structure. You can choose from common settings or create custom URL structures.'=>'Бул экранда сиз туруктуу шилтеме түзүмүн тандай аласыз. Сиз сунуш кылынган варианттардын бирин тандап же кошумча URL түзүмүн түзө аласыз.','Welcome to WordPress %1$s. <a href="%2$s">Learn more</a>.'=>'WordPress %1$s\'ка кош келиңиз. <a href="%2$s">Кененирээк маалымат</a>.','You can upload media files here without creating a post first. This allows you to upload files to use with posts and pages later and/or to get a web link for a particular file that you can share. There are three options for uploading files:'=>'Бул жерде сиз файлдарды жазууну түзбөстөн жүктөй аласыз. Бул файлдарды кийинчерээк жазууларда жана баракчаларда колдонуу үчүн жүктөөгө жана/же бөлүшүү үчүн жеке файлга шилтеме алууга мүмкүндүк берет. Файлдарды жүктөөнүн үч жолу бар:','Adding Tags'=>'Тегдерди кошуу','Adding Categories'=>'Категорияларды кошуу','Troubleshooting'=>'Көйгөйлөрдү чечүү','How to Update'=>'Кантип жаңылоо','Once you&#8217;ve saved the download file, you can use the Import function in another WordPress installation to import the content from this site.'=>'Файлды сактагандан кийин, ошол сайттан мазмунду импорттоо үчүн башка WordPress сайтындагы импорттоо функциясын колдонсоңуз болот.','Attaching Files'=>'Файлдарды тиркөө','You can also edit or move multiple posts to the Trash at once. Select the posts you want to act on using the checkboxes, then select the action you want to take from the Bulk actions menu and click Apply.'=>'Ошондой эле бир нече жазууларды өзгөртүп же себетке жылдыра аласыз. Жазууларды белгилөө менен тандап, андан кийин &laquo;Аракеттер&raquo; менюсунан керектүү аракетти тандап, &laquo;Колдонуу&raquo; баскычын басыңыз.','Available Actions'=>'Жеткиликтүү аракеттер','You can customize the display of this screen&#8217;s contents in a number of ways:'=>'Бул экрандагы мазмундун көрүнүшүн бир нече жол менен жөндөй аласыз:','Screen Content'=>'Экран мазмуну','This screen provides access to all of your posts. You can customize the display of this screen to suit your workflow.'=>'Сиздин бардык жазууларыңыз ушул экранда жеткиликтүү. Сиз бул экрандын көрсөтүлүшүн өзүңүздүн каалоолоруңузга жараша жөндөсөңүз болот.','If the importer you need is not listed, <a href="%s">search the plugin directory</a> to see if an importer is available.'=>'Эгерде сизге керек болгон скрипт тизмеде жок болсо, <a href="%s">аны плагиндер каталогунан издеңиз</a>.','Moderating Comments'=>'Комментарийлерди модерациялоо','If you want to convert your categories to tags (or vice versa), use the <a href="%s">Categories and Tags Converter</a> available from the Import screen.'=>'Эгерде сиз категорияларды тегдерге (же тескерисинче) айландыргыңыз келсе, Импорттоо экранында <a href="%s">категорияларды жана тегдерди конвертер</a> колдонуңуз.','Adding Plugins'=>'Плагиндерди кошуу','Adding Themes'=>'Темаларды кошуу','Subscribers can read comments/comment/receive newsletters, etc. but cannot create regular site content.'=>'Жазылуучулар комментарийлерди окуй алат, комментарий бере алат, маалымат жазылууларын алат, ж.б., бирок сайттын мазмунун түзө албайт.','Authors can publish and manage their own posts, and are able to upload files.'=>'Авторлор өз жазууларын жарыялап, түзөтө алат, ошондой эле файлдарды жүктөй алат.','Here is a basic overview of the different user roles and the permissions associated with each one:'=>'Колдонуучунун ролдору жана алардын мүмкүнчүлүктөрүнүн кыскача сүрөттөмөсү:','User Roles'=>'Колдонуучулардын ролдору','Remember to click the Add New User button at the bottom of this screen when you are finished.'=>'Бүткөндөн кийин, &laquo;Жаңы колдонуучу кошуу&raquo; баскычын басууну унутпаңыз, экрандын ылдый жагында.','To add a new user to your site, fill in the form on this screen and click the Add New User button at the bottom.'=>'Сайтка колдонуучуну кошуу үчүн, бул экрандагы форманы толтуруп, &laquo;Жаңы колдонуучу кошуу&raquo; баскычын басыңыз.','Custom Structures'=>'Ыктыярдуу түзүмдөр','Common Settings'=>'Жалпы жөндөөлөр','Permalinks are the permanent URLs to your individual pages and blog posts, as well as your category and tag archives. A permalink is the web address used to link to your content. The URL to each post should be permanent, and never change &#8212; hence the name permalink.'=>'Туруктуу шилтемелер баракчаларыңызды жана жазууларыңызды, ошондой эле категория жана тег архивдериңизди көрсөтөт. Туруктуу шилтеме &#8212; бул сиздин мазмунуңузга шилтеме катары колдонулган веб дарек. Ар бир жазуунун дареги туруктуу болушу керек жана эч качан өзгөрбөшү керек, ошондуктан мындай шилтемелер туруктуу деп аталат.','You can submit content in several different ways; this screen holds the settings for all of them. The top section controls the editor within the dashboard, while the rest control external publishing methods. For more information on any of these methods, use the documentation links.'=>'Мазмунду ар кандай жолдор менен жөнөтсө болот; алардын бардыгы ушул экранда көрсөтүлгөн. Жогорку бөлүгү башкаруу панелиндеги редакторго тиешелүү, ал эми калган блоктордо тышкы жарыялоо ыкмаларын жөнгө салат. Бул ыкмалардын ар бири жөнүндө кошумча маалыматты оң жактагы шилтемелердеги документтерден алууга болот.','Uploading Files allows you to choose the folder and path for storing your uploaded files.'=>'&laquo;Файлды жүктөө&raquo; бөлүмүндө сиз жүктөгөн файлдарды сактоо үчүн каталогду жана жолду көрсөтсөңүз болот.','Installing themes on Multisite can only be done from the Network Admin section.'=>'Тармак абалында &laquo;Тармакты башкаруу&raquo; бөлүмүндө гана темаларды орнотууга болот.','If desired, WordPress will automatically alert various services of your new posts.'=>'Зарыл болсо, WordPress жаңы жазууларыңыз тууралуу ар кандай кызматтарга автоматтык түрдө кабарлайт.','Post Via Email'=>'E-mail аркылуу жарыялоо','This screen provides many options for controlling the management and display of comments and links to your posts/pages. So many, in fact, they will not all fit here! :) Use the documentation links to get information on what each discussion setting does.'=>'Бул экран сиздин жазууларыңызга/баракчаларыңызга комментарийлерди жана шилтемелерди башкаруу жана көрсөтүүнү жөндөө үчүн көптөгөн мүмкүнчүлүктөрдү берет. Чындыгында ушунчалык көп болгондуктан, алардын баары бул жерге батпайт! :) Ар бир жөндөө жөнүндө маалымат алуу үчүн оң жактагы шилтемелердеги документтерди караңыз.','You can change your password, turn on keyboard shortcuts, change the color scheme of your WordPress administration screens, and turn off the WYSIWYG (Visual) editor, among other things. You can hide the Toolbar (formerly called the Admin Bar) from the front end of your site, however it cannot be disabled on the admin screens.'=>'Сиз сырсөзүңүздү өзгөртүп, тез баскычтарды иштетип, WordPress башкаруу экрандарынын түс схемасын өзгөртүп, визуалдык редакторду (WYSIWYG) өчүрө аласыз. Жогорку панелди сайттын тышкы бөлүгү үчүн өчүрсө болот, бирок ал ар дайым башкаруу панелинде көрсөтүлөт.','This sidebar is no longer available and does not show anywhere on your site. Remove each of the widgets below to fully remove this inactive sidebar.'=>'Бул каптал тилке жеткиликтүү эмес жана мындан ары сайтыңызда көрүнбөйт. Бул активдүү эмес тилкени толугу менен өчүрүү үчүн, андагы бардык виджеттерди өчүрүңүз.','Inactive Sidebar (not used)'=>'Активдүү эмес тилке (жашыруун)','Clicking <strong>Select Files</strong> opens a navigation window showing you files in your operating system. Selecting <strong>Open</strong> after clicking on the file you want activates a progress bar on the uploader screen.'=>'<strong>&laquo;Файлдарды тандоо&raquo;</strong> баскычы файлдарды көрүү үчүн операциялык тутумуңуздун терезесин ачат. Файлды тандап, <strong>&laquo;Ачуу&raquo;</strong> баскычын басыңыз &#8212; экранда жүктөө тилкеси пайда болот.','<strong>Drag and drop</strong> your files into the area below. Multiple files are allowed.'=>'Файлдарыңызды төмөнкү атайын аймакка <strong>Сүйрөңүз</strong>. Бир эле учурда бир нече файлды сүйрөй аласыз.','You can assign keywords to your posts using <strong>tags</strong>. Unlike categories, tags have no hierarchy, meaning there is no relationship from one tag to another.'=>'<strong>Тегдерди</strong> колдонуп жазууларга ачкыч сөздөрдү дайындоого болот. Категориялардан айырмаланып, тегдердин иерархиясы жок &#8212; бул тегдер бири-бирине байланыштуу эмес дегенди билдирет.','You can create groups of links by using Link Categories. Link Category names must be unique and Link Categories are separate from the categories you use for posts.'=>'Шилтеме категорияларын колдонуп, шилтемелерди топтоштурууга болот. Шилтеме категорияларынын аталыштары уникалдуу болушу керек, ал эми шилтеме категориялары сиз жазуу үчүн колдонгон категорияларга тиешеси жок.','Missing Widgets'=>'Жоголгон виджеттер','Removing and Reusing'=>'Өчүрүү жана кайра колдонуу','If a media file has not been attached to any content, you will see that in the Uploaded To column, and can click on Attach to launch a small popup that will allow you to search for existing content and attach the file.'=>'Эгер медиафайл эч кандай жазууга тиркелбесе, сиз муну &laquo;Колдонулган&raquo; тилкесинде көрөсүз жана сиз каалаган жазууну тандап, ага файлды тиркөө үчүн кичинекей калкыма терезени ачып &laquo;Тиркеме&raquo; шилтемесин басыңыз.','All the files you&#8217;ve uploaded are listed in the Media Library, with the most recent uploads listed first. You can use the Screen Options tab to customize the display of this screen.'=>'Сиз жүктөгөн файлдардын баары файлдар китепканасында тизмеленген, эң жаңысы биринчиде. Бул экрандын көрсөтүлүшүн жөндөө үчүн, &laquo;Экран орнотуулары&raquo; өтмөгүн колдонсоңуз болот.','You can also perform the same types of actions, including narrowing the list by using the filters, acting on a page using the action links that appear when you hover over a row, or using the Bulk actions menu to edit the metadata for multiple pages at once.'=>'Сиз ошондой эле аракеттердин ошол эле түрлөрүн аткара аласыз, анын ичинде чыпкаларды колдонуу менен тизмени ылдый жылдырып, курсордун шилтемелерин колдонуп барак менен иштөө жана &laquo;Аракеттер&raquo; менюсу аркылуу барактарды жапырт түзөтө аласыз.','Managing pages is very similar to managing posts, and the screens can be customized in the same way.'=>'Барактарды башкаруу жазууларды башкарууга абдан окшош жана экранды да ушундай эле жөндөөгө болот.','Pages are similar to posts in that they have a title, body text, and associated metadata, but they are different in that they are not part of the chronological blog stream, kind of like permanent posts. Pages are not categorized or tagged, but can have a hierarchy. You can nest pages under other pages by making one the &#8220;Parent&#8221; of the other, creating a group of pages.'=>'Барактар жазууларга окшош, анткени алардын аталышы, тексти жана метадайындары бар, бирок алардан блогдун хронологиялык агымына кирбей, туруктуу болушу менен айырмаланат. Барактарга категориялар жана тегдер дайындалбайт, бирок алар иерархияга ээ болушу мүмкүн. Бир баракты экинчисинин астына жайгаштырып, аны энелик катары көрсөтүп, бири-бирине байланыштуу барактардын тобун алууга болот.','Many people take advantage of keyboard shortcuts to moderate their comments more quickly. Use the link to the side to learn more.'=>'Көптөгөн колдонуучулар комментарийлерди тез текшерүү үчүн тез баскычтарды колдонушат. Оң жактагы шилтемеден кошумча маалымат таба аласыз.','In the <strong>Author</strong> column, in addition to the author&#8217;s name, email address, and site URL, the commenter&#8217;s IP address is shown. Clicking on this link will show you all the comments made from this IP address.'=>'<strong>&laquo;Автор&raquo;</strong> тилкесинде автордун аты-жөнү, емайл жана сайтынан тышкары, автордун IP дареги да көрсөтүлөт. Бул шилтемени басуу менен сиз ушул IP даректен жасалган бардык комментарийлерди көрөсүз.','You can manage comments made on your site similar to the way you manage posts and other content. This screen is customizable in the same ways as other management screens, and you can act on comments using the on-hover action links or the bulk actions.'=>'Сиз жазууларды жана башка мазмунду башкаргандай эле, өз сайтыңыздагы комментарийлерди башкара аласыз. Бул экран башка башкаруу экрандары сыяктуу жөнгө салынат. Курсорду алып келгенде пайда болгон шилтемелер аркылуу же жапырт аракеттерди жасап, комментарийлер менен иштей аласыз.','Links in the Toolbar at the top of the screen connect your dashboard and the front end of your site, and provide access to your profile and helpful WordPress information.'=>'Жогорку тилкедеги шилтемелер консолду сайттын сырткы бөлүгү менен байланыштырат, ошондой эле профилиңизге жана WordPress жөнүндө пайдалуу маалыматка кирүү мүмкүнчүлүгүн берет.','Deleting Links'=>'Шилтемелерди өчүрүү','Links may be separated into Link Categories; these are different than the categories used on your posts.'=>'Шилтемелерди Шилтеме категориялары боюнча бөлүүгө болот; алар жазуулар үчүн колдонулган категориялардан айырмаланып турат.','<a href="%1$s">Learn more about WordPress %2$s</a>.'=>'<a href="%1$s">WordPress %2$s тууралуу көбүрөөк билүү</a>.','<strong>Edit</strong> takes you to the editable profile screen for that user. You can also reach that screen by clicking on the username.'=>'<strong>Түзөтүү</strong> колдонуучунун профилин түзөтүү экранын ачат. Сиз ошондой эле колдонуучунун атын басуу менен ал жерге бара аласыз.','Hovering over a row in the users list will display action links that allow you to manage users. You can perform the following actions:'=>'Колдонуучулардын тизмесиндеги саптын үстүнө курсорду алып барсаңыз, колдонуучуларды башкарууга мүмкүндүк берген шилтемелер пайда болот. Сиз төмөнкү кадамдарды аткарсаңыз болот:','You can view all posts made by a user by clicking on the number under the Posts column.'=>'&laquo;Жазуулар&raquo; тилкесиндеги номерди басып, колдонуучунун бардык жазууларын көрө аласыз.','You can hide/display columns based on your needs and decide how many users to list per screen using the Screen Options tab.'=>'Сиз өз каалооңузга жараша тилкелерди жашыра/көрсөтө аласыз жана &laquo;Экран жөндөөлөрү&raquo; өтмөгүндө көрсөтүлгөн колдонуучулардын санын белгилей аласыз.','Managing Pages'=>'Барактарды башкаруу','<strong>Preview</strong> will show you what your draft post will look like if you publish it. View will take you to your live site to view the post. Which link is available depends on your post&#8217;s status.'=>'<strong>&laquo;Көрүү&raquo;</strong> &#8212; каранускаңыз жарыялангандан кийин кандай болорун көрсөтөт. &laquo;Өтүү&raquo; &#8212; сайттын сырткы бөлүгүндө жазууну ачат. Бул эки шилтеменин кайсынысы көрсөтүлөт, жазуунун абалына жараша болот.','<strong>Trash</strong> removes your post from this list and places it in the Trash, from which you can permanently delete it.'=>'<strong>&laquo;Таштанды&raquo;</strong> &#8212; жазууну бул тизмеден алып салат жана аны биротоло өчүрө турган себетке салат.','<strong>Quick Edit</strong> provides inline access to the metadata of your post, allowing you to update post details without leaving this screen.'=>'<strong>&laquo;Ыкчам түзөтүү&raquo;</strong> &#8212;  менен сиз жазуу метадайындарына баракчадан чыкпай эле өзгөртүү мүмкүнчүлүгүнө ээ болосуз.','<strong>Edit</strong> takes you to the editing screen for that post. You can also reach that screen by clicking on the post title.'=>'<strong>&laquo;Түзөтүү&raquo;</strong> &#8212; Бул жазуу үчүн түзөтүү экранын ачат. Сиз ошондой эле жазуунун аталышын басуу менен ал жерге бара аласыз.','Because this is a multisite installation, you may add accounts that already exist on the Network by specifying a username or email, and defining a role. For more options, such as specifying a password, you have to be a Network Administrator and use the hover link under an existing user&#8217;s name to Edit the user profile under Network Admin > All Users.'=>'Бул сайттар тармагы болгондуктан, андагы аккаунттарды колдонуучу аты же емайл жана ролду тандоо менен кошууга болот. Көбүрөөк мүмкүнчүлүктөргө ээ болуу үчүн &#8212; мисалы, сырсөздү дайындоо үчүн &#8212; сиз тармактын администратору болушуңуз керек жана &laquo;Тармакты башкаруу&raquo; &rarr; &laquo;Бардык колдонуучулар&raquo; бөлүмүндө анын аты менен пайда болгон колдонуучунун профилин түзөтүү үчүн шилтемени колдонуңуз.','Welcome to WordPress %s'=>'WordPress %s нускасына кош келиңиз','Go to Dashboard &rarr; Home'=>'&laquo;Консол&raquo; &rarr; &laquo;Башкы&raquo; бетине өтүңүз','Go to Dashboard &rarr; Updates'=>'&laquo;Консол&raquo; &rarr; &laquo;Жаңыртуулар&raquo; барагына өтүңүз','Profile updated.'=>'Профил жаңыланды.','Hi,

