%4$s','Core Developer'=>'Ядронун иштетүүчүсү','No valid plugins were found.'=>'Жарактуу плагиндер табылган жок.','The plugin contains no files.'=>'Плагинде файлдар жок.','The package could not be installed.'=>'Архивди орнотуу мүмкүн эмес.','Attachment Post URL'=>'Тиркеме жазуусунун URL','admin menuAll Links'=>'Бардык шилтемелер','%s plugins'=>'Плагиндер: %s','%s plugin'=>'%s плагин','Failed to optimize the %1$s table. Error: %2$s'=>'%1$s таблицасын оптималдаштыруу ийгиликсиз болду. Ката: %2$s','Successfully optimized the %s table.'=>'%s таблицасы ийгиликтүү оптималдаштырылды.','The %s table is already optimized.'=>'%s таблицасы эчак эле оптималдаштырылган.','Successfully repaired the %s table.'=>'%s таблицасы ийгиликтүү калыбына келтирилди.','The %s table is okay.'=>'%s таблицасы жарактуу.','View version %s details.'=>'%s нускасынын маалыматын көрүү.','Tumblr'=>'Tumblr','<a href="%1$s" class="update-browser-link">Update %2$s</a> or learn how to <a href="%3$s" class="browse-happy-link">browse happy</a>'=>'<a href="%1$s" class="update-browser-link">%2$s</a> жаңыртыңыз же <a href="%3$s" class="browse-happy-link">башка мүмкүнчүлүктөрү</a> жөнүндө билип алыңыз','Scale images to match the large size selected in %1$simage options%2$s (%3$d &times; %4$d).'=>'Сүрөттөрдү %2$s (%3$d &times; %4$d) медиафайлдарынын %1$sжөндөөлөрүндө көрсөтүлгөн чоң өлчөмгө ылайык масштабдаңыз.','Audio, Video, or Other File'=>'Аудио, видео же башка файл','Insert media from another website'=>'Башка сайттан медиафайлды кыстарыңыз','<strong>Error:</strong> Could not connect to the server. Please verify the settings are correct.'=>'<strong>Ката:</strong> Серверге туташуу мүмкүн эмес. Сураныч, жөндөөлөр туура экендигин текшериңиз.','<strong>Drag and Drop</strong> &mdash; To rearrange the boxes, drag and drop by clicking on the title bar of the selected box and releasing when you see a gray dotted-line rectangle appear in the location you want to place the box.'=>'<strong>Сүйрөп жылдыруу</strong> &#8212; блокторду кайра топтоо үчүн, тандалган блоктун башын басып, аны сүйрөп жылдырыңыз жана блокту жайгаштыргыңыз келген жерде чекиттүү кутуча бар тик бурчтукту көргөндө коё бериңиз.','You can use the following controls to arrange your Dashboard screen to suit your workflow. This is true on most other administration screens as well.'=>'Консолду өз каалоолоруңузга ылайыкташтыруу үчүн төмөнкү башкаруу элементтерин колдонсоңуз болот. Бул башка көптөгөн башкаруу панелинин экрандарына да тиешелүү.','The left-hand navigation menu provides links to all of the WordPress administration screens, with submenu items displayed on hover. You can minimize this menu to a narrow icon strip by clicking on the Collapse Menu arrow at the bottom.'=>'Сол жактагы багыттоо менюсу бардык WordPress башкаруу экрандарына шилтемелерди камтыйт жана кичи-менюлар курсордун үстүндө пайда болот. Төмөн жагындагы &laquo;Менюну жыйыштыруу&raquo; шилтемесин басуу менен менюну сүрөтчөлөрдүн тар тилкесине жыйыштыра аласыз.','Overview'=>'Сереп','Updates %s'=>'Жаңылоолор %s','Installed Plugins'=>'Орнотулгандар','Plugins %s'=>'Плагиндер %s','All Users'=>'Бардык колдонуучулар','Confirm Deletion'=>'Өчүрүүнү ырастоо','Role'=>'Ролу','Add Existing User'=>'Учурдагы колдонуучуну кошуу','Search Users'=>'Колдонуучуларды издөө','User removed from this site.'=>'Колдонуучу бул сайттан өчүрүлдү.','Changed roles.'=>'Ролдор өзгөртүлдү.','Caution:'=>'Көңүл буруңуз:','Add New User'=>'Жаңы колдонуучуну кошуу','User added.'=>'Колдонуучу кошулду.','Super Admin'=>'Администратор','Version %s'=>'Нуска %s','Update Available <span class="count">(%s)</span>'=>'Жаңыртуулар жеткиликтүү <span class="count">(%s)</span>','Deactivate'=>'Деактивациялоо','Delete Site'=>'Сайтты өчүрүү','Settings saved.'=>'Ырастоолор сакталды.','For more information:'=>'Кошумча маалымат:','About Pages'=>'Барактар жөнүндө','Title and Post Editor'=>'Аталышы жана Редактору','Customizing This Display'=>'Көрсөтүүнү жөндөө','Note: Neither of these options blocks access to your site &mdash; it is up to search engines to honor your request.'=>'Эскертүү: Бул жөндөөлөр сиздин сайтка кирүү мүмкүнчүлүгүнө тоскоол болбойт. Алар эске алынабы же жокпу &mdash; издөө тутумдарынан көз каранды.','Post name'=>'Жазуунун аталышы','sample permalink structuresample-post'=>'sample-post','sample permalink basearchives'=>'archives','This importer is not installed. Please install importers from <a href="%s">the main site</a>.'=>'Импорттоо үчүн бул скрипт орнотулган эмес. Сураныч, аны <a href="%s">негизги сайтка</a> орнотуңуз.','Site Language'=>'Сайттын тили','Attempt to notify any blogs linked to from the post'=>'Макала аркылуу шилтемеленген бардык блогдорго кабарлаңыз','Hi,
