%%s','Post Formats'=>'Жазуу форматтары','Full Width Template'=>'Жалгыз тилке шаблону','Featured Images'=>'Жазуу сүрөттөрү','Featured Image Header'=>'Аталыш жазуулардын сүрөттөрү','It looks like you\'re using an old version of %s. For the best WordPress experience, please update your browser.'=>'Кыязы, сиз браузердин эскирген %s нускасын колдонуп жатасыз. Сураныч, WordPress\'тин толук иштөө тажрыйбасы үчүн браузериңизди жаңыртыңыз.','It looks like you\'re using an insecure version of %s. Using an outdated browser makes your computer unsafe. For the best WordPress experience, please update your browser.'=>'Кыязы, сиз браузердин кооптуу %s нускасын колдонуп жатасыз. Эскирген браузерди колдонуу компьютериңиздин бузулуу коркунучун жогорулатат. Сураныч, WordPress\'тин толук иштөө тажрыйбасы үчүн браузериңизди жаңыртыңыз.','There are some invalid menu items. Please check or delete them.'=>'Менюнун кээ бир элементтери туура эмес. Текшериңиз же аларды өчүрүңүз.','term nameName'=>'Аталышы','meta nameName'=>'Аты','theme nameName'=>'Аталышы','You can find additional themes for your site by using the Theme Browser/Installer on this screen, which will display themes from the <a href="%s">WordPress Theme Directory</a>. These themes are designed and developed by third parties, are available free of charge, and are compatible with the license WordPress uses.'=>'Бул экранда сиз <a href="%s">WordPress каталогунан</a> темаларды көрсөтө турган теманы көрүү/орнотуу скриптин колдонуп сайтыңыз үчүн кошумча темаларды таба аласыз. Бул темалар үчүнчү тараптар тарабынан түзүлгөн, бекер таратылат жана WordPress лицензиясына шайкеш келет.','If you would like to see more plugins to choose from, click on the &#8220;Add New Plugin&#8221; button and you will be able to browse or search for additional plugins from the <a href="%s">WordPress Plugin Directory</a>. Plugins in the WordPress Plugin Directory are designed and developed by third parties, and are compatible with the license WordPress uses. Oh, and they&#8217;re free!'=>'Эгер сиз плагин тандооңузду кеңейтүүнү кааласаңыз, &#8220;Жаңы кошуу&#8221; баскычын басып, <a href="%s">WordPress каталогунан</a> кошумча плагиндерди карап же издесеңиз болот. WordPress каталогундагы плагиндер үчүнчү тараптар тарабынан түзүлгөн жана WordPress лицензиясына шайкеш келет. Ооба, алар бекер!','The uploaded file exceeds the %s directive that was specified in the HTML form.'=>'Жүктөлгөн файлдын өлчөмү HTML формасында көрсөтүлгөн %s маанисинен ашып кетти.','External Libraries'=>'Сырткы китепканалар','Network Setup'=>'Тармакты орнотуу','Available Tools'=>'Бардык аспаптар','Translate this to be the equivalent of English Translators in your language for the credits page Translators sectionTranslators'=>'Котормочулар','Every plugin and theme in WordPress.org&#8217;s directory is 100%% GPL or a similarly free and compatible license, so you can feel safe finding <a href="%1$s">plugins</a> and <a href="%2$s">themes</a> there. If you get a plugin or theme from another source, make sure to <a href="%3$s">ask them if it&#8217;s GPL</a> first. If they do not respect the WordPress license, it is not recommended to use them.'=>'WordPress.org каталогундагы ар бир плагин жана тема GPL же ушул сыяктуу акысыз лицензияга 100%% шайкеш келет, андыктан <a href="%1$s">плагиндер</a> жана <a href="%2$s" ">темалар</a> ошол жерден коркпой колдонсо болот. Эгер сизде башка булактан плагин же тема бар болсо, адегенде алардын <a href="%3$s">GPL лицензияларына туура келгенин</a> текшериңиз. Алар WordPress лицензиясы менен шайкеш келбесе, биз аларды колдонууну сунуштабайбыз.','WordPress grows when people like you tell their friends about it, and the thousands of businesses and services that are built on and around WordPress share that fact with their users. We are flattered every time someone spreads the good word, just make sure to <a href="%s">check out our trademark guidelines</a> first.'=>'Сиз сыяктуу колдонуучулар бул тууралуу досторуна айтканда WordPress өнүгөт жана WordPress\'те курулган миңдеген коммерциялык долбоорлор жана кызматтар бул тууралуу өз колдонуучуларына кабарлашат. Кимдир бирөө жакшы сын-пикирлерди бөлүшкөндө, биз абдан кубанабыз, жөн гана <a href="%s">биздин соода маркабызды колдонуу эрежелери менен таанышыңыз</a>.','All Comments'=>'Бардык комментарийлер','Lead Developer'=>'Жетекчи иштетүүчү','Cofounder, Project Lead'=>'Негиздөөчүлөрүнүн бири, долбоордун жетекчиси','Core Contributors to WordPress %s'=>'WordPress %s өзөктүк иштеп чыгуунун катышуучулары','Project Leaders'=>'Долбоордун жетекчилери','Credits'=>'Катышуучулар','removing-widgetDeactivate'=>'Деактивациялоо','Your browser is out of date!'=>'Сиздин браузериңиз эскирген!','You are using an insecure browser!'=>'Сиз кооптуу браузерди колдонуп жатасыз!','Freedoms'=>'Укуктар','You can use one of these cool headers or show a random one on each page.'=>'Бул сонун сүрөттөрдүн бирин колдонсоңуз болот же аларды туш келди көрсөтсөңүз болот.','If you do not want to upload your own image, you can use one of these cool headers, or show a random one.'=>'Эгер сиз өзүңүздүн сүрөтүңүздү жүктөөнү каалабасаңыз, анда ушул сонун сүрөттөрдүн бирин колдонсоңуз болот же туш келди тартипте чыгарсаңыз болот.','You can choose one of your previously uploaded headers, or show a random one.'=>'Сиз мурда жүктөлгөн сүрөттөрдүн бирин тандап же туш келди тартипте чыгарсаңыз болот.','Collapse menu'=>'Менюну жыйыштыруу','Uploaded Images'=>'Жүктөлгөн сүрөттөр','<strong>Random:</strong> Show a different image on each page.'=>'<strong>Туш келди:</strong> Ар бир баракта ар кандай сүрөттөрдү көрсөтүү.','You have specified this user for deletion:'=>'Сиз өчүрүү үчүн төмөнкү колдонуучуну көрсөттүңүз:','%s Page Template'=>'&laquo;%s&raquo; барагынын шаблону','You cannot delete a plugin while it is active on the main site.'=>'Негизги сайтта плагин активдүү болуп турганда аны өчүрө албайсыз.','This plugin may be active on other sites in the network.'=>'Бул плагин тармактын башка сайттарында активдүү болушу мүмкүн.','Default Post Format'=>'Жазманын негизги калыбы','Any edits to files from this screen will be reflected on all sites in the network.'=>'Бул экрандагы файлдардагы өзгөрүүлөр тармактын бардык сайттарында чагылдырылат.','This screen lists all the existing users for your site. Each user has one of five defined roles as set by the site admin: Site Administrator, Editor, Author, Contributor, or Subscriber. Users with roles other than Administrator will see fewer options in the dashboard navigation when they are logged in, based on their role.'=>'Бул экранда сиздин сайтыңыздагы бардык колдонуучулардын тизмеси киргизилген. Ар бир колдонуучу администратор тарабынан дайындалган беш ролдун бирине ээ: Админ, Редактор, Автор, Мүчө же Жазылуучу. Администратор эмес колдонуучулар, алар ролуна жараша, авторизациядан кийин консол менюсунда азыраак мүмкүнчүлүктөрдү көрүшөт.','If you want to make changes but do not want them to be overwritten when the plugin is updated, you may be ready to think about writing your own plugin. For information on how to edit plugins, write your own from scratch, or just better understand their anatomy, check out the links below.'=>'Эгер сиз өзгөртүү киргизгиңиз келсе, бирок плагин жаңыртылганда алардын кайра жазылышын каалабасаңыз, анда өзүңүздүн плагиниңизди түзүшүңүз керек болушу мүмкүн. Плагиндерди кантип түзөтүү жана өзүңүздүн жазууңуз жөнүндө маалымат, ошондой эле алардын түзүлүшү кандай, төмөнкү шилтемелерден тапса болот.','The boxes on your Dashboard screen are:'=>'&laquo;Консол&raquo; экранында төмөнкү блоктор жеткиликтүү:','sample-page'=>'sample-page','Sample Page'=>'Үлгү барак','Retro (Generated)'=>'Ретро (Автоматтуу түрдө)','You only have one theme enabled for this site right now. Visit the Network Admin to <a href="%s">enable</a> more themes.'=>'Учурда бул сайт үчүн бир гана темага уруксат берилген. Башка темаларга <a href="%s">уруксат берүү</a> үчүн &laquo;Тармакты башкаруу&raquo; барагына өтүңүз.','You only have one theme enabled for this site right now. Visit the Network Admin to <a href="%1$s">enable</a> or <a href="%2$s">install</a> more themes.'=>'Учурда бул сайт үчүн бир гана темага уруксат берилген. Башка темаларга  <a href="%1$s">уруксат берүү</a> же <a href="%2$s">орнотуу</a> үчүн &laquo;Тармакты башкаруу&raquo; барагына өтүңүз.','Super admin privileges cannot be removed because this user has the network admin email.'=>'Суперадминистратордун укуктарын жокко чыгаруу мүмкүн эмес, анткени бул колдонуучунун емайл дареги тармак жөндөөлөрүндө көрсөтүлгөн.','You only have one theme installed right now. Live a little! You can choose from over 1,000 free themes in the WordPress Theme Directory at any time: just click on the <a href="%s">Install Themes</a> tab above.'=>'Учурда сизде бир гана тема орнотулган. Көбүрөөк жашоо! Каалаган убакта WordPress каталогунан 1000\'ден ашык акысыз темалардын ичинен тандай аласыз: жөн гана жогорудагы <a href="%s">&laquo;Темаларды орнотуу&raquo;</a> өтмөгүн басыңыз.','One or more database tables are unavailable. To allow WordPress to attempt to repair these tables, press the &#8220;Repair Database&#8221; button. Repairing can take a while, so please be patient.'=>'Бир же бир нече маалымат базасынын таблицалары жеткиликтүү эмес. Аларды WordPress аркылуу калыбына келтирүүгө аракет кылуу үчүн, &laquo;Базаны оңдоо&raquo; баскычын басыңыз. Бул оңдоо үчүн бир аз убакыт талап кылынышы мүмкүн &#8212; сураныч сабырдуу болуңуз.','Visual Editor RTL Stylesheet'=>'Редактор үчүн RTL стилдер таблицасы','This is a file in your current parent theme.'=>'Бул файл негизги (энелик) темада жайгашкан.','This child theme inherits templates from a parent theme, %s.'=>'Бул кичи темасы шаблондорду энелик темадан мурастайт &#8212; %s.','Network Enable'=>'Тармак үчүн уруксат берүү','Your WordPress database has been successfully updated!'=>'WordPress маалымат базасы ийгиликтүү жаңыртылды!','Update Complete'=>'Жаңыртуу аяктады','Update WordPress Database'=>'WordPress маалымат базасын жаңыртуу','The database update process may take a little while, so please be patient.'=>'Жаңыртуу процесси бир аз убакытка созулушу мүмкүн. Сураныч, сабыр кылыңыз.','Database Update Required'=>'Маалымат базасын жаңыртуу талап кылынат','No Update Required'=>'Жаңыртуу талап кылынбайт','WordPress &rsaquo; Update'=>'WordPress &rsaquo; Жаңыртуу','You are about to install WordPress %s <strong>in English (US)</strong>. There is a chance this update will break your translation. You may prefer to wait for the localized version to be released.'=>'Сиз WordPress %s <strong>англис тилинде</strong> орноткону турасыз. Мындай жаңыртуу котормого зыян келтириши ыктымал. Локалдаштырылган нускасын чыгышын күтө туруңуз.','There is a new version of %1$s available. <a href="%2$s" %3$s>View version %4$s details</a>. <em>Automatic update is unavailable for this plugin.</em>'=>'%1$s акыркы нускасы жеткиликтүү. <a href="%2$s" %3$s>%4$s үчүн нуска маалыматын көрүү</a>. <em>Бул плагинди автоматтык түрдө жаңыртуу мүмкүн эмес.</em>','Update Theme'=>'Теманы жаңылоо','Update Plugin'=>'Плагинди жаңылоо','Theme updated successfully.'=>'Тема ийгиликтүү жаңыланды.','Theme update failed.'=>'Теманы жаңылоо оңунан чыккан жок.','Plugin updated successfully.'=>'Плагин ийгиликтүү жаңыртылды.','Plugin update failed.'=>'Плагинди жаңылоо оңунан чыккан жок.','Update package not available.'=>'Жаңыртуу архиви жеткиликтүү эмес.','Date range:'=>'Даталар диапазону:','Authors:'=>'Авторлор:','This will contain all of your posts, pages, comments, custom fields, terms, navigation menus, and custom posts.'=>'Сиздин бардык жазууларыңыз, баракчаларыңыз, комментарийлериңиз, кошумча талааларыңыз, категорияларыңыз жана тегдериңиз, менюларыңыз жана жазуулардын кошумча түрлөрү бул жерде камтылган.','All content'=>'Бардык материалдар','Choose what to export'=>'Экспорттоо үчүн материалдарды тандаңыз','commentsMine <span class="count">(%s)</span>'=>'Меники <span class="count">(%s)</span>','%s &#8212; WordPress'=>'%s &#8212; WordPress','column nameIn Response To'=>'Жооп катары','The Available Widgets section contains all the widgets you can choose from. Once you drag a widget into a sidebar, it will open to allow you to configure its settings. When you are happy with the widget settings, click the Save button and the widget will go live on your site. If you click Delete, it will remove the widget.'=>'&laquo;Жеткиликтүү виджеттер&raquo; панелинде сиз тандай турган бардык виджеттер бар. Виджетти каптал тилкесине сүйрөп барсаңыз, ал параметрлерди жөндөө үчүн ачылат. Жөндөө аяктагандан кийин, &laquo;Сактоо&raquo; баскычын басыңыз жана виджет сайтта пайда болот. Эгер &laquo;Өчүрүү&raquo; шилтемесин бассаңыз, виджет өчүрүлөт.','Remember to click Update to save metadata entered or changed.'=>'Киргизилген же өзгөртүлгөн маанилерди сактоо үчүн &laquo;Медиафайлды жаңыртуу&raquo; баскычын басууну унутпаңыз.','Note that you crop the image by clicking on it (the Crop icon is already selected) and dragging the cropping frame to select the desired part. Then click Save to retain the cropping.'=>'Сураныч, сүрөттөрдү кесүү үчүн аны басуу жетиштүү экенин эске алыңыз (&laquo;Кесүү&raquo; белгиси эчак эле тандалган) жана чычкан баскычын басып туруп, керектүү бөлүгүн тандаңыз. Андан кийин жыйынтыкты сактоо үчүн &laquo;Сактоо&raquo; баскычын басыңыз.','For images only, you can click on Edit Image under the thumbnail to expand out an inline image editor with icons for cropping, rotating, or flipping the image as well as for undoing and redoing. The boxes on the right give you more options for scaling the image, for cropping it, and for cropping the thumbnail in a different way than you crop the original image. You can click on Help in those boxes to get more information.'=>'Сүрөттөр менен иштөөдө &laquo;Түзөтүү&raquo; баскычын бассаңыз болот сүрөттү кесүүнү, айлантууну жана которууну, ошондой эле жокко чыгарууну жана кайра жасоону колдогон орнотулган сүрөт редакторун ачуу үчүн миниатюранын астына басыңыз. Оң жактагы блоктор негизги сүрөттү масштабдоо жана кесүү үчүн гана эмес, миниатюраны өзүнчө иштетүү үчүн дагы көбүрөөк мүмкүнчүлүктөрдү берет. Сиз &laquo;Жардам&raquo; шилтемесин бассаңыз болот көбүрөөк маалымат алуу үчүн бул блокторго.','This screen allows you to edit fields for metadata in a file within the media library.'=>'Бул экран китепкана файлы менен байланышкан метадайын талааларын өзгөртүүгө мүмкүндүк берет.','Email or Username'=>'E-mail же Колдонуучу аты','Search Installed Themes'=>'Орнотулган темаларды издөө','<strong>Please Note:</strong> Any customizations you have made to theme files will be lost. Please consider using <a href="%s">child themes</a> for modifications.'=>'<strong>Көңүл буруңуз:</strong> Тема файлдарына киргизген бардык өзгөртүүлөрүңүз жоголот. Аны өзгөртүү үчүн <a href="%s">кичи темаларды</a> түзсөңүз болот.','postsSticky <span class="count">(%s)</span>'=>'Жабыштырылган <span class="count">(%s)</span>','Check again.'=>'Кайра текшерүү.','Last checked on %1$s at %2$s.'=>'Акыркы текшерүү: %1$s %2$s ичинде.','Please select one or more plugins to update.'=>'Сураныч, жаңыртуу үчүн бир же бир нече плагиндерди тандаңыз.','Please select one or more themes to update.'=>'Сураныч, жаңыртуу үчүн бир же бир нече темаларды тандаңыз.','The update process is starting. This process may take a while on some hosts, so please be patient.'=>'Жаңыртуу процесси башталды. Кээ бир серверлерде бул бир аз убакытты талап кылышы мүмкүн &#8212; сураныч сабырдуу болуңуз.','Apply Filters'=>'Чыпкаларды колдонуу','Editor Style'=>'Редактор стили','Sorry, you are not allowed to edit users.'=>'Кечиресиз, колдонуучуларды түзөтүүгө укугуңуз жок.','To perform the requested action, WordPress needs to access your web server.'=>'Суралган аракетти аткаруу үчүн WordPress сервериңизге кирүү мүмкүнчүлүгүн талап кылат.','Current Page'=>'Учурдагы барак','No themes match your request.'=>'Сурамыңызды канааттандырган темалар жок.','Search Sites'=>'Сайттарды издөө','Create a New User'=>'Жаңы колдонуучуну жаратуу','You have %1$s and %2$s.'=>'Сизде %1$s жана %2$s.','%s site'=>'%s сайт','%s user'=>'%s колдонуучу','https://wordpress.org/news/feed/'=>'http://kir.wordpress.org/news/feed/','https://wordpress.org/news/'=>'https://kir.wordpress.org/news/','(Signup has been disabled. Only members of this site can comment.)'=>'(Каттоо өчүрүлгөн. Сайттын мүчөлөрү гана комментарий бере алышат.)','There is a new version of %1$s available. <a href="%2$s" %3$s>View version %4$s details</a>.'=>'%1$s акыркы нускасы жеткиликтүү. <a href="%2$s" %3$s>%4$s үчүн нуска маалыматын көрүү</a>.','Go to Themes page'=>'Темалардын барагына өтүү','Go to WordPress Updates page'=>'&laquo;WordPress Жаңылоо&raquo; барагына кайтуу','Go to Plugins page'=>'Плагиндердин барагына өтүү','Click Save Menu to make pending menu items public.'=>'Каранускаларды жарыялоо үчүн &laquo;Менюну сактоо&raquo; баскычын басыңыз.','Storage Space'=>'Диск мейкиндиги','Create a New Site'=>'Жаңы сайт түзүү','Images of exactly <strong>%1$d &times; %2$d pixels</strong> will be used as-is.'=>'<strong>%1$d &times; %2$d пиксел</strong> өлчөмүндөгү сүрөттөр өзгөртүүсүз колдонулат.','Crop and Publish'=>'Кесүү жана Жарыялоо','XFN stands for <a href="https://gmpg.org/xfn/">XHTML Friends Network</a>, which is optional. WordPress allows the generation of XFN attributes to show how you are related to the authors/owners of the site to which you are linking.'=>'XFN <a href="http://gmpg.org/xfn/">XHTML Friends Network</a> дегенди билдирет (социалдык мамилелерди белгилөө үчүн микроформат) жана кошумча блок болуп саналат. WordPress сиз шилтеме кылып жаткан сайттын авторлору/ээлери менен болгон мамилеңизди көрсөтүү үчүн XFN атрибуттарын колдонууга мүмкүндүк берет.','FTP Password'=>'FTP сырсөзү','FTP Username'=>'FTP колдонуучу аты','FTP/SSH Password'=>'FTP/SSH сырсөзү','FTP/SSH Username'=>'FTP/SSH колдонуучу аты','Many themes show some sidebar widgets by default until you edit your sidebars, but they are not automatically displayed in your sidebar management tool. After you make your first widget change, you can re-add the default widgets by adding them from the Available Widgets area.'=>'Көпчүлүк темалар демейки боюнча кээ бир виджеттерди сиз өзүңүздүкүн кошконго чейин көрсөтөт, бирок алар каптал тилкелерин түзөтүүдө автоматтык түрдө көрүнбөйт. Биринчи виджетиңизди кошкондон кийин, сиз башкаларды &laquo;Жеткиликтүү виджеттер&raquo; панелдери менен кошо аласыз.','You can choose what&#8217;s displayed on the homepage of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static homepage, you first need to create two <a href="%s">Pages</a>. One will become the homepage, and the other will be where your posts are displayed.'=>'Сиз сайтыңыздын башкы бетинде эмне көрсөтүлөрүн тандай аласыз. Бул тескери хронологиялык тартипте жазуулар (классикалык блог) же туруктуу/статикалык баракча болушу мүмкүн. Негизги бетти статикалык кылуу үчүн эки <a href="%s">баракча</a> түзүшүңүз керек. Бири негизги баракчага айланат, ал эми сиздин жазууларыңыз экинчисинде көрсөтүлөт.','The Optional fields let you customize the &#8220;category&#8221; and &#8220;tag&#8221; base names that will appear in archive URLs. For example, the page listing all posts in the &#8220;Uncategorized&#8221; category could be <code>/topics/uncategorized</code> instead of <code>/category/uncategorized</code>.'=>'&laquo;Кошумча&raquo; блокто архив даректеринде көрүнүүчү префикстерди жөндөй аласыз. Мисалы, &laquo;Категориясыз&raquo; категориясындагы бардык жазуулар бар баракчанын дареги <code>/category/uncategorized</code> ордуна <code>/topics/uncategorized</code> сыяктуу көрүнүшү мүмкүн.','When you assign multiple categories or tags to a post, only one can show up in the permalink: the lowest numbered category. This applies if your custom structure includes %1$s or %2$s.'=>'Сиз жазууга бир нече категория же тег ыйгарганыңызда, алардын бири гана шилтемеде пайда болот: Эң кичинекей ID менен категория. Бул %1$s же %2$s элементтерин камтыган түзүмдөргө тиешелүү.','If you pick an option other than Plain, your general URL path with structure tags (terms surrounded by %s) will also appear in the custom structure field and your path can be further modified there.'=>'Эгер сиз &laquo;Жөнөкөй&raquo; дегенден башка вариантты тандасаңыз, &laquo;Кошумча түзүлүш&raquo; талаасында, %s белгилери менен курчалган түзүлүш элементтери бар жол да пайда болот, анда кошумча өзгөртүүлөрдү киргизе аласыз.','If you want to remove the widget but save its setting for possible future use, just drag it into the Inactive Widgets area. You can add them back anytime from there. This is especially helpful when you switch to a theme with fewer or different widget areas.'=>'Эгер сиз виджетти өчүрүп, бирок келечекте колдонуу үчүн анын жөндөөлөрүн келечекте колдонуу үчүн сактап калгыңыз келсе, аны &laquo;Активдүү эмес виджеттер&raquo; панелине сүйрөп жылдырыңыз. Ал жерден сиз аларды каалаган убакта кайра кошо аласыз. Эгер сиз виджеттери же башка аймактары азыраак болгон темага өтсөңүз, бул өзгөчө пайдалуу болушу мүмкүн.','To add a new user for your site, click the Add New button at the top of the screen or Add New in the Users menu section.'=>'Сайтка жаңы колдонуучуну кошуу үчүн, экрандын жогору жагындагы &laquo;Жаңы кошуу&raquo; баскычын же &laquo;Колдонуучулар&raquo; менюсундагы &laquo;Жаңы кошуу&raquo; шилтемесин басыңыз.','You can set maximum sizes for images inserted into your written content; you can also insert an image as Full Size.'=>'Мазмунга киргизилген сүрөттөрдүн максималдуу өлчөмдөрүн көрсөтүүгө болот; ошондой эле толук өлчөмдөгү сүрөт киргизсе болот.','Most themes show the site title at the top of every page, in the title bar of the browser, and as the identifying name for syndicated feeds. Many themes also show the tagline.'=>'Көпчүлүк жасалгалоо темалары сайттын аталышын ар бир барактын жогору жагында, браузердин терезесинин аталышында жана RSS-түрмөктөрдө көрсөтөт. Кыскача сүрөттөмө көптөгөн темаларда да көрсөтүлөт.','<strong>Order</strong> &mdash; Pages are usually ordered alphabetically, but you can choose your own order by entering a number (1 for first, etc.) in this field.'=>'<strong>Тартип</strong> &#8212; барактар адатта алфавит боюнча иргелет, бирок сиз бул кутуга санды (1 &#8212 биринчи ж.б.) киргизүү менен өз тартибиңизди орното аласыз.','If you do not remember your credentials, you should contact your web host.'=>'Каттоо маалыматтарыңызды эстей албасаңыз, хостинг провайдериңизге кайрылып, сурасаңыз болот.','Please enter your FTP credentials to proceed.'=>'Сураныч, FTP кирүү маалыматтарын киргизиңиз.','Please enter your FTP or SSH credentials to proceed.'=>'Сураныч, FTP же SSH кирүү маалыматтарын киргизиңиз.','Your profile contains information about you (your &#8220;account&#8221;) as well as some personal options related to using WordPress.'=>'Профилиңизде сиз жөнүндө маалымат (&laquo;аккаунт&raquo;), ошондой эле WordPress\'ти колдонуунун айрым жеке артыкчылыктары камтылган.','You can Upload a theme manually if you have already downloaded its ZIP archive onto your computer (make sure it is from a trusted and original source). You can also do it the old-fashioned way and copy a downloaded theme&#8217;s folder via FTP into your %s directory.'=>'Эгер сиз ZIP-архивин компьютериңизге жүктөгөн болсоңуз, теманы кол менен жүктөп алсаңыз болот (анын булагы ишенимдүү экенин текшериңиз). Сиз ошондой эле эски ыкманы тандап, жүктөлүп алынган тема каталогун FTP аркылуу %s каталогуна көчүрө аласыз.','<strong>Send Trackbacks</strong> &mdash; Trackbacks are a way to notify legacy blog systems that you&#8217;ve linked to them. Enter the URL(s) you want to send trackbacks. If you link to other WordPress sites they&#8217;ll be notified automatically using pingbacks, and this field is unnecessary.'=>'<strong>Кайра шилтемелерди жөнөтүү</strong> &#8212; эски платформалардагы блогдорго байланыштырганыңыз жөнүндө кабарлоо жолу. Кайра шилтемелерди жөнөткүңүз келген даректерди киргизиңиз. Эгер сиз WordPress блогуна шилтеме кылсаңыз &#8212; ага автоматтык түрдө билдирүү жөнөтүлөт, бул талааны толтуруунун кереги жок.','Contributors can write and manage their posts but not publish posts or upload media files.'=>'Мүчөлөр өз жазууларын түзүп, түзөтө алышат, бирок аларды жарыялай жана медиа жүктөй алышпайт.','Administrators have access to all the administration features.'=>'Администраторлор бардык функцияларды колдоно алышат.','You can use the plugin file editor to make changes to any of your plugins&#8217; individual PHP files. Be aware that if you make changes, plugins updates will overwrite your customizations.'=>'Сиз плагин редакторун PHP файлдарына өзгөртүүлөрдү киргизүү үчүн колдоно аласыз. Плагиндерди жаңыртканыңызда, сиз киргизген өзгөртүүлөр кайра жазыларын эске алыңыз.','If you delete a link, it will be removed permanently, as Links do not have a Trash function yet.'=>'Эгер сиз шилтемени өчүрсөңүз, ал биротоло өчүрүлөт, анткени шилтеме себети азырынча жок.','You can add links here to be displayed on your site, usually using <a href="%s">Widgets</a>. By default, links to several sites in the WordPress community are included as examples.'=>'Бул жерде сайтыңызда көрсөтүлө турган шилтемелерди кошууга болот &#8212; адатта <a href="%s">виджеттерди</a> колдонуу менен. Мисал катары, бул жерде бир нече WordPress коомдук сайттарына шилтемелер бар.','<strong>Slug</strong> &mdash; The &#8220;slug&#8221; is the URL-friendly version of the name. It is usually all lowercase and contains only letters, numbers, and hyphens.'=>'<strong>Жарлык</strong> &#8212; URL үчүн ылайыктуу аталыштын варианты. Көбүнчө кичинекей латын тамгаларын, сандарды жана дефистерди гана камтыйт.','You can also create posts with the <a href="%s">Press This bookmarklet</a>.'=>'Ошондой эле <a href="%s">&laquo;Жарыялоо&raquo; өтмөгү</a> аркылуу жазмаларды түзө аласыз.','Do not forget to click on the Save Changes button when you are finished.'=>'Бүткөндөн кийин, &laquo;Өзгөртүүлөрдү сактоо&raquo; баскычын басууну унутпаңыз.','You can customize the look of your site without touching any of your theme&#8217;s code by using a custom background. Your background can be an image or a color.'=>'Тема файлдарындагы кодго тийбестен, кошумча фондун жардамы менен сайттын көрүнүшүн жөндөй аласыз. Сүрөт же түс фон катары кызмат кыла алат.','Editors can publish posts, manage posts as well as manage other people&#8217;s posts, etc.'=>'Редакторлор жазууларды жарыялай жана түзөтө алат, ошондой эле башка адамдардын жазуулары менен иштей алат ж.б.','Remember to click the Update Profile button when you are finished.'=>'Бүткөндөн кийин &laquo;Профилди жаңыртуу&raquo; баскычын басууну унутпаңыз.','Required fields are indicated; the rest are optional. Profile information will only be displayed if your theme is set up to do so.'=>'Милдеттүү талаалар көрсөтүлгөн; калгандары ыктыярдуу. Профилдеги маалымат, эгерде жасалгалоо темасы ушундай орнотулган болсо гана көрсөтүлөт.','Your username cannot be changed, but you can use other fields to enter your real name or a nickname, and change which name to display on your posts.'=>'Колдонуучунун атын өзгөртүүгө болбойт, бирок сиз башка талааларды колдонуп, чыныгы атыңызды же лакап атыңызды киргизип, жазууларыңыздын жанында пайда болгон атты тандасаңыз болот.','You can also moderate the comment from this screen using the Status box, where you can also change the timestamp of the comment.'=>'Сиз ошондой эле бул экранда комментарийди &laquo;Абалы&raquo; кутучасында кабыл алып же четке кага аласыз, ал жерде комментарий убактысын да өзгөртүүгө болот.','You can edit the information left in a comment if needed. This is often useful when you notice that a commenter has made a typographical error.'=>'Зарыл болсо, комментарийди түзөп койсоңуз болот. Эгер бул комментарийдин автору ката кетирген болсо, бул пайдалуу.','You can also control the display of your content in RSS feeds, including the maximum number of posts to display and whether to show full text or an excerpt. <a href="%s">Learn more about feeds</a>.'=>'Сиз ошондой эле мазмунду RSS түрмөктөрдө көрсөтө тургандай кылып жөндөсөңүз болот: көрсөтүлгөн жазуулардын максималдуу саны, үзүндү же толук жазууну көрсөтүү. <a href="%s">RSS түрмөктөрү жөнүндө көбүрөөк билүү</a>.','This screen contains the settings that affect the display of your content.'=>'Бул экранда мазмунуңуздун көрсөтүлүшүнө таасир этүүчү жөндөөлөр камтылган.','UTC means Coordinated Universal Time.'=>'UTC &laquo;Coordinated Universal Time&raquo; дегенди билдирет (Бүткүл дүйнөлүк координацияланган убакыт).','The fields on this screen determine some of the basics of your site setup.'=>'Бул экрандагы талаалар сайтыңыздын негизги орнотууларын аныктайт.','You must click the Save Changes button at the bottom of the screen for new settings to take effect.'=>'Жаңы орнотуулар күчүнө кириши үчүн &laquo;Өзгөртүүлөрдү сактоо&raquo; баскычын басыңыз. экрандын ылдый жагында.','The boxes for link name, web address, and description have fixed positions, while the others may be repositioned using drag and drop. You can also hide boxes you do not use in the Screen Options tab, or minimize boxes by clicking on the title bar of the box.'=>'&laquo;Аты&raquo;, &laquo;Дареги&raquo; жана &laquo;Сүрөттөмө&raquo; блокторунун абалы бекитилген, бирок калгандарынын баарын курсор менен сүйрөп жылдырууга болот. Сиз ошондой эле &laquo;Экран жөндөөлөрү&raquo; өтмөгүндө колдонулбаган блокторду жашыра аласыз же блоктун аталышын басуу менен аларды жыйыштыра аласыз.','Your themes are all up to date.'=>'Сиздин темаларыңызга жаңылоо талап кылынбайт.','Your plugins are all up to date.'=>'Сиздин плагиндериңизге жаңылоо талап кылынбайт.','While your site is being updated, it will be in maintenance mode. As soon as your updates are complete, this mode will be deactivated.'=>'Жаңылоо процессинин жүрүшүндө сайт техникалык тейлөө үчүн жабылат. Жаңыртуу аяктагандан кийин сайт кадимки режимге кайтып келет.','An updated version of WordPress is available.'=>'WordPress\'тин эң акыркы нускасы жаңыртуу үчүн жеткиликтүү.','You have the latest version of WordPress.'=>'Сизде WordPress\'тин жаңы нускасы бар.','Function Name&hellip;'=>'Функциянын аталышы&hellip;','Activate Plugin &amp; Run Importer'=>'Плагинди активдештирүү жана импорттоону баштоо','You can add or edit links on this screen by entering information in each of the boxes. Only the link&#8217;s web address and name (the text you want to display on your site as the link) are required fields.'=>'Бул экранда сиз ар бир блокто маалыматты көрсөтүү менен шилтемелерди кошуп же түзөтө аласыз. Дареги жана аты гана (сайтта шилтеме катары көрсөткүңүз келген текст) милдеттүү талаалар болуп саналат.','Categories can be selectively converted to tags using the <a href="%s">category to tag converter</a>.'=>'Категорияларды <a href="%s">категорияларды тегке которгучту</a> колдонуу менен тегдерге айландыруу мүмкүн.','This screen lists links to plugins to import data from blogging/content management platforms. Choose the platform you want to import from, and click Install Now when you are prompted in the popup window. If your platform is not listed, click the link to search the plugin directory for other importer plugins to see if there is one for your platform.'=>'Бул экран мазмунду башкаруу платформаларынан маалыматтарды импорттоо үчүн плагиндерге шилтемелерди берет. Керектүү платформаны тандап, пайда болгон терезеден &laquo;Орнотуу&raquo; баскычын басыңыз. Эгерде сиздин платформаңыз тизмеде жок болсо, башка импорттук плагиндерди издөө үчүн шилтемени басыңыз &#8212; балким, алардын арасында платформаңыз үчүн плагин бардыр.','Once generated, your WXR file can be imported by another WordPress site or by another blogging platform able to access this format.'=>'WXR файлы түзүлгөндөн кийин, аны башка WordPress сайтына же ушул форматты колдогон башка платформага импорттоого болот.','Choose a plugin to edit from the dropdown menu and click the Select button. Click once on any file name to load it in the editor, and make your changes. Do not forget to save your changes (Update File) when you are finished.'=>'Ачылып түшүүчү менюдан түзөтүү үчүн плагинди тандап, &laquo;Тандоо&raquo; баскычын басыңыз. Редакторго жүктөө үчүн каалаган файлдын атын басып, андан соң түзөтүп баштаңыз. Бүткөндөн кийин, өзгөртүүлөрүңүздү сактоону унутпаңыз (&laquo;Файлды жаңыртуу&raquo;).','You can customize the display of this screen using the Screen Options tab and/or the dropdown filters above the links table.'=>'Бул экранды &laquo;Экран жөндөөлөрү&raquo; өтмөгү жана/же шилтемелер таблицасынын үстүндөгү ачылып түшүүчү менюлар менен көрсөтүүнү жөндөсө болот.','Most of the time, plugins play nicely with the core of WordPress and with other plugins. Sometimes, though, a plugin&#8217;s code will get in the way of another plugin, causing compatibility issues. If your site starts doing strange things, this may be the problem. Try deactivating all your plugins and re-activating them in various combinations until you isolate which one(s) caused the issue.'=>'Көпчүлүк учурларда, плагиндер WordPress өзөгү жана башка плагиндер менен туура иштейт. Бирок, кээде бир плагиндин коду башкасына тоскоолдук болуп, шайкештикке байланыштуу көйгөйлөрдү жаратышы мүмкүн. Эгер сайтыңызда таң калыштуу нерселер болуп жатса, бул себеп болушу мүмкүн. Бардык плагиндерди өчүрүп, кайсынысы көйгөй жаратып жатканын аныктоо үчүн аларды ар кандай комбинацияларда кайра иштетип көрүңүз.','Enabling Accessibility Mode, via Screen Options, allows you to use Add and Edit buttons instead of using drag and drop.'=>'&laquo;Экран жөндөөлөрү&raquo; өтмөгүнөн атайын мүмкүнчүлүктөр режимин иштетүү менен, сиз сүйрөөнүн ордуна &laquo;Кошуу&raquo; жана &laquo;Өзгөртүү&raquo; баскычтарын колдоно аласыз.','Widgets may be used multiple times. You can give each widget a title, to display on your site, but it&#8217;s not required.'=>'Виджеттерди бир нече жолу колдонсо болот. Ар бир виджетке сайтта көрсөтүү үчүн аталыш берилиши мүмкүн, бирок бул милдеттүү эмес.','Widgets are independent sections of content that can be placed into any widgetized area provided by your theme (commonly called sidebars). To populate your sidebars/widget areas with individual widgets, drag and drop the title bars into the desired area. By default, only the first widget area is expanded. To populate additional widget areas, click on their title bars to expand them.'=>'Виджеттер &#8212; булар сиздин темаңыз тарабынан каралган аймактарга жайгаштырыла турган көз карандысыз мазмун блоктору (адатта, каптал тилкелери деп аталат). Аларды виджеттерге толтуруу үчүн, аталыштарды каалаган аймакка сүйрөңүз. Демейки боюнча, биринчи аймак гана ачылат. Калган аймактарды толтуруу үчүн, аталыштарды басуу менен аларды жайыңыз.','<strong>Advice:</strong> Think very carefully about your site crashing if you are live-editing the theme currently in use.'=>'<strong>Кеңеш:</strong> Эгер сиз учурда колдонулуп жаткан теманы түзөтүп жатсаңыз, анда сайттын иштешинин бузулушу жөнүндө ойлонуп көрүңүз.','After typing in your edits, click Update File.'=>'Өзгөртүүлөрдү киргизгенден кийин &laquo;Файлды жаңыртуу&raquo; баскычын басыңыз.','Begin by choosing a theme to edit from the dropdown menu and clicking the Select button. A list then appears of the theme&#8217;s template files. Clicking once on any file name causes the file to appear in the large Editor box.'=>'Баштоо үчүн, ачылуучу менюдан теманы тандап, &laquo;Тандоо&raquo; баскычын басыңыз. Тема шаблондорунун тизмеси пайда болот. Каалаган файлды редакторго жүктөө үчүн анын атын басыңыз.','You can use the theme file editor to edit the individual CSS and PHP files which make up your theme.'=>'Темаңыздын жеке CSS жана PHP файлдарына өзгөртүү киргизүү үчүн Тема редакторун колдоно аласыз.','(no parent)'=>'(тектиги жок)','<strong>Template</strong> &mdash; Some themes have custom templates you can use for certain pages that might have additional features or custom layouts. If so, you&#8217;ll see them in this dropdown menu.'=>'<strong>Шаблон</strong> &#8212; айрым темаларда айрым баракчалар үчүн кошумча функциялары же башка жасалгалары бар атайын шаблондор болушу мүмкүн. Сиз аларды бул тизмеден көрөсүз.','<strong>Parent</strong> &mdash; You can arrange your pages in hierarchies. For example, you could have an &#8220;About&#8221; page that has &#8220;Life Story&#8221; and &#8220;My Dog&#8221; pages under it. There are no limits to how many levels you can nest pages.'=>'<strong>Энелик</strong> &#8212; барактын иерархиясын уюштура аласыз. Мисалы, &laquo;Мен жөнүндө&raquo; баракчасын түзүңүз, анын ичинде &laquo;Өмүр баян&raquo; баракчалары болот; жана &laquo;Менин итим&raquo;. Тиркемелердин деңгээли боюнча эч кандай чектөөлөр жок.','All updates have been completed.'=>'Бардык жаңыртуулар аяктады.','You can change the display of this screen using the Screen Options tab to set how many items are displayed per screen and to display/hide columns in the table.'=>'Сиз бул экрандын көрүнүшүн &laquo;Экран жөндөөлөрү&raquo; өтмөгүнөн өзгөртө аласыз, канча элемент көрсөтүлөрүн жана кайсы таблица мамычалары көрсөтүлө тургандыгын белгилей аласыз.','<strong>Description</strong> &mdash; The description is not prominent by default; however, some themes may display it.'=>'<strong>Сүрөттөмө</strong> &#8212; ал демейки боюнча көрсөтүлбөйт, бирок кээ бир темалар аны көрсөтүшү мүмкүн.','<strong>Name</strong> &mdash; The name is how it appears on your site.'=>'<strong>Аталышы</strong> &#8212; элементтин сайтыңызда кандайча көрсөтүлөрүн аныктайт.','When adding a new tag on this screen, you&#8217;ll fill in the following fields:'=>'Жаңы тег кошууда бул экранда төмөнкү талаалар толтурулат:','When adding a new category on this screen, you&#8217;ll fill in the following fields:'=>'Жаңы категория кошууда бул экранда төмөнкү талаалар толтурулат:','What&#8217;s the difference between categories and tags? Normally, tags are ad-hoc keywords that identify important information in your post (names, subjects, etc) that may or may not recur in other posts, while categories are pre-determined sections. If you think of your site like a book, the categories are like the Table of Contents and the tags are like the terms in the index.'=>'Категориялар менен тегдердин ортосунда кандай айырма бар? Адатта, тегдер жазууларыңыздагы маанилүү маалыматты билдирген (ысымдар, объекттер ж.б.) башка жазууларда кездешиши же кездешпеши мүмкүн болгон кошумча ачкыч сөздөр, ал эми категориялар катары &#8212; алдын ала аныкталган бөлүмдөр. Эгерде сайтты китеп катары карасак, анда категориялар мазмунуна окшош, жана тегдер &#8212; алфавиттик көрсөткүч сыяктуу.','You can use categories to define sections of your site and group related posts. The default category is &#8220;Uncategorized&#8221; until you change it in your <a href="%s">writing settings</a>.'=>'Сайттын бөлүмдөрүн аныктоо жана жазууларды тема боюнча топтоо үчүн категорияларды колдонсо болот. Демейки боюнча, жазуулар &laquo;Категориясыз&raquo; категориясына кирет. Эгер сиз муну <a href="%s">жазуу жөндөөлөрүнөн</a> өзгөртпөсөңүз.','You need JavaScript to choose a part of the image.'=>'Сүрөттүн бир бөлүгүн тандоо үчүн JavaScript талап кылынат.','Crop Header Image'=>'Аталыш сүрөтүн кесүү','Image Upload Error'=>'Сүрөт жүктөө катасы','Text Color'=>'Тексттин түсү','Restore Original Header Image'=>'Түпнуска аталыш сүрөтүн калыбына келтирүү','This will restore the original header image. You will not be able to restore any customizations.'=>'Бул функция түпнуска аталыш сүрөтүн калыбына келтирет. Сиз киргизген өзгөртүүлөрүңүздү артка кайтара албайсыз.','Reset Image'=>'Сүрөттү баштапкы абалга келтирүү','Remove Header Image'=>'Аталыш сүрөтүн өчүрүү','This will remove the header image. You will not be able to restore any customizations.'=>'Бул функция аталыш сүрөтүн өчүрөт. Сиз киргизген өзгөртүүлөрүңүздү артка кайтара албайсыз.','Default Images'=>'Демейки сүрөттөр','Delete this comment permanently'=>'Бул комментарийди биротоло өчүрүү','Restore this comment from the Trash'=>'Бул комментарийди себеттен калыбына келтирүү','<strong>Discussion</strong> &mdash; You can turn comments and pings on or off, and if there are comments on the post, you can see them here and moderate them.'=>'<strong>Талкуу</strong> &#8212; Комментарийлерди жана эскертмелерди күйгүзүп же өчүрө аласыз. Эгер сиздин жазууңузда комментарийлер болсо, аларды бул жерден окуп, текшере аласыз.','<strong>%s</strong> &mdash; This allows you to associate an image with your post without inserting it. This is usually useful only if your theme makes use of the image as a post thumbnail on the home page, a custom header, etc.'=>'<strong>%s</strong> &#8212; бул блок жазууга сүрөт киргизбестен тиркөөгө мүмкүндүк берет. Бул адатта мааниге ээ, эгер сиздин жасалгалоо темаңыз негизги бетте, аталышта ж. б. жазуулардын миниатюраларын чыгарса.','<strong>Title</strong> &mdash; Enter a title for your post. After you enter a title, you&#8217;ll see the permalink below, which you can edit.'=>'<strong>Аталышы</strong> &#8212; жазууңузга аталыш киргизиңиз. Андан кийин, анын астында туруктуу шилтеме пайда болот, аны өзгөртө аласыз.','Hovering over a row in the posts list will display action links that allow you to manage your post. You can perform the following actions:'=>'Жазуулар тизмесиндеги саптын үстүнө курсорду алып барганда, жазууну башкарууга мүмкүндүк берген шилтемелер пайда болот. Сиз төмөнкү кадамдарды аткара аласыз:','You can refine the list to show only posts in a specific category or from a specific month by using the dropdown menus above the posts list. Click the Filter button after making your selection. You also can refine the list by clicking on the post author, category or tag in the posts list.'=>'Белгилүү бир категориядагы жазууларды гана көрсөтүү же тизменин үстүндөгү ачылуучу менюларды колдонуу менен белгилүү бир ай үчүн тизмени тактай аласыз. Тандалгандан кийин, &laquo;Чыпкалоо&raquo; баскычын басыңыз. Сиз ошондой эле жазуу тизмесиндеги жазуунун авторун, категориясын же тегди бастуу менен тизмени тактасаңыз болот.','You can hide/display columns based on your needs and decide how many posts to list per screen using the Screen Options tab.'=>'Сиз өз каалооңузга жараша тилкелерди жашыра/көрсөтө аласыз жана &laquo;Экран жөндөөлөрү&raquo; өтмөгүндө көрсөтүлгөн жазуулардын санын көрсөтө аласыз.','You can customize the display of this screen in a number of ways:'=>'Бул экрандын көрүнүшүн бир нече жол менен жөндөсө болот:','Search Installed Plugins'=>'Орнотулган плагиндерди издөө','Your theme supports one menu. Select which menu you would like to use.'=>'Сиздин темаңыз бир менюну колдойт. Колдонгуңуз келген менюну тандаңыз.','Your theme does not support navigation menus or widgets.'=>'Темаңыз багыттоо менюларын жана виджеттерин колдобойт.','Categories and Tags Converter'=>'Категория жана Тег конвертери','Most Recent'=>'Эң жаңылар','Start date:'=>'Башталган датасы:','Theme InstallerTag'=>'Тег','Plugin InstallerTag'=>'Тег','verbClear'=>'Тазалоо','commentMark as spam'=>'Спам деп белгилөө','Remove Background Image'=>'Фондук сүрөттү өчүрүү','Comments on &#8220;%s&#8221;'=>'Комментарийлер: &laquo;%s&raquo;','Show advanced menu properties'=>'Менюнун кеңейтилген мүнөздөмөсүн көрсөтүү','You have version %1$s installed. Update to %2$s.'=>'Сиз %1$s нускасын колдонуп жатасыз. %2$s чейин жаңыртыңыз.','Enabled'=>'Күйгүзүлгөн','commentNot Spam'=>'Спам эмес','This will restore the original background image. You will not be able to restore any customizations.'=>'Бул функция баштапкы фон сүрөтүн калыбына келтирет. Сиз киргизген өзгөртүүлөрүңүздү артка кайтара албайсыз.','WordPress Blog'=>'WordPress блогу','Remove Users from Site'=>'Колдонуучуларды сайттан өчүрүү','&mdash; No role for this site &mdash;'=>'&mdash; Бул сайт үчүн ролу жок &mdash;','New WordPress Site'=>'Жаңы WordPress сайты','My Site'=>'Менин сайтым','Sorry, you are not allowed to create posts or drafts on this site.'=>'Кечиресиз, бул сайтта жазууларды же каранускаларды түзүүгө укугуңуз жок.','Sorry, you are not allowed to create pages on this site.'=>'Кечиресиз, бул сайтта барактарды түзүүгө укугуңуз жок.','Custom site suspended message.'=>'Катырылган сайт жөнүндө ыктыярдуу билдирүү.','Custom site inactive message.'=>'Активдүү эмес сайт жөнүндө ыктыярдуу билдирүү.','Custom site deleted message.'=>'Өчүрүлгөн сайт жөнүндө ыктыярдуу билдирүү.','If you have posts or comments in another system, WordPress can import those into this site. To get started, choose a system to import from below:'=>'Эгерде сизде башка системада билдирүүлөр жана комментарийлер болсо, WordPress аларды бул сайтка импорттой алат. Баштоо үчүн тизмеден системаны тандаңыз:','No items.'=>'Элементтер жок.','To use a subdomain configuration, you must have a wildcard entry in your DNS. This usually means adding a %s hostname record pointing at your web server in your DNS configuration tool.'=>'Субдомен режимин колдонуу үчүн, сиз DNS жазууларыңызда масканы колдонушуңуз керек. Жалпысынан алганда, DNS конфигурациялоо куралы аркылуу сервериңизди көрсөткөн %s дареги бар жазууну кошуу жетиштүү.','The installer attempted to contact a random hostname (%s) on your domain.'=>'Орнотуу скрипти домениңизде туш келди даректи (%s) ачууга аракет кылды.','The menu item has been successfully deleted.'=>'Меню элементи ийгиликтүү өчүрүлдү.','Please provide a custom field name.'=>'Сураныч, ыңгайлуу талаанын атын көрсөтүңүз.','Display Options'=>'Көрсөтүү жөндөөлөрү','Remove Image'=>'Сүрөттү өчүрүү','Other users have been removed.'=>'Башка колдонуучулар өчүрүлгөн.','You cannot remove the current user.'=>'Сиз учурдагы колдонуучуну өчүрө албайсыз.','There are no valid users selected for removal.'=>'Өчүрүлө турган колдонуучулар тандалган жок.','Confirm Removal'=>'Өчүрүүнү аныктоо','You have specified these users for removal:'=>'Сиз өчүрүү үчүн төмөнкү колдонуучуларды көрсөттүңүз:','User deletion is not allowed 