rmatting'=>'Форматтоо','Writing Settings'=>'Жарыялоо жөндөөлөрү','Encoding for pages and feeds'=>'Барак жана түрмөк коддоосу','Full text'=>'Толук текст','Syndication feeds show the most recent'=>'RSS түрмөгүндө эң соңку көрсөтүү','posts'=>'жазма','Blog pages show at most'=>'Көрсөтүлө турган максималдуу блог баракчалары','<strong>Warning:</strong> these pages should not be the same!'=>'<strong>Эскертүү:</strong> Бул барактар окшош болбошу керек!','Posts page: %s'=>'Жазуулардын барагы: %s','A <a href="%s">static page</a> (select below)'=>'<a href="%s">Статикалык баракты</a> (төмөндө тандаңыз)','Reading Settings'=>'Окуу жөндөөлөрү','Privacy Settings'=>'Купуялык Жөндөөлөрү','If you temporarily make your site&#8217;s root directory writable to generate the %s file automatically, do not forget to revert the permissions after the file has been created.'=>'Эгер сиз %s файлы автоматтык түрдө түзүлүшү үчүн сайттын түпкү каталогун убактылуу жазыла турган кылып койгон болсоңуз, эрежелер сакталгандан кийин баштапкы уруксаттарга кайтып келүүнү унутпаңыз.','If you temporarily make your %s file writable to generate rewrite rules automatically, do not forget to revert the permissions after the rule has been saved.'=>'Эгер сиз шилтемени которуу эрежелерин автоматтык түрдө түзө алышыбыз үчүн %s файлын убактылуу жазыла турган кылып койсоңуз, эрежелер сакталгандан кийин баштапкы уруксаттарга кайтууну унутпаңыз.','Tag base'=>'Тег префикси','Category base'=>'Категория префикси','Optional'=>'Кошумча','Custom Structure'=>'Ыктыярдуу','Numeric'=>'Сан','Month and name'=>'Ай жана аты','Day and name'=>'Күн жана аты','Permalink structure updated.'=>'Туруктуу шилтемелердин түзүлүшү жаңыланды.','Permalink structure updated. Remove write access on %s file now!'=>'Туруктуу шилтеме структурасы жаңыртылган. Эми %s файлынан жазуу мүмкүнчүлүгүн алып салыңыз!','Permalink Settings'=>'Туруктуу шилтеме жөндөөлөрү','Organize my uploads into month- and year-based folders'=>'Жүктөлгөн файлдарды ай жана жыл боюн