дуу рейтинг','Show Avatars'=>'Аватарларды көрсөтүү','Avatar Display'=>'Аватарларды көрсөтүү','Avatars'=>'Аватарлар','When a comment contains any of these words in its content, author name, URL, email, IP address, or browser&#8217;s user agent string, it will be put in the Trash. One word or IP address per line. It will match inside words, so &#8220;press&#8221; will match &#8220;WordPress&#8221;.'=>'Эгерде комментарийде бул сөздөрдүн кайсынысы болбосун анын текстинде, автордун аты-жөнү, URL дареги, email дареги же IP дареги камтылган болсо, анда ал таштандыга чыгарылат. Ар бир сөз же IP жаңы сапта берилет. Ички сөз издөө аркылуу колдонулат, башкача айтканда, &#8220;press&#8221; деген сөздөн кийин &#8220;WordPress&#8221; табылат.','When a comment contains any of these words in its content, author name, URL, email, IP address, or browser&#8217;s user agent string, it will be held in the <a href="edit-comments.php?comment_status=moderated">moderation queue</a>. One word or IP address per line. It will match inside words, so &#8220;press&#8221; will match &#8220;WordPress&#8221;.'=>'Эгерде комментарийде бул сөздөрдүн кайсынысы болбосун анын текстинде, автордун аты-жөнү, URL, email дареги же IP дареги камтылса, анда аны модерация үчүн <a href="edit-comments.php?comment_status=moderated">кезегине коюңуз. </a>. Ар бир сөз же IP жаңы сапта. Ички сөз издөө аркылуу колдонулат, башкача айтканда, &#8220;press&#8221; деген сөздөн кийин &#8220;WordPress&#8221; табылат.','Hold a comment in the queue if it contains %s or more links. (A common characteristic of comment spam is a large number of hyperlinks.)'=>'Комментарийде %s шилтемеден ашык болсо, модерацияга кезекке кой. (Спамдын мүнөздүү өзгөчөлүгү &#8212; көп сандагы шилтемелер.)','Comment Moderation'=>'Комментарийлерди модерациялоо','Comment author must have a previously approved comment'=>'Автордун буга чейин жактырылган комментарийлери болушу керек','Before a comment appears'=>'Комментарий пайда боло электе','A comment is he